.is_ultra_restricted}}\n\t\t\t\t\t\t\t\t\tSingle-Channel Guest{{!--#if ura_channel}} in #{{ura_channel}}{{\/if--}}\n\t\t\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t\t\t{{raLabel 'Restricted Account'}}\n\t\t\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t\t<\/span>\n\t\t\t\t\t\t<\/span>\n\t\t\t\t\t{{else if member.is_bot}}\n\t\t\t\t\t\t<span class=\"member_type_and_description float_left old_petunia_grey lato\">\n\t\t\t\t\t\t\t<span class=\"overflow_ellipsis\">Non-sentient Bot<\/span>\n\t\t\t\t\t\t<\/span>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/pageNeedsEnterprise}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t<\/div>\n\n\t<p class=\"dm_explanation margin_auto align_left clear_both\">\n\t\t{{#if member.is_self}}\n\t\t\t{{#feature flag=\"feature_tos_oct2016\"}}\n\t\t\t\t<strong>This is your space.<\/strong> Draft messages, list your to-dos, or keep links and files handy. You <em>can<\/em> also talk to yourself here, but please bear in mind you'll have to supply both sides of the conversation.\n\t\t\t{{else}}\n\t\t\t\t{{#if compliance_exports_enabled_for_team}}\n\t\t\t\t\t<strong>This is your space.<\/strong> Draft messages, list your to-dos, or keep links and files handy. You <em>can<\/em> also talk to yourself here, but bear in mind you'll have to supply both sides of the conversation.<br><br>These notes are just for you \u2014 but please note that all messages and notes sent on or after {{toDate compliance_export_start}} are accessible to your Team Owners via <a href=\"https:\/\/get.slack.help\/hc\/en-us\/articles\/203950296-FAQs-about-privacy#complianceexport\">Compliance Exports<\/a>.\n\t\t\t\t{{else}}\n\t\t\t\t\t<strong>This is your space.<\/strong> Only you can see these notes. Draft messages, list your to-dos, or keep links and files handy. You <em>can<\/em> also talk to yourself here, but please bear in mind you'll have to supply both sides of the conversation.\n\t\t\t\t{{\/if}}\n\t\t\t{{\/feature}}\n\t\t{{else}}\n\t\t\tThis is <span class=\"not_limited_copy\">the very beginning of<\/span> your direct message history with\n\t\t\t{{#if members~}}\n\t\t\t\t{{#each members~}}\n\t\t\t\t\t{{#unless @first}}{{#if_gt ..\/members.length compare=2}},{{\/if_gt}} {{\/unless}}{{#if @last}}and {{\/if~}}\n\t\t\t\t\t{{#feature flag=\"feature_name_tagging_client\"}}<strong>{{getMemberFullName this}}<\/strong>{{else}}<strong>{{getMemberDisplayName this}}<\/strong>{{\/feature}}\n\t\t\t\t{{~\/each}}.\n\t\t\t{{else}}\n\t\t\t\t{{#feature flag=\"feature_name_tagging_client\"}}<strong>{{getMemberFullName member}}<\/strong>{{else}}<strong>{{getMemberDisplayName member}}<\/strong>{{\/feature}}.\n\t\t\t{{\/if}}\n\n\t\t\t{{#feature flag=\"feature_tos_oct2016\"}}\n\t\t\t{{else}}\n\t\t\t\t{{#if compliance_exports_enabled_for_team}}\n\t\t\t\t\tDirect messages are generally private {{#if members}}within this group{{else}}between you and {{getMemberDisplayName member}}{{\/if}}, but all messages in this team sent on or after {{toDate compliance_export_start}} are accessible to your Team Owners via <a href=\"https:\/\/get.slack.help\/hc\/en-us\/articles\/203950296-FAQs-about-privacy#complianceexport\">Compliance Exports<\/a>.\n\t\t\t\t{{else}}\n\t\t\t\t\tDirect messages are private {{#if members}}within this group{{else}}between the two of you{{\/if}}.\n\t\t\t\t{{\/if}}\n\t\t\t{{\/feature}}\n\t\t{{\/if}}\n\t<\/p>\n\t{{#if members}}\n\t\t{{#if desktop_notifs_enabled}}\n\t\t\t<div class=\"mpim_notif_prefs special_formatting_quote medium_bottom_margin\">\n\t\t\t\t<div class=\"quote_bar\">\n\t\t\t\t\t<div class=\"shim\"><\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<p class=\"content\">\n\t\t\t\t\t<span class=\"bold\">Send me desktop notifications for:<\/span>\n\t\t\t\t\t<span class=\"mini small_left_margin\"><a class=\"more_options\">More options<\/a><\/span>\n\t\t\t\t\t{{#if_equal desktop_setting compare=\"nothing\"}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t{{#unless is_muted}}\n\t\t\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t\t\t<input id=\"all_notifications_rd\" type=\"radio\" name=\"notifications\" {{#if_equal desktop_setting compare=\"everything\"}}checked=\"checked\"{{\/if_equal}}>\n\t\t\t\t\t\t\tActivity of any kind\n\t\t\t\t\t\t<\/label>\n\t\t\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t\t\t<input id=\"mentions_rd\" type=\"radio\" name=\"notifications\" {{#if_equal desktop_setting compare=\"mentions\"}}checked=\"checked\"{{\/if_equal}}>\n\t\t\t\t\t\t\tOnly mentions of my name or highlight words\n\t\t\t\t\t\t<\/label>\n\t\t\t\t\t{{\/unless}}\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t\t<label class=\"checkbox no_margin normal {{#if_equal desktop_setting compare=\"nothing\"}}{{#if is_muted}}hidden{{\/if}}{{else}}hidden{{\/if_equal}}\">\n\t\t\t\t\t\t<input id=\"no_notifications_cb\" type=\"checkbox\" checked=\"checked\">\n\t\t\t\t\t\tNo notifications\n\t\t\t\t\t<\/label>\n\t\t\t\t\t<label class=\"checkbox no_margin normal {{#if is_muted}}{{else}}hidden{{\/if}}\">\n\t\t\t\t\t\t<input id=\"notifications_muted_cb\" type=\"checkbox\" checked=\"checked\">\n\t\t\t\t\t\tMute this conversation\n\t\t\t\t\t<\/label>\n\t\t\t\t<\/p>\n\t\t\t<\/div>\n\t\t{{else}}\n\t\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t\t{{#if notifications_not_yet_allowed}}\n\t\t\t\t\t<span>You have not yet allowed desktop notifications. Open the <a onclick=\"TS.ui.prefs_dialog.start('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> and follow the instructions to set them up.<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if notifications_not_allowed}}\n\t\t\t\t\t<span>You've disallowed notifications in your browser. You'll need to open your browser preferences to change that.<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if notifications_impossible}}\n\t\t\t\t\t<span>Your browser does not support desktop notifications. <a href=\"\/downloads\" target=\"_blank\">Try one of our apps?<\/a><\/span>\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t{{\/if}}\n";
TS.raw_templates['slackbot_badge'] = "<h1>Hi, Slackbot here!<\/h1>\n<div class=\"cursor_pointer flex_none float_left small_left_margin very_small_top_margin\" onclick=\"TS.client.ui.previewMember('{{member.id}}', 'im_page');\">\n\t{{makeMemberPreviewLinkImage member.id 48 false true}}\n<\/div>\n\n{{#slackbotHelpEnabled}}\n\t<p class=\"icon_offset\">You can ask me simple questions about how Slack works, or just type a few keywords. For example: <strong>Can I edit a message I've posted?<\/strong> Or simply: <strong>edit message<\/strong>.<\/p>\n\t<div class=\"clear_both\"><\/div>\n\t<p class=\"icon_offset\">I'm only a bot, but I'll do my best to answer! If I don't understand, I'll search the <a href=\"https:\/\/get.slack.help\/hc\/en-us\">Help Center<\/a>.<\/p>\n\t{{#feature flag=\"feature_tos_oct2016\"}}\n\t{{else}}\n\t\t{{#if compliance_exports_enabled_for_team}}\n\t\t\t<p class=\"icon_offset\"><strong>Please note:<\/strong>  Ask anything you want, bearing in mind that every message in this team sent on or after <span class=\"js_compliance_export_start\">{{toDate compliance_export_start}}<\/span> is accessible to your team owners via Compliance Exports.<\/p>\n\t\t{{\/if}}\n\t{{\/feature}}\n{{else}}\n\t<p class=\"icon_offset\">This is <span class=\"not_limited_copy\">the very beginning of<\/span> your message history with Slackbot. Slackbot tries to be helpful (but is only a bot, after all).<\/p>\n\t<div class=\"clear_both\"><\/div>\n\t<i class=\"ts_icon ts_icon_lightbulb_o callout\"><\/i>\n\t<p class=\"icon_offset\"><strong>Tip:<\/strong> Use this message area as your personal scratchpad: anything you type here is private just to you, but shows up in your personal search results. Great for notes, addresses, links or anything you want to keep track of.<\/p>\n\t<i class=\"callout\">\n\t<a href=\"https:\/\/twitter.com\/slackhq\" target=\"new\"><img src=\"{{versioned_twitter_64}}\" class=\"align_top\" \/><\/a>\n\t<\/i>\n\t<p class=\"icon_offset\">\n\t\tFor more tips, along with news and announcements, follow our Twitter account <a href=\"https:\/\/twitter.com\/slackhq\" target=\"new\" class=\"bold\">@slackhq<\/a> and check out the <a href=\"https:\/\/twitter.com\/search?f=realtime&q=%23changelog%20from%3Aslackhq&src=typd\" target=\"new\" class=\"bold\">#changelog<\/a>.\n\t<\/p>\n{{\/slackbotHelpEnabled}}\n";
