TS.raw_templates['star_item'] = "\t{{#if_equal star.type compare=\"channel\"}}\n\t\t{{starWithTip 'channel' star.channel null}}\n\t\t<strong>{{{makeChannelLinkById star.channel}}}<\/strong> <span class=\"star_meta\">(channel)<\/span>\n\t{{\/if_equal}}\n\n\t{{#if_equal star.type compare=\"group\"}}\n\t\t{{starWithTip 'group' star.channel null}}\n\t\t<strong>{{{makeGroupLinkById star.channel}}}<\/strong> <span class=\"star_meta\">(private channel)<\/span>\n\t{{\/if_equal}}\n\n\t{{#if_equal star.type compare=\"im\"}}\n\t\t{{starWithTip 'im' star.channel null}}\n\t\t<strong>{{{makeIMLinkById star.channel}}}<\/strong> <span class=\"star_meta\">(direct message conversation)<\/span>\n\t{{\/if_equal}}\n\n\t{{#if_equal star.type compare=\"file_comment\"}}\n\t\t{{#if star.file.is_deleted}}\n\t\t{{else}}\n\t\t\t{{#if from_starred_item}}\n\t\t\t\t<div class=\"file_comment_item\">\n\t\t\t\t\t<div class=\"actions\">\n\t\t\t\t\t\t<div class=\"file_star btn_icon btn btn_outline ts_tip_btn ts_tip ts_tip_top\">\n\t\t\t\t\t\t\t{{starWithTip 'file_comment' star.comment star.file true}}\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t{{{comment_standalone star.comment star.file true}}}\n\t\t\t\t<\/div>\n\t\t\t{{else}}\n\t\t\t\t{{starWithTip 'file_comment' star.comment star.file}}\n\t\t\t\t{{{comment_standalone star.comment star.file}}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t{{\/if_equal}}\n\n";
