TS.raw_templates['channel_create_dialog'] = "\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t{{#if is_edit}}\n\t\t\t<h3>Rename this channel<\/h3>\n\t\t{{else}}\n\t\t\t<h3 class=\"create_header\">Create a channel<\/h3>\n\t\t{{\/if}}\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t{{#unless is_edit}}\n\t\t\t<p class=\"no_bottom_margin\"><strong>This will create a new public channel that anyone on your team can join.<\/strong><\/p>\n\t\t\t{{#unless hide_private_group_option}}\n\t\t\t\t<p class=\"mini\">If you need this conversation to be private, you should <a onclick=\"TS.ui.channel_create_dialog.switchToGroup();\" class=\"bold\">create a new private channel instead<\/a>.<\/p>\n\t\t\t{{\/unless}}\n\t\t{{\/unless}}\n\t\t<p class=\"top_margin\">\n\t\t\t<label for=\"channel_create_title\" class=\"inline_block\">Name<\/label>\n\t\t\t<input id=\"channel_create_title\" name=\"title_input\" type=\"text\" class=\"small title_input {{#isWeb}}no_bottom_margin{{\/isWeb}}\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" \/>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note{{\/isWeb}}\">\n\t\t\t\tNames should be lowercase, with no spaces.\n\t\t\t<\/span>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden name_taken_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\tThat name has been taken. Try something different.\n\t\t\t<\/span>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden invalid_chars_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\tYou entered some disallowed characters in the name, which we've fixed. Make sure it looks good to you, and try again!\n\t\t\t<\/span>\n\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden single_punctuation_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\tSorry! Names cannot be a single hyphen or underscore.\n\t\t\t<\/span>\n\t\t<\/p>\n\t\t{{#unless is_edit}}\n\t\t\t<p>\n\t\t\t\t<label for=\"channel_purpose_input\" class=\"inline_block\">\n\t\t\t\t\tPurpose{{#isClient}}<br \/>{{\/isClient}}\n\t\t\t\t\t<span class=\"normal\">(optional)<\/span>\n\t\t\t\t<\/label>\n\t\t\t\t<textarea id=\"channel_purpose_input\" name=\"channel_purpose_input\" {{#isWeb}}class=\"no_bottom_margin\"{{\/isWeb}} type=\"text\" style=\"height: 4.5rem;\" maxlength=\"{{ChannelPurposeMaxLength}}\">{{purpose}}<\/textarea>\n\t\t\t\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note{{\/isWeb}}\">What\u2019s this channel about?<\/span>\n\t\t\t<\/p>\n\t\t{{\/unless}}\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<a class=\"btn btn_outline dialog_cancel\">Cancel<\/a>\n\t\t{{#if is_edit}}\n\t\t\t{{#if is_group}}\n\t\t\t\t<button class=\"btn dialog_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">Rename Private Channel<\/span><\/button>\n\t\t\t{{else}}\n\t\t\t\t<button class=\"btn dialog_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">Rename Channel<\/span><\/button>\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t<button class=\"btn dialog_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">Create Channel<\/span><\/button>\n\t\t{{\/if}}\n\t<\/div>\n";
TS.raw_templates['purpose_dialog'] = "\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if model_ob.purpose.value}}Edit{{else}}Set{{\/if}} channel purpose<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t<p>\n\t\t\t<label for=\"purpose_input\" class=\"inline_block\" style=\"min-width: 6rem; padding-right: 1rem;\">\n\t\t\t\tPurpose<br \/>\n\t\t\t\t<span class=\"normal\">(optional)<\/span>\n\t\t\t<\/label>\n\t\t\t<textarea id=\"purpose_input\" name=\"purpose_input\" type=\"text\" style=\"height: 4.5rem;\" maxlength=\"{{ChannelPurposeMaxLength}}\" tabindex=\"1\">{{unFormatMessage model_ob.purpose.value}}<\/textarea>\n\t\t\t<span class=\"modal_input_note\" style=\"margin-left: 100px;\">\n\t\t\t\tGive your channel a purpose that describes what it will be used for.\n\t\t\t\t{{#if model_ob.purpose.creator}}\n\t\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\t\t<br \/>\n\t\t\t\t\t\tThe purpose was last set by {{{makeMemberPreviewLinkById model_ob.purpose.creator}}} on {{toCalendarDate model_ob.purpose.last_set}}.\n\t\t\t\t\t{{\/if}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/span>\n\t\t<\/p>\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<a class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">Cancel<\/a>\n\t\t<a class=\"btn dialog_go\" tabindex=\"2\">Update Purpose<\/a>\n\t<\/div>\n";
TS.raw_templates['group_create'] = "\t{{#feature flag=\"feature_tos_oct2016\"}}\n\t{{else}}\n\t\t{{#if compliance_exports_enabled_for_team}}\n\t\t\t<p>Messages shared in groups are generally private to the people invited to the group. Note, however, that messages in this group and elsewhere in your team may be accessible to your Team Owners via <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/203950296-FAQs-about-Slack-s-policy-update#complianceexport\">Compliance Exports<\/a>. See <a href=\"\/account\/team\">Your Team Settings<\/a> to learn more.<\/p>\n\t\t{{else}}\n\t\t\t<p>A private group is only visible to its members, and only members of a private group can read or search its contents.<\/p>\n\t\t{{\/if}}\n\t{{\/feature}}\n\t<p class=\"top_margin\">\n\t\t<label for=\"title_input\" class=\"inline_block\">Name<\/label>\n\t\t<input id=\"group_create_title\" name=\"title_input\" type=\"text\" class=\"small title_input\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" \/>\n\t\t<span class=\"modal_input_note\" id=\"title_prompt\">\n\t\t\tNames must be lower case and cannot contain spaces or periods.\n\t\t<\/span>\n\t\t<span class=\"modal_input_note hidden alert name_taken_warning\">\n\t\t\tThat name has been taken. Try something different.\n\t\t<\/span>\n\t\t<span class=\"modal_input_note hidden alert name_missing_warning\">\n\t\t\tEnter a title for the group please!\n\t\t<\/span>\n\t\t<span class=\"modal_input_note hidden alert no_invites_warning\">\n\t\t\tThere's no point in a group with only one member. Invite people!\n\t\t<\/span>\n\t\t<span class=\"modal_input_note hidden alert existing_groups_warning\">\n\t\t\tTo be filled in by dialog\n\t\t<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"group_purpose_input\" class=\"inline_block\">\n\t\t\tPurpose<br \/>\n\t\t\t<span class=\"normal\">(optional)<\/span>\n\t\t<\/label>\n\t\t<textarea id=\"group_purpose_input\" name=\"group_purpose_input\" type=\"text\" style=\"height: 3.5rem;\" maxlength=\"{{ChannelPurposeMaxLength}}\">{{purpose}}<\/textarea>\n\t\t<span class=\"modal_input_note\">Give your group a purpose that describes what it will be used for.<\/span>\n\t<\/p>\n\t\n\t<div id=\"create_invite_group_members_holder\">\n\t\t{{#if show_ra_tip}}\n\t\t\t<span class=\"tiny_bottom_margin modal_input_note\">\n\t\t\t\t{{raLabel 'Restricted accounts'}} may not appear below. Ask a Team Admin to invite them after you create the group.\n\t\t\t<\/span>\n\t\t{{\/if}}\n\t\t<p class=\"no_bottom_margin\" id=\"select_create_invite_group_members_holder\">\n\t\t\t<label for=\"group_members\" class=\"inline_block\">Invite Members<\/label>\n\t\t\t<select multiple=\"multiple\" id=\"select_create_invite_group_members\" name=\"group_members\" size=\"30\">\n\t\t\t\t{{#each invite_members}}\n\t\t\t\t\t<option value=\"{{this.member.id}}\" {{#if this.preselected}}selected=\"selected\"{{\/if}}>{{#if this.member.profile.real_name}}{{this.member.profile.real_name}} \u2022 {{this.member.name}}{{else}}{{this.member.name}}{{\/if}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t\t<\/select>\t\t\n\t\t<\/p>\n\t<\/div>\n";
TS.raw_templates['channel_prefs_dialog'] = "<div class=\"modal-header\">\n\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t<h3>Notification Preferences: {{display_name}}<\/h3>\n<\/div>\n<div class=\"modal-body feature_muting\">\n\n\t<div id=\"notifications_not_working\" class=\"hidden\">\n\t\t<p class=\"bold small_bottom_margin\"><i class=\"ts_icon ts_icon_laptop ts_icon_inherit small_right_margin\" style=\"margin-left: 0.4rem; width: 1rem\"><\/i> Desktop notifications<\/p>\n\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t<span id=\"notifications_not_yet_allowed\" class=\"hidden\">You have not yet allowed desktop notifications. Open the <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> and follow the instructions to set them up.<\/span>\n\t\t\t<span id=\"notifications_not_enabled\" class=\"hidden\">You've disabled desktop notifications. Open the <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> to change that.<\/span>\n\t\t\t<span id=\"notifications_not_allowed\" class=\"hidden\">You've disallowed notifications in your browser. You'll need to open your browser preferences to change that.<\/span>\n\t\t\t<span id=\"notifications_impossible\" class=\"hidden\">Your browser does not support desktop notifications. <a href=\"\/downloads\" target=\"_blank\">Try one of our apps?<\/a><\/span>\n\t\t<\/p>\n\t<\/div>\n\n\t<div id=\"non_muting_prefs\" {{#if is_muted}}style=\"display: none;\"{{\/if}}>\n\n\t\t<div id=\"notifications_working\" class=\"hidden\">\n\t\t\t<p class=\"bold small_bottom_margin\"><i class=\"ts_icon ts_icon_laptop ts_icon_inherit small_right_margin\" style=\"margin-left: 0.4rem; width: 1rem\"><\/i> Desktop notifications<\/p>\n\t\t\t<p class=\"small_left_margin\">\n\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t<input name=\"channel_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"everything\" \/> Activity of any kind <span id=\"all_everything_default\" class=\"bold\">(default)<\/span>\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t<input name=\"channel_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"mentions\" \/> Mentions of my name or highlight words <span id=\"all_mentions_default\" class=\"bold\">(default)<\/span>\n\t\t\t\t<\/label>\n\n\t\t\t\t{{#if show_two_suppressed_cbs}}\n\t\t\t\t\t<span id=\"suppressed_span\" class=\"large_left_margin inline_block\">\n\t\t\t\t\t<label class=\"checkbox no_margin\" id=\"suppressed_label\">\n\t\t\t\t\t\t<input id=\"suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/> Except for @channel mentions <span id=\"suppressed_disabled_explain\" class=\"normal mini subtle_silver\">(disabled due to <strong id=\"suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">team settings<\/strong>)<\/span>\n\t\t\t\t\t<\/label>\n\t\t\t\t\t<\/span>\n\t\t\t\t{{\/if}}\n\n\t\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t\t<input name=\"channel_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"nothing\" \/> Nothing <span id=\"all_nothing_default\" class=\"bold\">(default)<\/span>\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<p class=\"bold small_bottom_margin\"><i class=\"ts_icon ts_icon_mobile ts_icon_inherit\" style=\"font-size: 19px; width: 1rem; margin-left: 0.3rem; margin-right: 0.3rem;\"><\/i> Mobile push notifications<\/p>\n\t\t<p class=\"small_left_margin\">\n\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t<input name=\"channel_push_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"everything\" \/> Activity of any kind <span id=\"all_push_everything_default\" class=\"bold\">(default)<\/span>\n\t\t\t<\/label>\n\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t<input name=\"channel_push_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"mentions\" \/> Mentions of my name or highlight words <span id=\"all_push_mentions_default\" class=\"bold\">(default)<\/span>\n\t\t\t<\/label>\n\n\t\t\t{{#if show_two_suppressed_cbs}}\n\t\t\t\t<span id=\"push_suppressed_span\" class=\"large_left_margin inline_block\">\n\t\t\t\t<label class=\"checkbox no_margin\" id=\"push_suppressed_label\">\n\t\t\t\t\t<input id=\"push_suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/> Except for @channel mentions <span id=\"push_suppressed_disabled_explain\" class=\"normal mini subtle_silver\">(disabled due to <strong id=\"push_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">team settings<\/strong>)<\/span>\n\t\t\t\t<\/label>\n\t\t\t\t<\/span>\n\t\t\t{{\/if}}\n\n\t\t\t<label class=\"radio no_margin normal\">\n\t\t\t\t<input name=\"channel_push_loud_rd\" type=\"radio\" class=\"small_right_margin\" value=\"nothing\" \/> Nothing <span id=\"all_push_nothing_default\" class=\"bold\">(default)<\/span>\n\t\t\t<\/label>\n\t\t<\/p>\n\n\t\t{{#if show_one_suppressed_cb}}\n\t\t\t<div id=\"single_suppressed_div\">\n\t\t\t\t<p class=\"bold no_bottom_margin\" style=\"margin-left: 0.45rem;\">\n\t\t\t\t\t{{#if model_ob.is_general}}@everyone{{else}}@channel{{\/if}} notifications\n\t\t\t\t<\/p>\n\t\t\t\t<p class=\"small_left_margin\">\n\t\t\t\t\t<label class=\"checkbox no_margin normal\" id=\"single_suppressed_label\">\n\t\t\t\t\t\t<input id=\"single_suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/>Mute notifications for <strong>{{#if model_ob.is_general}}@everyone{{else}}@channel{{\/if}}<\/strong> and <strong>@here<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(on mobile)<\/span><span id=\"single_suppressed_desktop_qualifier\">(on desktop)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Disabled by <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">admin<\/strong><\/span>\n\t\t\t\t\t<\/label>\n\t\t\t\t<\/p>\n\t\t\t<\/div>\n\t\t{{\/if}}\n\n\t<\/div>\n\n\t<div id=\"muting_div\">\n\t\t<p class=\"bold no_bottom_margin\">\n\t\t\t<label class=\"checkbox no_margin no_left_padding\" id=\"muting_label\">\n\t\t\t\t<i class=\"ts_icon ts_icon_bell_slash ts_icon_inherit small_right_margin\" style=\"font-size: 18px; margin-left: 0.5rem; width: 1rem\"><\/i> Mute this {{#if is_mpim}}conversation{{else}}{{#if_equal c_or_g compare=\"channel\"}}channel{{else}}private channel{{\/if_equal}}{{\/if}}\n\t\t\t\t<input id=\"muting_cb\" checked=\"checked\" type=\"checkbox\" style=\"float: none; margin: -1px 0 0 0.5rem !important; vertical-align: middle;\" \/>\n\t\t\t<\/label>\n\t\t<\/p>\n\t\t<p class=\"small_left_margin no_bottom_margin\">\n\t\t\tMuting prevents all notifications from this {{#if is_mpim}}conversation{{else}}{{#if_equal c_or_g compare=\"channel\"}}channel{{else}}private channel{{\/if_equal}}{{\/if}} and prevents the {{#if is_mpim}}conversation{{else}}channel{{\/if}} from appearing as unread unless you are mentioned.\n\t\t<\/p>\n\t<\/div>\n\n<\/div>\n<div class=\"modal-footer\">\n\t<p class=\"mini float_left small_top_margin no_bottom_margin\">Set your default notifications settings in your <a href=\"\/account\/notifications\" target=\"_blank\" class=\"bold\">Account Preferences<\/a><\/p>\n\t<a class=\"btn dialog_go\">Done<\/a>\n<\/div>\n";
TS.raw_templates['file_upload_dialog'] = "\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>Upload a file? <span class=\"file_count\"><\/span><\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t\n\t\t{{#if over_storage_limit}}\n\t\t\t<p class=\"alert alert_warning\">\n\t\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t\tYour team is over its storage limit.<br \/> Please <a href=\"\/pricing\" target=\"{{newWindowName}}\" class=\"bold underline\">upgrade to a paid tier<\/a> or <a href=\"\/files\" target=\"{{newWindowName}}\" class=\"bold underline\">delete some larger files<\/a>.<\/p>\n\t\t{{\/if}}\n\t\t\n\t\t<div id=\"upload_image_preview\" class=\"hidden bottom_margin\">\n\t\t\t<img src=\"\" \/>\n\t\t<\/div>\n\t\t\n\t\t<p>\n\t\t\t<label for=\"upload_file_title\" class=\"inline_block\">Title<\/label>\n\t\t\t<input id=\"upload_file_title\" name=\"upload_file_title\" type=\"text\" class=\"small title_input\" value=\"{{title}}\" tabindex=\"1\"\/>\n\t\t\t<span class=\"modal_input_note\">\n\t\t\t\tTitles are the easiest ways to search for files: it pays to be descriptive.\n\t\t\t<\/span>\n\t\t\t<input id=\"upload_file_name\" name=\"upload_file_name\" type=\"hidden\" {{#if has_name}}disabled=\"disabled\"{{else}}{{\/if}} class=\"filename_input\" value=\"{{filename}}\" \/>\n\t\t<\/p>\n\t\t\n\t\t{{{sharing_html}}}\n\t\t\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<div class=\"span_1_of_1\">\n\t\t\t{{#if file_retention_type}}\n\t\t\t\t<div class=\"modal_input_note_full_width float_left inline_block align_left\">\n\t\t\t\t\tDue to your team\u2019s custom file retention <br \/>policy, this file will be deleted after <span class=\"bold\">{{file_retention_duration}}<\/span>.\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t\t{{#if more_in_queue}}<a class=\"btn btn_outline dialog_cancel_all\" tabindex=\"5\">Cancel All<\/a>{{\/if}}\n\t\t\t<a class=\"btn btn_outline dialog_cancel\" tabindex=\"5\">Cancel<\/a>\n\t\t\t<a class=\"btn dialog_go\" tabindex=\"6\">Upload<\/a>\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['gdrive_create_dialog'] = "<p>\n\t<label for=\"document_title\" class=\"inline_block\">Title<\/label>\n\t<input id=\"document_title\" name=\"document_title\" type=\"text\" class=\"small title_input\" value=\"\" tabindex=\"1\" maxlength=\"255\" \/>\n\t<span class=\"modal_input_note\">\n\t\tTitles are the easiest ways to search for files: it pays to be descriptive.\n\t<\/span>\n<\/p>\n\n{{sharing_html}}";
TS.raw_templates['share_dialog'] = "\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>\n\t\t\tShare\n\t\t\t{{#if_equal type compare='file'}}file{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_snippet'}}snippet{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_post'}}post{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_space'}}post{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_multnomah'}}multnomah{{\/if_equal}}\n\t\t<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<input type=\"hidden\" id=\"share_type\" value=\"{{type}}\" \/>\n\t\t<input type=\"hidden\" id=\"share_item_id\" value=\"{{item.id}}\" \/>\n\n\t\t{{{file_html}}}\n\n\t\t{{{sharing_html}}}\n\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<a class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">Cancel<\/a>\n\t\t<a class=\"btn dialog_go\" tabindex=\"2\">Share<\/a>\n\t<\/div>\n";
TS.raw_templates['snippet_dialog'] = "\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{mode}} snippet<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<form action=\"\" id=\"client_file_snippet\" method=\"post\" accept-encoding=\"UTF-8\" onsubmit=\"return false;\" class=\"no_bottom_margin\">\n\n\t\t\t<div class=\"top_margin\">\n\t\t\t\t<label id=\"client_file_snippet_select_label\" class=\"select small float_right no_right_padding\">\n\t\t\t\t\t<select name=\"filetype\" id=\"client_file_snippet_select\" name=\"client_file_snippet_select\" class=\"small no_top_margin\">\n\t\t\t\t\t\t<option value=\"auto\">Auto Detect Type<\/option>\n\t\t\t\t\t\t{{#each codemirror_types}}\n\t\t\t\t\t\t\t<option value=\"{{this.type}}\">{{this.label}}<\/option>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t\t<input type=\"text\" id=\"client_file_snippet_title_input\" class=\"small\" name=\"client_file_snippet_title_input\" value=\"\" placeholder=\"Title (optional)\" \/>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"top_margin bottom_margin\">\n\t\t\t\t<textarea name=\"content\" wrap=\"virtual\" id=\"client_file_snippet_textarea\" class=\"client_file_snippet_textarea full_width{{#if_equal mode compare=\"Create\"}} create_snippet{{\/if_equal}}\"><\/textarea>\n\t\t\t\t<label class=\"checkbox normal mini float_right no_min_width\" style=\"margin-top: 3px; padding-right: 0; width: auto;\">\n\t\t\t\t\t<input type=\"checkbox\" id=\"client_file_wrap_cb\" {{#if wrap_lines}}checked{{\/if}}> wrap\n\t\t\t\t<\/label>\n\t\t\t<\/div>\n\n\t\t\t{{{sharing_html}}}\n\n\t\t<\/form>\n\n\t<\/div>\n\n\t<div class=\"modal-footer\">\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">\n\t\t\t\t{{#if_equal mode compare=\"Edit\"}}\n\t\t\t\t\tAre you sure you want to discard your changes?\n\t\t\t\t{{else}}\n\t\t\t\t\tAre you sure you want to discard this snippet permanently?\n\t\t\t\t{{\/if_equal}}\n\t\t\t<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel_decline\">No, keep it<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">\n\t\t\t\t{{#if_equal mode compare=\"Edit\"}}\n\t\t\t\t\tYes, discard the changes\n\t\t\t\t{{else}}\n\t\t\t\t\tYes, discard this snippet\n\t\t\t\t{{\/if_equal}}\n\t\t\t<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-action\">\n\t\t\t<a class=\"btn btn_outline cancel\" data-dismiss=\"modal\" tabindex=\"3\">Cancel<\/a>\n\t\t\t{{#if_equal mode compare=\"Edit\"}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top ts_tip_hide\" tabindex=\"2\">\n\t\t\t\tSave changes\n\t\t\t\t<span class=\"ts_tip_tip\">Add text before saving your changes<\/span>\n\t\t\t<\/a>\n\t\t\t{{\/if_equal}}\n\t\t\t{{#if_equal mode compare=\"Create\"}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top\" tabindex=\"2\">\n\t\t\t\tCreate Snippet\n\t\t\t\t<span class=\"ts_tip_tip\">Add text before saving your snippet<\/span>\n\t\t\t<\/a>\n\t\t\t{{\/if_equal}}\n\t\t<\/div>\n\t<\/div>\n\n";
TS.raw_templates['growl_prompt_overlay'] = "\t<div id=\"growl_prompt_overlay\">\n\t\n\t\t<div id=\"growl_prompt_overlay_impossible\" class=\"hidden\">\t\t\t\n\t\t\t<h3>The browser you're using doesn't support desktop notifications.<\/h3>\n\t\t\t<p>When someone mentions you or sends you a direct message in Slack, we can let you know via a desktop notification.<\/p>\n\t\t\t<p>If you'd like to get desktop notifications from Slack, you can use a browser that supports them (like <a href=\"http:\/\/www.google.com\/chrome\/\" class=\"bold\">Google Chrome<\/a>), or download one of our <a href=\"\/downloads\" class=\"bold\" target=\"{{newWindowName}}\">desktop apps<\/a>.<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"large_top_margin no_bottom_margin\">\n\t\t\t\t<a href=\"\/downloads\" class=\"btn btn_small  see-apps\" target=\"{{newWindowName}}\">See our Apps<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">Not for me<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\t\t\n\t\t<div id=\"growl_prompt_overlay_start\" class=\"hidden\">\t\t\t\n\t\t\t<h3>Turn on desktop notifications?<\/h3>\n\t\t\t<p>When someone mentions you or sends you a direct message in Slack, we will let you know via a desktop notification.<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_allow btn btn_small \">Yes, turn on notifications<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">No, don't turn them on<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\t\t\n\t\t<div id=\"growl_prompt_overlay_tell_to_allow\" class=\"hidden\">\n\t\t\t<i class=\"ts_icon ts_icon_arrow_circle_up block float_right\" style=\"font-size: 3.5rem; margin: 0 1rem 0 0;\"><\/i>\n\t\t\t<h3>Turn on desktop notifications?<\/h3>\n\t\t\t<p class=\"no_bottom_margin\">Click <strong>Allow<\/strong> above to turn on desktop notifications.<\/p>\n\t\t<\/div>\n\t\t\n\t\t<div id=\"growl_prompt_overlay_success\" class=\"hidden\">\n\t\t\t<h3>Desktop notifications enabled<\/h3>\n\t\t\t<p>When someone mentions you or sends you a direct message in Slack, we will let you know via a desktop notification.<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_test btn btn_small \">Send me a test notification<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel\">I'm done<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\t\t\n\t\t<div id=\"growl_prompt_overlay_disallowed\" class=\"hidden\">\n\t\t\t<h3>Desktop notifications disabled<\/h3>\n\t\t\t<p>You chose not to allow desktop notifications. You will need to update your browser preferences in order to turn them on.<\/p>\n\t\t\t<p><a class=\"prompt_cancel btn btn_small float_right\">OK<\/a><\/p>\n\t\t\t<div class=\"clear_both\"><\/div>\n\t\t<\/div>\n\t\t\n\t<\/div>\n";
TS.raw_templates['channel_invite_list'] = "\t<p class=\"top_margin no_bottom_margin\">\n\t\t<label for=\"select_invite_channels\" class=\"inline_block lazy_filter_select\">Invite to<\/label>\n\t\t<select id=\"select_invite_channels\" name=\"select_invite_channels\" class=\"file_share_select no_margin\">\n\t\t\t<option value=\"ts_null_value\">Select a channel<\/option>\n\t\t\t{{#each channels}}\n\t\t\t\t<option value=\"{{this.id}}\">#{{this.name}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/select>\n\t<\/p>\n\n";
TS.raw_templates['channel_member_invite_list'] = "{{#if show_ra_tip}}\n\t<p class=\"no_bottom_margin\">\n\t\tType or select the names of team members that you would like to invite:\n\t<\/p>\n\t<p class=\"small_bottom_margin mini subtle_silver\">\n\t\t{{raLabel 'Restricted Accounts'}} will not appear in this list. Ask a Team Administrator to invite them.\n\t<\/p>\n{{else}}\n\t<p class=\"small_bottom_margin\">\n\t\tType or select the names of team members that you would like to invite:\n\t<\/p>\n{{\/if}}\n\n\t<div id=\"select_invite_channel_members_holder\">\n\t\n\t\t<p class=\"no_bottom_margin\">\n\t\t\t<select multiple=\"multiple\" id=\"select_invite_channel_members\" size=\"30\">\n\t\t\t\t{{#each invite_members}}\n\t\t\t\t\t<option value=\"{{this.member.id}}\" data-additional-search-field=\"@{{this.member.name}}\"{{#if this.preselected}} selected=\"selected\"{{\/if}}>{{#if this.member.profile.real_name}}{{this.member.profile.real_name}} \u2022 {{this.member.name}}{{else}}{{this.member.name}}{{\/if}}{{#if this.member.is_restricted}} ({{raLabel 'Restricted Account'}}){{\/if}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t\t<\/select>\t\t\n\t\t<\/p>\n\t\t\n\t<\/div>\n\n";
TS.raw_templates['group_member_invite_list'] = "\t<div id=\"group_invite_member_chooser\" class=\"hidden\">\n\t\t{{#if show_ra_tip}}\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\tType or select the names of team members that you would like to invite:\n\t\t\t<\/p>\n\t\t\t<p class=\"small_bottom_margin mini subtle_silver\">\n\t\t\t\t{{raLabel 'Restricted accounts'}} may not appear below. Ask a Team Administrator to invite them.\n\t\t\t<\/p>\n\t\t{{else}}\n\t\t\t<p class=\"small_bottom_margin\">\n\t\t\t\tType or select the names of team members that you would like to invite:\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t\n\t\t<div id=\"select_invite_group_members_holder\">\n\t\t\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t<select multiple=\"multiple\" id=\"select_invite_group_members\" size=\"30\">\n\t\t\t\t\t{{#each invite_members}}\n\t\t\t\t\t\t<option value=\"{{this.member.id}}\" data-additional-search-field=\"@{{this.member.name}}\"{{#if this.preselected}} selected=\"selected\"{{\/if}}>{{#if this.member.profile.real_name}}{{this.member.profile.real_name}} \u2022 {{this.member.name}}{{else}}{{this.member.name}}{{\/if}}{{#if this.member.is_restricted}} ({{raLabel 'Restricted Account'}}){{\/if}}<\/option>\n\t\t\t\t\t{{\/each}}\n\t\t\t\t<\/select>\t\t\n\t\t\t<\/p>\n\t\t\t\n\t\t<\/div>\n\t\t\n\t\t<p class=\"top_margin\">\n\t\t\t<label class=\"checkbox no_margin\">\n\t\t\t\t<input id=\"archive_access_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/> Invited members will have access to the private channel archives\n\t\t\t<\/label>\n\t\t<\/p>\n\t<\/div>\n\t\n\t\n\t<div id=\"group_invite_archives_prompt\" class=\"\">\n\t\t<p class=\"bold\">Should new members be allowed to see the private channel's message history?<\/p>\n\t\t\n\t\t<p>If <strong>Yes<\/strong>, new members will be invited and will have access to this private channel's entire message history.<\/p> \n\t\t<p>If <strong>No<\/strong>, this private channel will be renamed and archived. A new private channel will be created with all current members plus the new ones you invite. You and other current members will see a link back to the original private channel's archives.<\/p>\n\t<\/div>\n\t\n";
TS.raw_templates['channel_conversion_dialog'] = "\t<p>Converting <b>#{{name}}<\/b> to a private channel will preserve the history and membership.<\/p>\n\t<p class=\"small_bottom_margin\"><b>Two things you should know:<\/b><\/p>\n\t<ul>\n\t\t<li>This conversion is not reversible. It is a one-way street.<\/li>\n\t\t<li>Files that were previously shared in this channel will not become private. They will remain publicly accessible to others on your team.<\/li>\n\t<\/ul>\n\t<p>Are you sure you want to convert <b>#{{name}}<\/b> to a private channel?<\/p>\n";
TS.raw_templates['channel_data_retention_dialog'] = "\t<p>This message retention policy will only affect this {{model_type}}. Retention policies can also be set on a team-wide basis in your <a target=\"new\" href=\"\/admin\/settings#data_retention\">team settings<\/a>.<\/p>\n\n\t<p id=\"retention_duration_warning\" class=\"alert alert_warning hidden {{#isWeb}}small{{\/isWeb}}\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t<strong>An important note about message retention policies<\/strong><br \/>\n\t\tSetting a custom duration for message retention means that messages in this {{model_type}} will be  deleted after the number of days you set. This deletion is permanent and the messages will be irretrievable. Proceed with caution!\n\t<\/p>\n\n\t<div class=\"clearfix\">\n\t\t{{#isWeb}}\t\t\n\t\t\t<p class=\"col span_4_of_6\">\n\t\t\t\t<label for=\"retention_type\" class=\"select small\">\n\t\t\t\t\tRetention Type\n\t\t\t\t\t<select name=\"retention_type\" class=\"small\">\n\t\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>Use team preference<\/option>\n\t\t\t\t\t\t<option value=\"1\"{{#if_equal retention_type compare=1}} selected=\"selected\"{{\/if_equal}}>Retain all messages for a specific number of days<\/option>\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t\t<p class=\"col span_2_of_6 {{#if_equal retention_type compare=0}}hidden{{\/if_equal}}\" id=\"retention_duration_container\">\n\t\t\t\t<label for=\"retention_duration\">Duration<\/label>\n\t\t\t\t<input type=\"text\" name=\"retention_duration\" id=\"retention_duration\" class=\"mini align_right\" value=\"{{retention_duration}}\" \/> days\n\t\t\t<\/p>\n\t\t{{else}}\n\t\t\t<p class=\"col span_4_of_6\">\n\t\t\t\t<label for=\"retention_type\" class=\"select small full_width align_left\">\n\t\t\t\t\tRetention Type\n\t\t\t\t\t<select name=\"retention_type\" class=\"small\" style=\"margin-bottom: 4px;\">\n\t\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>Use team preference<\/option>\n\t\t\t\t\t\t<option value=\"1\"{{#if_equal retention_type compare=1}} selected=\"selected\"{{\/if_equal}}>Retain all messages for a specific number of days<\/option>\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\n\t\t\t<div class=\"col span_2_of_6 {{#if_equal retention_type compare=0}}hidden{{\/if_equal}}\" id=\"retention_duration_container\">\n\t\t\t\t<label for=\"retention_duration\" class=\"align_left\">Duration<\/label>\n\t\t\t\t<div class=\"input-append no_bottom_margin\">\n\t\t\t\t\t<input type=\"text\" name=\"retention_duration\" id=\"retention_duration\" class=\"input-mini align_right\" value=\"{{retention_duration}}\" style=\"border-radius: 4px 0 0 4px !important; width: 60px; height: 37px;\" \/>\n\t\t\t\t\t<span class=\"add-on\" style=\"line-height: 27px;\">days<\/span>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t{{\/isWeb}}\n\t<\/div>\n\n\t<div id=\"team_retention_pref\" class=\"hidden\">\n\t\t<p>\n\t\t\tThe team preference is to\n\t\t\t{{#if_equal team_type compare=0}}<strong>retain all messages.<\/strong>{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=1}}<strong>retain all messages AND also retain edit and deletion logs for all messages.<\/strong>{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=2}}<strong>retain all messages for {{team_duration}} {{#if_equal team_duration compare=1}}day{{else}}days{{\/if_equal}}.<\/strong>{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=3}}<strong>retain all messages for {{team_duration}} {{#if_equal team_duration compare=1}}day{{else}}days{{\/if_equal}} but keep logs for compliance exports.<\/strong>{{\/if_equal}}\n\t\t<\/p>\n\t<\/div>\n\n\t<div class=\"alert alert_warning hidden invalid_duration_error\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tYou must set a number of days greater than zero for message retention.\n\t<\/div>\n";
TS.raw_templates['channel_deletion_dialog'] = "\t<p>Are you sure you want to delete <b>{{name}}<\/b>? All its content will be removed from your Slack archives, and you cannot restore the content once deleted.<\/p>\n\t<p class=\"large_left_margin no_bottom_margin\">\n\t\t<label class=\"checkbox normal\" style=\"font-size: 1rem;\">\n\t\t\t<input id=\"delete_channel_cb\" type=\"checkbox\" class=\"small_right_margin\" \/>\n\t\t\tYes, I am absolutely sure\n\t\t<\/label>\n\t<\/p>\n";
TS.raw_templates['channel_options_dialog'] = "<div class=\"channel_options_section\" data-section=\"options\">\n\n\t<div class=\"channel_options_header charcoal_grey larger_bottom_padding\">Additional Options for <strong>{{#if_equal c_or_g compare=\"channel\"}}#{{else}}<ts-icon class=\"ts_icon_inherit ts_icon_lock\"><\/ts-icon>{{\/if_equal}}{{model_ob.name}}<\/strong>{{#if model_ob.is_shared}}<ts-icon class=\"ts_icon_org_shared_channel\"><\/ts-icon>{{\/if}}<\/div>\n\n\t{{#if show_archive_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"{{#if_equal c_or_g compare='channel'}}channel_archive_btn{{else}}group_archive_btn{{\/if_equal}}\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">Archive this channel<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">If you don't think it will be used any more and you want to clean up, archive it. The channel can be unarchived later (but everyone will have been removed).<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_convert_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"channel_convert_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">Convert this channel to a private channel<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">Private channels are similar to channels, but they're hidden to non-members and the conversation is private. This conversion cannot be undone.<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_convert_to_shared_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"shared_channel_convert_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">Convert this channel to a shared channel<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">Shared channels are similar to channels, but they're shared across teams.<\/p>\n\t\t\t\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_rename_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"channel_rename_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">Rename this channel<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">You can rename a channel at any time. But, use it sparingly: it might confuse or disorient your colleagues!<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_purpose_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"channel_purpose_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">{{#if model_ob.purpose.value}}Edit{{else}}Set{{\/if}} the channel purpose<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">\n\t\t\t\tChannel purposes are especially useful to new team members choosing which conversations to join.\n\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\tThis channel's current purpose is <em>\"{{formatTopicOrPurpose model_ob.purpose.value}}\"<\/em>\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_manage_posting_privilege_btn}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"posting_privilege_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">Manage posting privileges<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\"> Change who is allowed to post messages in this channel, and whether @here and @channel are allowed. <\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#if show_data_retention_link}}\n\t\t<div class=\"channel_option_item top_padding bottom_padding\" data-action=\"data_retention_btn\">\n\t\t\t<div class=\"title bold charcoal_grey small_bottom_margin\">Set the channel message retention policy<\/div>\n\n\t\t\t<p class=\"subtle_silver no_bottom_margin\">By default, Slack will save your message data for the lifetime of the team. You can configure a custom message retention policy duration.<\/p>\n\n\t\t\t<div class=\"channel_option_open\">\n\t\t\t\t<ts-icon class=\"ts_icon_arrow_large_right\"><\/ts-icon>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n<\/div>\n\n<div class=\"channel_options_section\" data-section=\"option\">\n\t<div class=\"channel_options_header charcoal_grey larger_bottom_padding larger_bottom_margin\"><\/div>\n\t<div class=\"channel_option_content\"><\/div>\n\n\t<div class=\"channel_option_buttons large_top_margin\">\n\t\t<button class=\"btn btn_outline option_cancel\" data-qa=\"channel_option_cancel\">Cancel<\/button>\n\t\t<button class=\"btn ladda-button option_go very_small_left_margin\" data-style=\"expand-right\" data-qa=\"channel_option_go\"><span class=\"ladda-label\">Ok<\/span><\/button>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_option_archive_channel'] = "<p>Archiving a channel is useful to clean things up when you do not anticipate using the channel any more. If you archive this channel:<\/p>\n<ul>\n\t<li>No one will be able to send messages to it anymore<\/li>\n\t<li>It will be closed for anyone who has it open and all members will be removed<\/li>\n\t<li>You will be able to view past conversations in the Archives on the site<\/li>\n\t<li>You will be able to search for archived messages from this channel<\/li>\n\t<li>You will always be able to un-archive it later<\/li>\n<\/ul>\n<p>Are you sure you want to archive <strong>#{{name}}{{#if is_shared}}<ts-icon class=\"ts_icon_shared_channel\"><\/ts-icon>{{\/if}}<\/strong>?<\/p>\n";
TS.raw_templates['channel_option_archive_group'] = "<p>If you archive this channel, no one will be able to send any messages in it and it will be closed for anyone who currently has it open. You will still be able to view the archives on the site and you will still be able to search for messages from this channel.<\/p>\n<p>Are you sure you want to archive <strong>{{group_prefix}}{{name}}{{#if is_shared}}<ts-icon class=\"ts_icon_shared_channel\"><\/ts-icon>{{\/if}}<\/strong>?<\/p>\n";
TS.raw_templates['channel_option_rename_channel'] = "<p class=\"top_margin\">\n\t<label for=\"channel_create_title\" class=\"\">Name<\/label>\n\t<input id=\"channel_create_title\" name=\"title_input\" type=\"text\" class=\"small title_input {{#isWeb}}no_bottom_margin{{\/isWeb}}\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" \/>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note{{\/isWeb}}\">\n\t\tNames should be lowercase, with no spaces.\n\t<\/span>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden name_taken_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tThat name has been taken. Try something different.\n\t<\/span>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden invalid_chars_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tYou entered some disallowed characters in the name, which we've fixed. Make sure it looks good to you, and try again!\n\t<\/span>\n\t<span class=\"{{#isWeb}}input_note{{else}}modal_input_note alert{{\/isWeb}} hidden single_punctuation_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tSorry! Names cannot be a single hyphen or underscore.\n\t<\/span>\n<\/p>\n";
TS.raw_templates['channel_option_purpose'] = "<p>\n\t<label for=\"purpose_input\" class=\"inline_block right_padding\">\n\t\tPurpose <span class=\"normal\">(optional)<\/span>\n\t<\/label>\n\t<textarea id=\"purpose_input\" name=\"purpose_input\" type=\"text\" maxlength=\"{{ChannelPurposeMaxLength}}\" tabindex=\"1\">{{unFormatMessage model_ob.purpose.value}}<\/textarea>\n\t<span class=\"modal_input_note\">\n\t\tGive your channel a purpose that describes what it will be used for.\n\t\t{{#if model_ob.purpose.creator}}\n\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t<br \/>\n\t\t\t\tThe purpose was last set by {{makeMemberPreviewLinkById model_ob.purpose.creator}} on {{toCalendarDate model_ob.purpose.last_set}}.\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/span>\n<\/p>\n";
TS.raw_templates['coachmark'] = "<div id=\"coachmark\" class=\"lato_regular normal hidden\">\n\t<div id=\"coachmark_callout\"><\/div>\n\t<div id=\"coachmark_interior\" class=\"lato\">\n\t\t{{! content divs are dynamically added depending on what type of coachmark is being shown }}\n\t\t<div id=\"coachmark_footer\">\n\t\t\t<div class=\"coachmark_footer_text\">\n\t\t\t\t<span>Done? <\/span><a class=\"coachmark_skip_link\">Click here to skip<\/a>\n\t\t\t<\/div>\n\t\t\t<a class=\"btn coachmark_got_it float_right\">Got it!<\/a>\n\t\t\t{{#feature flag=\"feature_update_coachmarks_cta\"}}\n\t\t\t\t{{#if can_include_invite_cta}}\n\t\t\t\t<a class=\"btn coachmark_invite_people float_right hidden\">Invite People<\/a>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/feature}}\n\t\t<\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channels_coachmark'] = "<div id=\"channels_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#if_gt total_count compare=1~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\tMessaging happens in channels\n\t\t\t{{else}}\n\t\t\t\tThese are your channels\n\t\t\t{{\/feature}}\n\t\t{{~else~}}\n\t\t\t{{~#if in_single_private_channel~}}\n\t\t\t\tThis is your private channel\n\t\t\t{{~else~}}\n\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\tMessaging happens in channels\n\t\t\t\t{{else}}\n\t\t\t\t\tThis is your channel\n\t\t\t\t{{\/feature}}\n\t\t\t{{~\/if~}}\n\t\t{{~\/if_gt}}<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t<p>Channels bring order and searchability to your team\u2019s conversations. Organize by topic (#research), working group (#sales), or specific project (#sales-tv-ad).<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>Channels are chat rooms based around a project, a topic (such as <em>music<\/em>), or a team (such as <em>sales<\/em>). Channels can be public or private.<\/p>\n\t\t\t{{\/feature}}\n\t\t{{~else~}}\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t<p>{{#if in_single_private_channel~}}\n\t\t\t\t\tPrivate channels are invite-only rooms. You only have access to this channel right now.\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t\t{{~#if_equal total_count compare=1~}}\n\t\t\t\t\t\t\tChannels organize your team\u2019s conversations by topic or working group. As a guest, you\u2019ve been invited to send messages in one channel, <strong>{{firstListedChannel}}<\/strong>.\n\t\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t\tChannels organize your team\u2019s conversations by topic or working group. As a guest, you\u2019ve been invited to send messages and browse archives in the channels in this list.\n\t\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\tChannels are chat rooms based around a project, a topic (such as <em>music<\/em>), or a team (such as <em>sales<\/em>).\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t{{~\/if~}}\n\t\t\t\t{{~#unless in_single_private_channel~}}\n\t\t\t\t\t{{~#currentUserIsURA}}{{else~}}\n\t\t\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t\t\t{{!-- Don't show anything --}}\n\t\t\t\t\t\t{{else~}}\n\t\t\t\t\t\t\t{{~#if_equal total_count compare=1}} You have access to just one channel right now.\n\t\t\t\t\t\t\t{{~else}} You have access to these channels in <strong>{{currentTeamName}}<\/strong>.\n\t\t\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t\t\t{{\/feature}}\n\t\t\t\t\t{{~\/currentUserIsURA~}}\n\t\t\t\t{{~\/unless}}<\/p>\n\t\t\t{{~else~}}\n\t\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t\t<p>Channels bring order and searchability to your team\u2019s conversations. They\u2019re organized by topic (#research), working group (#sales), or specific project (#sales-tv-ad).<\/p>\n\t\t\t\t{{else}}\n\t\t\t\t\t<p>Channels are chat rooms created by people in your Slack team. You've been added to some channels already. Channels can be public or private, and you can <strong>join any public channel<\/strong> in <strong>{{currentTeamName}}<\/strong>.<\/p>\n\t\t\t\t{{\/feature}}\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\t\t\n";
TS.raw_templates['invites_coachmark'] = "<div id=\"invites_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t<h2 class=\"black\">You\u2019re set &mdash; just add teammates<\/h2>\n\t\t\t{{~#currentUserIsAdmin~}}\n\t\t\t\t<p>To get the most out of Slack, invite some coworkers and start messaging!<\/p>\n\t\t\t{{~else~}}\n\t\t\t\t<p>To get the most out of Slack, invite some more coworkers and start messaging!<\/p>\n\t\t\t{{~\/currentUserIsAdmin~}}\n\t\t{{else}}\n\t\t\t<h2 class=\"black\">Invite people to your team<\/h2>\n\t\t\t<p>To invite coworkers to <strong>{{currentTeamName}}<\/strong>, click the <strong>Invite People<\/strong> button.<\/p>\n\t\t{{\/feature}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['direct_messages_coachmark'] = "<div id=\"direct_messages_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">Send direct messages<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t<p>Need to send a quick note to just one person or a small group of people on your team? Direct messages are great for that!<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>Direct messages are {{#feature flag=\"feature_tos_oct2016\"}}{{else}}private, {{\/feature}}<strong>1-to-1 messages<\/strong>. Once you invite people, you'll be able to chat with them here.<\/p>\n\t\t\t{{\/feature}}\n\t\t{{~else~}}\n\t\t\t{{#feature flag=\"feature_update_coachmarks_copy\"}}\n\t\t\t\t<p>Need to send a quick note to just one person or a small group of people on your team?\n\t\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t\t{{~#if_equal channels_count compare=0}} \n\t\t\t\t\t\tYou can send direct messages to anyone in the same channel as you.\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{~#if_gt groups_count compare=0}}\n\t\t\t\t\t\t\tYou can directly message anyone in the same channels or groups as you.\n\t\t\t\t\t\t{{~else}}\n\t\t\t\t\t\t\tYou can directly message anyone in the same {{pluralize channels_count 'channel'}} as you.\n\t\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t{{~else}} \n\t\t\t\t\tDirect messages are great for that.\n\t\t\t\t{{~\/currentUserIsRA~}}\n\t\t\t\t<\/p>\n\t\t\t{{else}}\n\t\t\t\t<p>Direct messages are {{#feature flag=\"feature_tos_oct2016\"}}{{else}}private, {{\/feature}}<strong>1-to-1 messages<\/strong>.\n\t\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t\t{{~#if_equal channels_count compare=0}} You can directly message anyone in the same group as you.\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{~#if_gt groups_count compare=0}} You can directly message anyone in the same channels or groups as you.\n\t\t\t\t\t\t{{~else}} You can directly message anyone in the same {{pluralize channels_count 'channel'}} as you.\n\t\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t{{~else}} You can chat with any member of <strong>{{currentTeamName}}<\/strong>.\n\t\t\t\t{{~\/currentUserIsRA~}}\n\t\t\t\t<\/p>\n\t\t\t{{\/feature}}\n\t\t\t\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['search_coachmark'] = "<div id=\"search_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span><strong class=\"black\">Click<\/strong> to learn more about search.<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">Everything on Slack is searchable<\/h2>\n\t\t<p>Any files, messages, or documents that you upload to Slack will be easy to search for here.<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['recent_mentions_coachmark'] = "<div id=\"recent_mentions_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span><strong class=\"black\">Click<\/strong> to learn more about @ mentions.<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">All your @ mentions in one place<\/h2>\n\t\t<p>Anytime someone mentions your name or any of your highlight words, the message will be listed here.<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['starred_items_coachmark'] = "<div id=\"starred_items_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span><strong class=\"black\">Click<\/strong> to learn more about starred items.<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">These are starred items<\/h2>\n\t\t<p>You can <strong>star<\/strong> items that you want to save for later, like a bookmark. Conversations and files can be starred and saved.<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['private_groups_coachmark'] = "<div id=\"private_groups_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span><strong class=\"black\">Click<\/strong> to learn more about private groups.<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t{{~#if_gt channels_count compare=0~}}\n\t\t\t\t\t{{~#if_gt groups_count compare=1~}}\n\t\t\t\t\t\tThese are your private groups\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{~#if_equal groups_count compare=1~}}\n\t\t\t\t\t\t\tThis is your private group\n\t\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t\tPrivate groups are invite-only\n\t\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\tThis is your group\n\t\t\t\t{{~\/if_gt~}}\n\t\t\t{{~else~}}\n\t\t\t\tPrivate groups are invite-only\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t<\/h2>\n\t\t{{~#currentUserIsRA~}}\n\t\t\t<p>Groups are private, <strong>invite-only rooms<\/strong>. {{#if_gt groups_count compare=1~}}\n\t\t\t\tYou have access to the groups listed here\n\t\t\t{{~else~}}\n\t\t\t\t{{~#if_equal groups_count compare=1~}}\n\t\t\t\t\tYou only have access to this group\n\t\t\t\t{{~else~}}\n\t\t\t\t\tPeople in <strong>{{currentTeamName}}<\/strong> will not know about a private group unless you invite them.\n\t\t\t\t{{~\/if_equal~}}\n\t\t\t{{~\/if_gt~}}\n\t\t\t.<p>\n\t\t{{~else~}}\n\t\t\t<p>Use private groups for <strong>invite-only conversations<\/strong>. People in <strong>{{currentTeamName}}<\/strong> will not know about a private group unless you invite them.<\/p>\n\t\t{{~\/currentUserIsRA~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['shortcuts_dialog'] = "\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\"><i class=\"ts_icon ts_icon_times\"><\/i><\/button>\n\t<div class=\"modal-body\">\n\n\t\t<h1 class=\"align_center\" style=\"margin-left: -5rem;\">\n\t\t\tKeyboard Shortcuts\n\t\t\t<span style=\"position: relative; top: -0.375rem; left: 1rem;\" aria-hidden=\"true\">\n\t\t\t\t<span class=\"keyboard\" aria-label=\"{{#isMac}}Command{{else}}Control{{\/isMac}}\">{{#isMac}}Cmd{{else}}Ctrl{{\/isMac}}<\/span><span class=\"keyboard\" aria-label=\"Question mark\">\/<\/span>\n\t\t\t<\/span>\n\t\t\t<span class=\"offscreen\">To return to this at any time, press {{#isMac}}Command{{else}}Control{{\/isMac}} question mark. To close, press escape.<\/span>\n\t\t<\/h1>\n\n\t\t<div class=\"col span_1_of_3\">\n\t\t\t<h3>Channels & DMs<\/h3>\n\t\t\t<ul class=\"no_bullets\">\n\t\t\t\t<li>Previous in list: <span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_up_medium ts_icon_inherit\" aria-label=\"Up arrow\"><\/i><\/span><\/li>\n\t\t\t\t<li>Next in list: <span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_down_medium ts_icon_inherit\" aria-label=\"Down arrow\"><\/i><\/span><\/li>\n\t\t\t\t<li>Previous unread: <span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_up_medium ts_icon_inherit\" aria-label=\"Up arrow\"><\/i><\/span><\/li>\n\t\t\t\t<li>Next unread: <span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_down_medium ts_icon_inherit\" aria-label=\"Down arrow\"><\/i><\/span><\/li>\n\t\t\t\t<li>Back in history: {{#isMac}}<span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">[<\/span>{{else}}<span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_left\" aria-label=\"Left arrow\"><\/i><\/span>{{\/isMac}}<\/li>\n\t\t\t\t<li>Forward in history: {{#isMac}}<span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">]<\/span>{{else}}<span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_right\" aria-label=\"Right arrow\"><\/i><\/span>{{\/isMac}}<\/li>\n\t\t\t\t<li>Mark as read: <span class=\"keyboard\" aria-label=\"Escape\">Esc<\/span><\/li>\n\t\t\t\t<li>Mark all as read: <span class=\"keyboard\">Shift<\/span><span class=\"keyboard\" aria-label=\"Escape\">Esc<\/span><\/li>\n\t\t\t\t<li>Quick switcher: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">k<\/span>{{#isOurApp}} or <span class=\"keyboard\">t<\/span>{{\/isOurApp}}<\/li>\n\t\t\t\t{{#if show_browse_dms_shortcut}}<li>Browse DMs: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">k<\/span><\/li>{{\/if}}\n\t\t\t<\/ul>\n\t\t<\/div>\n\n\t\t<div class=\"col span_1_of_3\">\n\t\t\t<h3>Messaging<\/h3>\n\t\t\t<ul class=\"no_bullets\">\n\t\t\t{{#if can_show_a11y_keyboard_shortcuts}}\n\t\t\t\t{{! The following four keyboard shortcuts don't show up in the UI, and are only read by screenreaders. }}\n\t\t\t\t<li class=\"hidden\" aria-hidden=\"false\">Next message: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\">]<\/span><\/li>\n\t\t\t\t<li class=\"hidden\" aria-hidden=\"false\">Previous message: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\">[<\/span><\/li>\n\t\t\t\t<li class=\"hidden\" aria-hidden=\"false\">Oldest unread message: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\">-<\/span><\/li>\n\t\t\t\t<li class=\"hidden\" aria-hidden=\"false\">Message input: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">{{meta_key}}<\/span><span class=\"keyboard\">=<\/span><\/li>\n\t\t\t{{\/if}}\n\t\t\t\t<li>\n\t\t\t\t\tAutocomplete\n\t\t\t\t\t<ul>\n\t\t\t\t\t\t<li>Names: <span class=\"subtle_silver\">[a-z]<\/span><span class=\"keyboard\">Tab<\/span> <span class=\"subtle_silver\">or<\/span> <span class=\"keyboard\">@<\/span><span class=\"keyboard\">Tab<\/span><\/li>\n\t\t\t\t\t\t<li>Channels: <span class=\"keyboard\" aria-label=\"Number symbol\">#<\/span><span class=\"keyboard\">Tab<\/span><\/li>\n\t\t\t\t\t\t<li>Emoji: <span class=\"keyboard\" aria-label=\"Colon\">:<\/span><span class=\"keyboard\">Tab<\/span><\/li>\n\t\t\t\t\t<\/ul>\n\t\t\t\t<\/li>\n\t\t\t\t<li>New line: <span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">Enter<\/span><\/li>\n\t\t\t\t<li>Edit last message: <span class=\"keyboard\"><i class=\"ts_icon ts_icon_arrow_up_medium ts_icon_inherit\" aria-label=\"Up arrow\"><\/i><\/span> <span class=\"subtle_silver\">in input<\/span><\/li>\n\t\t\t\t<li>React to last message: <span class=\"keyboard\" aria-label=\"{{#isMac}}command{{else}}control{{\/isMac}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">\\<\/span><\/li>\n\t\t\t<\/ul>\n\t\t<\/div>\n\n\t\t<div class=\"col span_1_of_3 no_right_margin\">\n\t\t\t<h3>Extras<\/h3>\n\t\t\t<ul class=\"no_bullets\">\n\t\t\t\t{{#isOurApp}}<li>Open Preferences: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\" aria-label=\"Comma\">,<\/span><\/li>{{\/isOurApp}}\n\t\t\t\t{{#if can_show_unread_view}}\n\t\t\t\t\t<li>Open All Unreads: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">a<\/span><\/li>\n\t\t\t\t{{\/if}}\n\t\t\t\t<li>Toggle Flexpane: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">.<\/span><\/li>\n\t\t\t\t\t<ul>\n\t\t\t\t\t\t{{#isOurApp}}<li>Channel Info: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">i<\/span><\/li>{{\/isOurApp}}\n\t\t\t\t\t\t{{#isChrome}}{{else}}<li>Mentions: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">m<\/span><\/li>{{\/isChrome}}\n\t\t\t\t\t\t{{#isFF}}{{else}}<li>Team: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">e<\/span><\/li>{{\/isFF}}\n\t\t\t\t\t\t<li>Stars: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">Shift<\/span><span class=\"keyboard\">s<\/span><\/li>\n\t\t\t\t\t\t{{#isOurApp}}<li>Search: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">f<\/span><\/li>{{\/isOurApp}}\n\t\t\t\t\t<\/ul>\n\t\t\t\t<li>Paste Snippet: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span>{{#isSafariDesktop}}<span class=\"keyboard\" aria-label=\"Option\">Opt<\/span>{{\/isSafariDesktop}}<span class=\"keyboard\">Shift<\/span>{{#isMac}}<span class=\"keyboard\">v<\/span>{{else}}<span class=\"keyboard\">Enter<\/span>{{\/isMac}}<\/li>\n\t\t\t\t<li>Upload a File: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">u<\/span><\/li>\n\t\t\t\t<li>Dismiss Dialogs: <span class=\"keyboard\" aria-label=\"Escape\">Esc<\/span><\/li>\n\n\t\t\t\t{{#feature flag=\"feature_a11y_ui_zoom\"}}\n\t\t\t\t\t<li>Zoom In: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">+<\/span><\/li>\n\t\t\t\t\t<li>Zoom Out: <span class=\"keyboard\" aria-label=\"{{cmd_key_label}}\">{{cmd_key}}<\/span><span class=\"keyboard\">-<\/span><\/li>\n\t\t\t\t{{\/feature}}\n\t\t\t<\/ul>\n\t\t<\/div>\n\n\t\t<div class=\"clear_both\"><\/div>\n\t\t<p class=\"info_block align_center no_bottom_margin\">\n\t\t\tBegin a message with <strong class=\"command\">\/<\/strong> for a list of all the commands at your disposal.\n\t\t<\/p\n\t<\/div>\n";
TS.raw_templates['at_channel_warning_dialog'] = "\t<div class=\"modal-body\">\n\t\t<p>\n\t\t\tBy using <span class=\"mention_yellow_bg\">@{{keyword}}<\/span>, you are about to notify\n\t\t\t<strong>{{pluralCount member_count \"person\" \"people\"}}<\/strong>\n\t\t\t{{#if_equal timezone_count compare=1}}{{else}} in <strong>{{timezone_count}} timezones{{\/if_equal}}<\/strong>. Are you sure?\n\t\t<\/p>\n\t\t<div>\n\t\t\t<a class=\"btn btn_outline small_right_margin dialog_cancel\">Edit message<\/a>\n\t\t\t<a class=\"btn btn_success dialog_go\">Send it now<\/a>\n\t\t<\/div>\n\t\t<div>\n\t\t\t<span class=\"tiny dialog_cancel_hint\"><strong aria-label=\"escape\">Esc<\/strong> to edit<\/span>\n\t\t\t<span class=\"tiny dialog_go_hint\"><strong aria-label=\"return\">Return <span class=\"return_char\">&crarr;<\/span><\/strong> to send<\/span>\n\t\t<\/div>\n{{#currentUserIsAdmin}}\n\t\t<div>\n\t\t\t<span class=\"tiny dialog_admin_hint\">Pssst... admins! <a href=\"\/admin\/settings#permissions\" target=\"_blank\">Team settings<\/a> control this warning<\/span>\n\t\t<\/div>\n{{else}}\n\t\t<div>\n\t\t\t<span class=\"tiny dialog_admin_hint\">Psssssst! These warnings can be modified by a Team Admin!<\/span>\n\t\t<\/div>\n{{\/currentUserIsAdmin}}\n\n\t\t<div class=\"channel_members popover_menu hidden\">\n\t\t\t<div class=\"channel_members_scroller\"><\/div>\n\t\t\t<a href=\"#\" class=\"channel_members_count_underlay overflow_ellipsis\">{{pluralCount member_count \"person\" \"people\"}}<\/a>\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['at_channel_warning_note'] = "<i class=\"ts_icon ts_icon_warning ts_icon_inherit yolk_orange small_right_margin\"><\/i> By using <span class=\"mention_yellow_bg\">@{{keyword}}<\/span>, you are about to notify <strong>{{pluralCount member_count \"person\" \"people\"}}<\/strong>\n";
TS.raw_templates['at_channel_blocked_note'] = "<i class=\"ts_icon ts_icon_lock\"><\/i> A Team Owner has restricted the use of <span class=\"mention_yellow_bg\">{{keyword}}<\/span> messages\n";
TS.raw_templates['toggle'] = "<div\n\tclass=\"ts_toggle {{settings.cls}}\n\t\t{{#if settings.initial_state}}\n\t\t\tchecked {{settings.on_class}}\n\t\t{{else}}\n\t\t\t{{settings.off_class}}\n\t\t{{\/if}}\n\t\t{{#if settings.disabled}}\n\t\t\tdisabled\n\t\t{{\/if}}\n\t\"\n>\n\t<div class=\"ts_toggle_button\">\n\t\t<div class=\"ts_toggle_off_text\">{{settings.off_text}}<\/div>\n\t\t<div class=\"ts_toggle_on_text\">{{settings.on_text}}<\/div>\n\t\t<span class=\"ts_toggle_handle\"><\/span>\n\t<\/div>\n\t{{#or settings.label settings.off_label}}\n\t\t<div class=\"ts_toggle_secondary_label\">\n\t\t\t{{#if settings.off_label}}\n\t\t\t\t<span class=\"ts_toggle_off_label\">{{settings.off_label}}<\/span>\n\t\t\t\t<span class=\"ts_toggle_on_label\">{{settings.label}}<\/span>\n\t\t\t{{else}}\n\t\t\t\t{{settings.label}}\n\t\t\t{{\/if}}\n\t\t<\/div>\n\t{{\/or}}\n<\/div>\n";
TS.raw_templates['account_notifications_channel_overrides'] = "\t<table>\n\t\t<tr class=\"hide_when_no_overrides\">\n\t\t\t<td><\/td>\n\t\t\t<td class=\"align_center extra_right_border\" colspan=\"3\"><i class=\"ts_icon ts_icon_laptop small_right_margin\"><\/i><strong>Desktop<\/strong><\/td>\n\t\t\t<td class=\"align_center extra_left_border\" colspan=\"3\"><i class=\"ts_icon ts_icon_mobile small_right_margin\" style=\"font-size: 1.4rem\"><\/i><strong>Mobile<\/strong><\/td>\n\t\t\t<td><\/td>\n\t\t<\/tr>\n\t\t<tr class=\"hide_when_no_overrides\">\n\t\t\t<th><\/th>\n\t\t\t<th>Everything<\/td>\n\t\t\t<th>Mentions<\/th>\n\t\t\t<th class=\"extra_right_border right_padding\">Nothing<\/th>\n\t\t\t<th class=\"extra_left_border\">Everything<\/th>\n\t\t\t<th>Mentions<\/th>\n\t\t\t<th>Nothing<\/th>\n\t\t\t<th class=\"revert_cell_width\"><\/th>\n\t\t<\/tr>\n\t\t<tr id=\"add_override_channel_picker_row\" class=\"hidden\">\n\t\t\t<td colspan=\"8\"><a id=\"add_override_channel_picker\"><i class=\"ts_icon ts_icon_plus_circle ts_icon_inherit float_left small_right_margin\"><\/i> Add a custom setting for a channel<\/a><\/td>\n\t\t<\/tr>\n\t<\/table>\n";
TS.raw_templates['account_notifications_channel_overrides_row'] = "\t<tr id=\"channel_override_row_{{channel.id}}\" class=\"channel_override_row {{#if channel.is_muted}}muted{{\/if}}\">\n\t\t<td class=\"channel_details\">\n\t\t\t<span class=\"no_wrap\">\n\t\t\t\t<i class=\"ts_icon ts_icon_bell_slash mute_icon\"><\/i>\n\t\t\t\t{{~#if channel.is_group~}}\n\t\t\t\t\t{{~#if channel.is_mpim~}}\n\t\t\t\t\t\t<i class=\"ts_icon ts_icon_multiparty_dm_{{mpimMemberCount channel.channel}}\"><\/i>\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t<i class=\"ts_icon ts_icon_lock_o group_lock_prefix\"><\/i>\n\t\t\t\t\t{{~\/if~}}\n\t\t\t\t{{~\/if~}}\n\t\t\t\t{{~#if channel.is_channel~}}\n\t\t\t\t\t<span class=\"channel_hash_prefix\">#<\/span>\n\t\t\t\t{{~\/if~}}\n\t\t\t\t<strong>{{channel.name}}<\/strong>\n\t\t\t\t<span class=\"pref_saved inline_block small_left_margin\"><i class=\"ts_icon ts_icon_check_circle_o\"><\/i> Saved<\/span>\n\t\t\t<\/span>\n\n\t\t\t<label class=\"checkbox no_margin normal\">\n\t\t\t\t<input id=\"muting_cb_{{channel.id}}\" {{#if channel.is_muted}}checked=\"checked\"{{\/if}} type=\"checkbox\" data-id=\"{{channel.id}}\" data-pref=\"muting\" class=\"small_right_margin\">\n\t\t\t\tMute this {{#if channel.is_mpim}}conversation{{else}}{{#if channel.is_group}}private channel{{else}}channel{{\/if}}{{\/if}}\n\t\t\t<\/label>\n\n\t\t\t<label id=\"at_channel_suppressed_{{channel.id}}\" class=\"hidden checkbox no_margin normal {{#if channel.is_muted}}disabled{{\/if}}\">\n\t\t\t\t<input id=\"at_channel_suppressed_cb_{{channel.id}}\" checked=\"checked\" {{#if channel.is_muted}}disabled{{\/if}} type=\"checkbox\" data-id=\"{{channel.id}}\" data-pref=\"at_channel_suppression\" class=\"small_right_margin\"> Suppress <strong>{{#if channel.is_group}}@channel{{else}}{{#if channel.is_general}}@everyone{{else}}@channel{{\/if}}{{\/if}}<\/strong> mentions <span id=\"at_channel_suppressed_mobile_qualifier_{{channel.id}}\">(on mobile)<\/span><span id=\"at_channel_suppressed_desktop_qualifier_{{channel.id}}\">(on desktop)<\/span><span id=\"at_channel_suppressed_disabled_explain_{{channel.id}}\" class=\"hidden\"> (disabled due to <strong id=\"at_channel_suppressed_disabled_explain_tip_link_{{channel.id}}\" class=\"{{#if channel.is_muted}}ts_tip_hide {{\/if}}ts_tip ts_tip_top ts_tip_multiline ts_tip_float\">team settings<span class=\"ts_tip_tip\"><span class=\"ts_tip_multiline_inner\"><\/span><\/span><\/strong>)<\/span>\n\t\t\t<\/label>\n\n\t\t<\/td>\n\n\t\t<td class=\"radio_cell\"><input type=\"radio\" id=\"desktop_everything_{{channel.id}}\" name=\"desktop_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"desktop\" value=\"everything\" {{#if channel.is_muted}}disabled{{\/if}}><\/td>\n\t\t<td class=\"radio_cell\"><input type=\"radio\" id=\"desktop_mentions_{{channel.id}}\" name=\"desktop_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"desktop\" value=\"mentions\" {{#if channel.is_muted}}disabled{{\/if}}><\/td>\n\t\t<td class=\"radio_cell\"><input type=\"radio\" id=\"desktop_nothing_{{channel.id}}\" name=\"desktop_{{channel.id}}\" data-device=\"desktop\" data-id=\"{{channel.id}}\" value=\"nothing\" {{#if channel.is_muted}}disabled{{\/if}}><\/td>\n\n\t\t<td class=\"radio_cell\"><input type=\"radio\" id=\"mobile_everything_{{channel.id}}\" name=\"mobile_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"mobile\" value=\"everything\" {{#if channel.is_muted}}disabled{{\/if}}><\/td>\n\t\t<td class=\"radio_cell\"><input type=\"radio\" id=\"mobile_mentions_{{channel.id}}\" name=\"mobile_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"mobile\" value=\"mentions\" {{#if channel.is_muted}}disabled{{\/if}}><\/td>\n\t\t<td class=\"radio_cell\"><input type=\"radio\" id=\"mobile_nothing_{{channel.id}}\" name=\"mobile_{{channel.id}}\" data-id=\"{{channel.id}}\" data-device=\"mobile\" value=\"nothing\" {{#if channel.is_muted}}disabled{{\/if}}><\/td>\n\n\t\t<td class=\"align_center\"><i class=\"ts_icon ts_icon_times_circle revert_to_default\" data-id=\"{{channel.id}}\" data-toggle=\"tooltip\" title=\"Clear custom notification settings from {{#if channel.is_channel}}#{{\/if}}{{channel.name}}\"><\/i><\/td>\n\t<\/tr>\n";
TS.raw_templates['sidebar_theme_css'] = "\t<style type=\"text\/css\" id=\"sidebar_theme_css\">\n\n\t\t\/* Column Background *\/\n\t\t#col_channels_bg,\n\t\t#col_channels,\n\t\t#col_channels_footer {\n\t\t\tbackground: {{theme.column_bg}};\n\t\t}\n\t\t#monkey_scroll_wrapper_for_channels_scroller .monkey_scroll_handle_inner {\n\t\t\tborder-color: {{theme.column_bg}};\n\t\t}\n\n\t\t\/* Menu Background *\/\n\t\t#team_menu {\n\t\t\tbackground: {{theme.menu_bg}};\n\t\t\tcolor: {{theme.text_color}};\n\t\t\ttext-shadow: 0 1px 1px rgba(0, 0, 0, 0.25);\n\t\t}\n\t\t#team_menu,\n\t\t#quick_switcher_btn,\n\t\t#team_menu_overlay,\n\t\t#col_channels_overlay {\n\t\t\tbackground: {{theme.column_bg}};\n\t\t\tborder-color: {{theme.column_bg}};\n\t\t}\n\t\tbody:not(.loading) #team_menu:hover,\n\t\tbody:not(.loading) #team_menu.active,\n\t\t#quick_switcher_btn:hover,\n\t\t#quick_switcher_btn:active {\n\t\t\tbackground: {{theme.menu_bg}};\n\t\t\tborder-color: {{theme.menu_bg}};\n\t\t}\n\n\t\t\/* Active Item *\/\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.channel_name,\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.group_name,\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.im_name,\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.mpim_name,\n\t\t#channels_nav ul li.unread_link.active a {\n\t\t\tbackground: {{theme.active_item}};\n\t\t\topacity: 1;\n\t\t\tcolor: {{theme.active_item_text}} !important;\n\t\t}\n\t\t#channels_scroller.show_which_channel_is_active ul li.active .unread_highlights,\n\t\t#channels_nav li.active {\n\t\t\tcolor: {{theme.active_item}};\n\t\t}\n\t\t#channel_scroll_up {\n\t\t\tbox-shadow: 0 1px 1px rgba(0,0,0,0.25), inset 0px 2px 2px rgba(0,0,0,0.1)\n\t\t}\n\t\t#channel_scroll_down {\n\t\t\tbox-shadow: 0 -1px 1px rgba(0,0,0,0.25), inset 0px -2px 2px rgba(0,0,0,0.1)\n\t\t}\n\n\t\t\/* Hovered Item *\/\n\t\tbody:not(.sorting_mode) .channels_list_holder ul li a:hover,\n\t\t#monkey_scroll_wrapper_for_channels_scroller .monkey_scroll_bar {\n\t\t\tbackground: {{theme.hover_item}};\n\t\t}\n\t\t\/* Separated b\/c FF will drop all rules since it doesn't recognize -webkit-scrollbar *\/\n\t\t.supports_custom_scrollbar #channels_scroller::-webkit-scrollbar-track {\n\t\t\tbackground: transparent;\n\t\t\tcolor: transparent;\n\t\t}\n\t\t.supports_custom_scrollbar #col_channels:hover #channels_scroller::-webkit-scrollbar-track {\n\t\t\tbackground: {{theme.hover_item}};\n\t\t\tcolor: {{theme.column_bg}};\n\t\t}\n\n\t\t\/* Text Color *\/\n\t\t.channels_list_holder ul li a,\n\t\t.channels_list_holder h2,\n\t\t.list_more,\n\t\t#team_menu:before,\n\t\t#team_menu .notifications_menu_btn,\n\t\t#team_menu .team_name_caret,\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.channel_name .prefix,\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.group_name .prefix,\n\t\t#team_header_user_name,\n\t\t#channels_nav ul li button,\n\t\t.channels_list_holder ul li.unread .prefix,\n\t\t.channels_list_holder ul li.member .im_close,\n\t\t.channels_list_holder ul li.mpim .mpim_close,\n\t\t.channels_list_holder ul li.group .group_close,\n\t\t#channels_nav ul li a,\n\t\t#quick_switcher_btn > i {\n\t\t\tcolor: {{theme.text_color}} !important;\n\t\t\topacity: 0.6;\n\t\t}\n\t\t#current_user_name_and_current_status,\n\t\t#team_header_user_name {\n\t\t\tcolor: {{theme.text_color}};\n\t\t}\n\t\t#quick_switcher_label,\n\t\t#quick_switcher_shortcut,\n\t\t#quick_switcher_btn:hover #quick_switcher_shortcut {\n\t\t\tcolor: {{theme.text_color}} !important;\n\t\t}\n\t\t.channel_list_add_link {\n\t\t\tcolor: {{theme.text_color}} !important;\n\t\t}\n\t\t.channel_list_add_link:hover {\n\t\t\tborder-color: {{theme.text_color}};\n\t\t}\n\t\t.overlay_mock_text{\n\t\t\tbackground: {{theme.text_color}} !important;\n\t\t}\n\t\t#team_menu:hover:before,\n\t\t#team_menu.active:before,\n\t\t.channels_list_holder h2.hoverable:hover,\n\t\t#team_menu:hover .team_name_caret,\n\t\t#team_menu.active .team_name_caret,\n\t\t.invite_widget_link:hover {\n\t\t\topacity: 1;\n\t\t}\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.channel_name .prefix,\n\t\t#channels_scroller.show_which_channel_is_active ul li.active a.group_name .prefix {\n\t\t\tcolor: {{theme.active_item_text}} !important;\n\t\t}\n\t\t.list_more:hover {\n\t\t\tcolor: {{theme.text_color}} !important;\n\t\t\tborder-bottom-color: {{theme.text_color}};\n\t\t}\n\n\t\t.channels_list_holder ul li.unread a,\n\t\t.channels_list_holder ul li .channels_list_new_btn:hover,\n\t\t.channels_list_holder ul li.member .im_close,\n\t\t.channels_list_holder ul li.mpim .mpim_close,\n\t\t.channels_list_holder ul li.group .group_close {\n\t\t\topacity: 1 !important;\n\t\t}\n\n\t\t#monkey_scroll_wrapper_for_channels_scroller .monkey_scroll_handle_inner {\n\t\t\tbackground: {{theme.text_color}};\n\t\t\topacity: 0.7;\n\t\t}\n\t\t\/* Separated b\/c FF will drop all rules since it doesn't recognize -webkit-scrollbar *\/\n\t\t.supports_custom_scrollbar #channels_scroller::-webkit-scrollbar-thumb {\n\t\t\tbackground: transparent;\n\t\t\tcolor: transparent;\n\t\t}\n\t\t.supports_custom_scrollbar #col_channels:hover #channels_scroller::-webkit-scrollbar-thumb {\n\t\t\tbackground: rgba({{theme.text_color_rgb.r}}, {{theme.text_color_rgb.g}}, {{theme.text_color_rgb.b}}, .7);\n\t\t\tcolor: {{theme.column_bg}};\n\t\t}\n\n\t\t\/* Presence *\/\n\t\t#channels_scroller .presence.active i.presence_icon,\n\t\t#channel_header #presence.active:before,\n\t\t#client_header #presence.active:before,\n\t\t.slackbot_icon {\n\t\t\tcolor: {{theme.active_presence}};\n\t\t\topacity: 1;\n\t\t}\n\n\t\t#channels_scroller.show_which_channel_is_active li.active .presence.active i.presence_icon,\n\t\t#channels_scroller.show_which_channel_is_active li.active .slackbot_icon {\n\t\t\tcolor: {{theme.active_item_text}} !important;\n\t\t}\n\n\t\t\/* Override for Hoth Theme presence dot on selected item. Fixes Bug #7154 *\/\n\t\t.sidebar_theme_hoth_theme #channels_scroller.show_which_channel_is_active li.active .presence.active i.presence_icon,\n\t\t.sidebar_theme_hoth_theme #channels_scroller.show_which_channel_is_active li.active .slackbot_icon {\n\t\t\tcolor: {{theme.active_presence}} !important;\n\t\t}\n\n\t\t#channels_scroller.show_which_channel_is_active li.active .presence.away i.presence_icon {\n\t\t\tcolor: {{theme.active_item_text}} !important;\n\t\t\topacity: 0.3;\n\t\t}\n\t\t#channels_scroller .presence.away,\n\t\t#channels_scroller .presence.away,\n\t\t#channel_header #presence.away:before {\n\t\t\tcolor: {{theme.text_color}};\n\t\t\topacity: 0.3;\n\t\t}\n\n\t\t\/* Badge + Mentions bar *\/\n\t\t.channels_list_holder .unread_highlights,\n\t\t#channel_scroll_up.unseen_have_mentions,\n\t\t#channel_scroll_down.unseen_have_mentions,\n\t\tts-jumper ol li .unread_count {\n\t\t\tbackground: {{theme.badge}};\n\t\t}\n\n\t\t\/* No text shadows *\/\n\t\t#col_channels a,\n\t\t#team_menu {\n\t\t\ttext-shadow: none !important;\n\t\t}\n\n\t<\/style>\n";
TS.raw_templates['signin_find_team'] = "{{i18n_ns 'find_team'}}\n\n{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=find_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"37\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n<div class=\"header_error_message hidden\"><\/div>\n\n<div id=\"form_body\" class=\"fs_split_body\">\n\t<h1>\n\t\t{{#if is_second_step}}\n\t\t\t{{#t}}Find another team{{\/t}}\n\t\t{{else}}\n\t\t\t{{#t}}Find your team{{\/t}}\n\t\t{{\/if}}\n\t<\/h1>\n\t<label id=\"email_label\">{{#t}}<span class=\"normal\">Enter your <\/span>email address{{\/t}}<\/label>\n\t\n\t<div class=\"input_wrapper email\">\n\t\t<textarea type=\"text\" placeholder=\"{{#t}}you@yourdomain.com{{\/t}}\" id=\"email_input\" autocomplete=\"off\" spellcheck=\"false\" aria-labelledby=\"email_label email_rule_label\" data-email-healing=\"true\"><\/textarea>\n\t<\/div>\n\n\t<p id=\"email_rule_label\" class=\"subtle_silver\">{{#t}}Try up to 10 email addresses, separated with commas{{\/t}}<\/p>\n\t<p class=\"error_message\"><\/p>\n\t<div class=\"desc\">{{#t}}We\u2019ll send you an email with sign-in links for any Slack teams associated with the address(es) you enter here.{{\/t}}<\/div>\n<\/div>\n\n<div id=\"submit_footer\" class=\"fs_split_footer centered\">\n\t<button id=\"submit_btn\" type=\"submit\" class=\"btn btn_large ladda-button submit_setting\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"click_target=find_team_send_signin_email\" data-style=\"expand-right\" aria-disabled=\"true\" disabled=\"true\">\n\t\t<span id=\"submit_btn_label_single\" class=\"ladda-label\">{{#t}}Send me a sign-in email{{\/t}}<\/span>\n\t\t<span id=\"submit_btn_label_plural\" class=\"ladda-label hidden\">{{#t}}Send me sign-in emails{{\/t}}<\/span>\n\t<\/button>\n\t{{#if reenter_signup_flow}}\n\t\t<p class=\"normal_margin reenter_signup_flow subtle_silver\"><ts-icon class=\"ts_icon_arrow_left\"><\/ts-icon>{{#t}}Or, <a href=\"\/create\" class=\"clear_blue\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=go_back_create_team,trigger=find_team\"> go back to making a new team<\/a>{{\/t}}<\/p>\n\t{{\/if}}\n\t{{#if go_back_team_select}}\n\t\t<p class=\"normal_margin go_back_team_select subtle_silver\"><ts-icon class=\"ts_icon_arrow_left\"><\/ts-icon>{{#t}}Or, <a href=\"\/signin\/find\" class=\"clear_blue\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=go_back_select_team,trigger=find_team\"> go back and select a team<\/a>{{\/t}}<\/p>\n\t{{\/if}}\n<\/div>\n<div class=\"fs_split_footer\"><\/div>\n";
TS.raw_templates['signin_find_team_email_sent'] = "{{i18n_ns 'find_team'}}\n\n{{#unlessOurApp}}<a data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=nav_logo,trigger=find_team\" class=\"logo_link\" href=\"\/\">{{\/unlessOurApp}}<img id=\"slack_logo\" src=\"{{versioned_slack_logo_240}}\" width=\"120\" height=\"137\" title=\"Slack\">{{#unlessOurApp}}<\/a>{{\/unlessOurApp}}\n\n<div id=\"sent_invite_body\" class=\"fs_split_body\">\n\t{{#if multi}}\n\t<h1>{{#t}}Reminders sent!{{\/t}}<\/h1>\n\t<p class=\"desc\">{{#t}}If we found Slack accounts associated with {email}, you will receive emails from us shortly.{{\/t}}<\/p>\n\t{{else}}\n\t<h1>{{#t}}Reminder sent!{{\/t}}<\/h1>\n\t<p class=\"desc\">{{#t}}If we found a Slack account associated with {email}, you will receive an email from us shortly.{{\/t}}<\/p>\n\t{{\/if}}\n\n\t{{#t}}\n\t<p class=\"desc small_bottom_margin\">Having trouble finding your team?<\/p>\n\t<p class=\"desc\">You can <strong><a href=\"\/signin\/find\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=try_another_email,trigger=find_team\">try another email address<\/a><\/strong> or contact <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a>.<\/p>\n\t{{\/t}}\n<\/div>\n\n<div class=\"fs_split_footer\"><\/div>\n<div class=\"fs_split_footer subtle_silver\">\n{{#isOurApp}}\n\t{{#t}}(Once you've received it, <a href=\"\/signin\" data-clog-event=\"WEBSITE_CLICK\" data-clog-params=\"action=try_sign_in,trigger=find_team\" class=\"bold\">click here to sign in<\/a>.){{\/t}}\n{{else}}\n\t{{#t}}(You can probably close this page now.){{\/t}}\n{{\/isOurApp}}\n<\/div>";
TS.raw_templates['invite_sso_form'] = "{{i18n_ns \"invite\"}}\n\n<div class=\"fs_split_header\" id=\"slack_logo\"><\/div>\n\n<div id=\"invite_sso_form_body\" class=\"fs_split_body\">\n    <h1>{{#t}}Join {team_name}{{\/t}}<\/h1>\n    <div id=\"sso_container\">\n        {{#if_equal auth_mode compare=\"google\"}}\n            {{#if sso_required}}\n                <p>{{#t}}This team requires you to sign up with your <strong>@{email_domain}<\/strong> Google account.{{\/t}}<\/p>\n            {{else}}\n                {{#if domain_match}}\n                    <p>\n                        {{#if_gt allowed_domains_count compare=1}}\n                            {{#t}}This team allows you to sign up with your <strong>Google Apps<\/strong> account.{{\/t}}\n                        {{else}}\n                            {{#t}}This team allows you to sign up with your <strong>@{google_sso_domain}<\/strong> Google account.{{\/t}}\n                        {{\/if_gt}}\n                    <\/p>\n                {{\/if}}\n            {{\/if}}\n            {{#or sso_required domain_match}}\n                <p>\n                    <a href=\"{{auth_url}}\" class=\"btn btn_info btn_large btn_with_icon full_width\">\n                        <i class=\"ts_icon ts_icon_google\"><\/i>\n                        {{#t}}Sign up with Google{{\/t}}\n                    <\/a>\n                <\/p>\n            {{\/or}}\n            {{#if sso_required}}{{else}}\n                {{#if domain_match}}\n                    <p class=\"large_top_margin\">{{#t}}You can also register with a <strong>username<\/strong> and <strong>password<\/strong>.{{\/t}}<\/p>\n                    <p id=\"no_sso_btn\" class=\"btn btn_large full_width ladda-button\">\n                        <span class=\"ladda-label\">{{#t}}Enter username and password{{\/t}}<\/span>\n                    <\/p>\n                {{\/if}}\n            {{\/if}}\n        {{else}}\n            <p>\n                {{#if sso_required}}\n                    {{#t}}This team requires you to sign in with your {saml_provider_label} account.{{\/t}}\n                {{else}}\n                    {{#t}}This team allows you to sign in with your {saml_provider_label} account.{{\/t}}\n                {{\/if}}\n            <\/p>\n            <p>\n                <a href=\"\/sso\/saml\/start?action=invite&redir=%2Finvite%2F{{invite_code}}\" class=\"btn btn_info btn_large btn_with_icon full_width\">\n                    <i class=\"ts_icon ts_icon_key\"><\/i>\n                    {{#t}}Sign in with {saml_provider_label}{{\/t}}\n                <\/a>\n            <\/p>\n            {{#unless sso_required}}\n                <p class=\"large_top_margin\">{{#t}}You can also register with a <strong>username<\/strong> and <strong>password<\/strong>.{{\/t}}<\/p>\n                <p id=\"no_sso_btn\" class=\"btn btn_large full_width ladda-button\">\n                    <span class=\"ladda-label\">{{#t}}Enter username and password{{\/t}}<\/span>\n                <\/p>\n            {{\/unless}}\n        {{\/if_equal}}\n    <\/div>\n<\/div>\n\n<div class=\"fs_split_footer\"><\/div>\n<div class=\"fs_split_footer\"><\/div>";
TS.raw_templates['invite_name_form'] = "<div class=\"fs_split_header\" id=\"slack_logo\"><\/div>\n\n<div id=\"ratelimit_alert\" class=\"header_error_message hidden bottom_margin\">\n    <h3>{{#t note=\"This refers to a rate limit we have for filling out this form\"}}Whoa, you're going too fast!{{\/t}}<\/h3>\n    <p class=\"no_margin\">{{#t}}Slow down a bit. You might have better luck if you try again in a minute.{{\/t}}<\/p>\n<\/div>\n\n<div id=\"invite_form_body\" class=\"fs_split_body\">\n    <h1>{{#t}}Join the Slack team for <br><span class=\"bold\">{team_name}<\/span>{{\/t}}<\/h1>\n\n    <div class=\"names_container no_top_padding bottom_padding\" id=\"names_container\">\n        <label>{{#t}}Your name{{\/t}}<\/label>\n        <div class=\"col span_1_of_2 no_padding no_bottom_margin name_field\" id=\"first_name_wrapper\">\n            <input type=\"text\" placeholder=\"{{#t}}first name{{\/t}}\" id=\"invite_first_name\" maxlength=\"35\" autocomplete=\"off\" data-qa=\"first_name_field\" value=\"{{first_name}}\"\/>\n            <p class=\"error_message\"><\/p>\n        <\/div>\n        <div class=\"col span_1_of_2 no_padding no_bottom_margin name_field\" id=\"last_name_wrapper\">\n            <input type=\"text\" placeholder=\"{{#t}}last name{{\/t}}\" id=\"invite_last_name\" maxlength=\"35\" autocomplete=\"off\" data-qa=\"last_name_field\" value=\"{{last_name}}\"\/>\n            <p class=\"error_message\"><\/p>\n        <\/div>\n\n        <p class=\"subtle_silver clear_both\">{{#t}}Your name will be displayed along with your messages in Slack.{{\/t}}<\/p>\n    <\/div>\n\n    <div id=\"username_container\">\n        <label for=\"invite_username\">{{#t}}Username{{\/t}}<\/label>\n        <div class=\"input_wrapper username\">\n            <p id=\"username_overlay\" class=\"input_overlay\"><\/p>\n            <input type=\"text\" id=\"invite_username\" maxlength=\"21\" autocomplete=\"off\" data-qa=\"username_field\" placeholder=\"{{#t}}Username{{\/t}}\" value=\"{{#if username_prefill}}{{username_prefill}}{{\/if}}\"\/>\n        <\/div>\n        <p class=\"error_message\" id=\"username_error_message\"><\/p>\n\n        <p class=\"subtle_silver\">{{#t}}Usernames must be all lowercase, with no spaces. They can only contain letters, numbers, periods, hyphens, and underscores.{{\/t}}<\/p>\n\n        {{#if custom_username_policy}}\n            <div id=\"custom_username_policy\" class=\"large_bottom_margin\">\n                <p class=\"bold small_bottom_margin\">{{#t}}Custom rules for this team:{{\/t}}<\/p>\n                <p class=\"no_bottom_margin\">{{custom_username_policy}}<\/p>\n            <\/div>\n        {{\/if}}\n    <\/div>\n<\/div>\n\n<div id=\"submit\" class=\"fs_split_footer\">\n\n    <div id=\"email_checkbox\">\n        <input type=\"checkbox\" id=\"email_misc\" data-qa=\"email_checkbox\" {{#if uncheck_email}}{{else}}checked{{\/if}}>\n        <label for=\"email_misc\">{{#t}}It's ok to send me (very occasional)<br class=\"hide_on_mobile\" \/> email about the Slack service.{{\/t}}<\/label>\n    <\/div>\n\n\n    <button id=\"submit_btn\" type=\"submit\" class=\"{{#unless email_reminded}}disabled{{\/unless}} btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n        <span class=\"ladda-label\">{{#t}}Next{{\/t}}<i class=\"ts_icon ts_icon_arrow_right\"><\/i><\/span>\n    <\/button>\n<\/div>\n\n<p class=\"mobile_legalese fs_split_well show_on_mobile align_center\">\n    {{#t}}By proceeding to create your account and use Slack, you are agreeing to our <a class=\"bold\" href=\"\/terms-of-service\">Terms of Service<\/a> and <a href=\"\/privacy-policy\" class=\"bold\">Privacy Policy<\/a>. If you do not agree, you cannot use Slack.{{\/t}}\n<\/p>\n";
TS.raw_templates['invite_password_form'] = "<div class=\"fs_split_header\" id=\"slack_logo\"><\/div>\n\n<div id=\"ratelimit_alert\" class=\"header_error_message hidden bottom_margin\">\n    <h3>{{#t note=\"This refers to a rate limit we have for filling out this form\"}}Whoa, you're going too fast!{{\/t}}<\/h3>\n    <p class=\"no_margin\">{{#t}}Slow down a bit. You might have better luck if you try again in a minute.{{\/t}}<\/p>\n<\/div>\n\n<div id=\"invite_form_body\" class=\"fs_split_body\">\n     <h1>{{#t}}Set your password{{\/t}}<\/h1>\n\n    <p class=\"subtle_silver\">{{#t}}Choose a password for signing in to {team_name} on Slack.{{\/t}}<\/p>\n\n    <div id=\"password_container\">\n        <label class=\"normal\" for=\"password\">{{#t}}Password{{\/t}}<\/label>\n        <input type=\"password\" id=\"invite_password\" data-qa=\"password-field\" placeholder=\"{{#t}}Password{{\/t}}\" name=\"password\"\/>\n        <p class=\"error_message\" id=\"password_error_message\"><\/p>\n\n        <p class=\"subtle_silver\">{{#t}}Passwords must be at least 6 characters long, and can't be things like <i>password<\/i>, <i>123456<\/i> or <i>abcdef<\/i>.{{\/t}}<\/p>\n    <\/div>\n<\/div>\n\n<div id=\"submit\" class=\"fs_split_footer large_bottom_margin \">\n    <button id=\"submit_btn\" type=\"submit\" class=\"disabled btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n        <span class=\"ladda-label\">{{#t}}Next{{\/t}}<i class=\"ts_icon ts_icon_arrow_right\"><\/i><\/span>\n    <\/button>\n<\/div>\n";
TS.raw_templates['invite_tos_form'] = "<div class=\"fs_split_header\" id=\"slack_logo\"><\/div>\n\n<div id=\"invite_form_body\" class=\"fs_split_body\">\n\t<h1 class=\"tos_title_form\">{{#t}}Please review the User Terms of Service{{\/t}}<\/h1>\n\n\t<div class=\"tos_contents\">\n\t\t{{terms_of_service}}\n\n\t\t<p class=\"align_center\">\n\t\t\t<img {srcset src=\"\/img\/signup\/tos_raised_hands.png\" sizes=\"1x, 2x\"} alt=\"User Terms of Service\" \/>\n\t\t<\/p>\n\t<\/div>\n<\/div>\n\n\n<div class=\"tos_i_agree_banner invite_flow\">\n\t<div class=\"tos_full_width col span_4_of_6 margin_auto float_none\">\n\t\t<div class=\"col span_2_of_3\">\n\t\t\t<p class=\"tos_disclaimer\">\n\t\t\t\t{{#t}}By choosing <b>I Agree<\/b>, you understand and agree to \n\t\t\t\tthese User Terms of Service and our <a href=\"\/privacy-policy\" target=\"_blank\">Privacy Policy<\/a>.{{\/t}}\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div class=\"col span_1_of_3 justify_content_center\">\n\t\t\t<button id=\"submit_btn\" type=\"submit\" class=\"btn btn_large ladda-button submit_setting\" data-style=\"expand-right\" data-qa=\"submit_button\">\n\t\t\t\t<span class=\"ladda-label\">{{#t}}I Agree{{\/t}}<\/span>\n\t\t\t<\/button>\n\t\t<\/div>\n\n\t\t<div class=\"clear_both\"><\/div>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['invite_user_tos_content'] = "\n\n\n\t<p><b>Effective: November 17, 2016<\/b><\/p>\n\n\t<p>\n\t\tThese User Terms of Service (the <b>\u201cUser Terms\u201d<\/b>) govern your access and use of our online workplace \n\t\tproductivity tools and platform (the <b>\u201cServices\u201d<\/b>).  Please read them carefully.  Even though you are \n\t\tsigning onto an existing team, these User Terms apply to you \u2014the prospective user reading these \n\t\twords. We are grateful you\u2019re here.\n\t<\/p>\n\n\n\t<p>\n\t\t<h2>First things First<\/h2>\n\t<\/p>\n\n\t<h4>These User Terms are Legally Binding<\/h4>\n\n\t<p>\n\t\tThese User Terms are a legally binding contract between you and us.  As part of these User Terms, you \n\t\tagree to comply with the most recent version of our <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>, \n\t\twhich is incorporated by reference into these User Terms.  If you access or use the Services, or continue accessing or using \n\t\tthe Services after being notified of a change to the User Terms or the <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>, \n\t\tyou confirm that you have read, understand and agree to be bound by the User Terms and the \n\t\t<a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>.  \u201cWe\u201d, \u201cour\u201d and \u201cus\u201d currently refers to \n\t\tSlack Technologies, Inc.\n\t<\/p>\n\n\n\t<p>\n\t\t<h2>Customer\u2019s Choices and Instructions<\/h2>\n\t<\/p>\n\n\t<h4>You are an Authorized User on a Team Controlled by a \u201cCustomer\u201d<\/h4>\n\t\n\t<p>\n\t\tAn organization or other third party that we refer to in these User Terms as <b>\u201cCustomer\u201d<\/b> has invited you \n\t\tto a team (i.e., a unique domain where a group of users may access the Services, as further described in \n\t\tour <a href=\"https:\/\/get.slack.help\/hc\">Help Center<\/a> pages).  If you are joining one of your employer\u2019s \n\t\tteams, for example, Customer is your employer.  If you are joining a team created by your friend using her \n\t\tpersonal email address to work on her new startup idea, she is our Customer and she is authorizing \n\t\tyou to join her team.\n\t<\/p>\n\n\t<h4>What This Means for You\u2014and for Us<\/h4>\n\n\t<p>\n\t\tCustomer has separately agreed to our <a href=\"\/terms-of-service\">Customer Terms of Service<\/a> or entered into a written \n\t\tagreement with us (in either case, the <b>\u201cContract\u201d<\/b>) that permitted Customer to create and configure a \n\t\tteam so that you and others could join (each invitee granted access to the Services, including you, \n\t\tis an <b>\u201cAuthorized User\u201d<\/b>).  The Contract contains our commitment to deliver the Services to Customer, \n\t\twho may then invite Authorized Users to join its team(s).  When an Authorized User (including, you) \n\t\tsubmits content or information to the Services, such as messages or files (<b>\u201cCustomer Data\u201d<\/b>), you \n\t\tacknowledge and agree that the Customer Data is owned by Customer and the Contract provides Customer \n\t\twith many choices and control over that Customer Data.  For example, Customer may provision or \n\t\tdeprovision access to the Services, enable or disable third party integrations,\tmanage permissions, \n\t\tretention and export settings, transfer or assign teams, share channels, or consolidate your team \n\t\tor channels with other teams or channels, and these choices and instructions may result in the access, \n\t\tuse, disclosure, modification or deletion of certain or all Customer Data.  Please check out our \n\t\t<a href=\"https:\/\/get.slack.help\/hc\/en-us\/categories\/200122103-Team-Administration\">Help Center<\/a> \n\t\tpages for more detail on our different Service plans and the options available to Customer.\n\t<\/p>\n\n\t<h4>The Relationship Between You, Customer and Us<\/h4>\n\n\t<p>\n\t\tAS BETWEEN US AND CUSTOMER, YOU AGREE THAT IT IS SOLELY CUSTOMER\u2019S RESPONSIBILITY TO (A) INFORM AUTHORIZED \n\t\tUSERS OF ANY RELEVANT CUSTOMER POLICIES AND PRACTICES AND ANY SETTINGS THAT MAY IMPACT THE PROCESSING OF \n\t\tCUSTOMER DATA; (B) OBTAIN ANY RIGHTS, PERMISSIONS OR CONSENTS FROM AUTHORIZED USERS THAT ARE NECESSARY FOR \n\t\tTHE LAWFUL USE OF CUSTOMER DATA AND THE OPERATION OF THE SERVICES; AND (C) RESPOND TO AND RESOLVE ANY \n\t\tDISPUTE WITH AN AUTHORIZED USER RELATING TO OR BASED ON CUSTOMER DATA, THE SERVICES OR CUSTOMER\u2019S FAILURE \n\t\tTO FULFILL THESE OBLIGATIONS.  SLACK MAKES NO REPRESENTATIONS OR WARRANTIES OF ANY KIND, WHETHER EXPRESS \n\t\tOR IMPLIED, TO YOU RELATING TO THE SERVICES, WHICH ARE PROVIDED TO YOU ON AN \u201cAS IS\u201d AND \u201c AS AVAILABLE\u201d BASIS. \n\t<\/p>\n\n\n\t<p>\n\t\t<h2>A Few Ground Rules<\/h2>\n\t<\/p>\n\n\t<h4>You Must be Over the Age of 13<\/h4>\n\n\t<p>\n\t\tThe Services are not intended for and should not be used by anyone under the age of thirteen.  \n\t\tYou represent that you are over the age of 13 and are the intended recipient of Customer\u2019s invitation to \n\t\tthe Services.  You may not access or use the Services for any purpose if either of the representations in \n\t\tthe preceding sentence is not true.\n\t<\/p>\n\n\t<h4>While You Are Here, You Must Follow the Rules<\/h4>\n\t\n\t<p>\n\t\tTo help ensure a safe and productive work environment, all Authorized Users must comply with our \n\t\t<a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a> and remain vigilant in reporting inappropriate \n\t\tbehavior or content to Customer and us.\n\t<\/p>  \n\n\t<h4>You Are Here At the Pleasure of Customer (and Us)<\/h4>\n\t\n\t<p>\n\t\tThese User Terms remain effective until Customer\u2019s subscription for you expires or terminates, or your access \n\t\tto the Services has been terminated by Customer or us.  Please contact Customer if you at any time or for any \n\t\treason wish to terminate your account, including due to a disagreement with any updates to these User Terms or \n\t\tthe <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>.\n\t<\/p>\n\n\t<p>\n\t\t<h2>Limitation of Liability<\/h2>\n\t<\/p>\n\n\t<p>\n\t\tIf we believe that there is a violation of the Contract, User Terms, the Acceptable Use Policy, or any of our \n\tother policies that can simply be remedied by Customer\u2019s removal of certain Customer Data or taking other action, \n\twe will, in most cases, ask Customer to take action rather than intervene.  We may directly step in and take what \n\twe determine to be appropriate action (including disabling your account) if Customer does not take appropriate \n\taction or we believe there is a credible risk of harm to us, the Services, Authorized Users, or any third parties.  \n\tIN NO EVENT WILL YOU OR WE HAVE ANY LIABILITY TO THE OTHER FOR ANY LOST PROFITS OR REVENUES OR FOR ANY INDIRECT, \n\tSPECIAL, INCIDENTAL, CONSEQUENTIAL, COVER OR PUNITIVE DAMAGES HOWEVER CAUSED, WHETHER IN CONTRACT, TORT OR UNDER \n\tANY OTHER THEORY OF LIABILITY, AND WHETHER OR NOT THE PARTY HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. \n\tUNLESS YOU ARE ALSO A CUSTOMER (AND WITHOUT LIMITATION TO OUR RIGHTS AND REMEDIES UNDER THE CONTRACT), YOU WILL \n\tHAVE NO FINANCIAL LIABILITY TO US FOR A BREACH OF THESE USER TERMS.  OUR MAXIMUM AGGREGATE LIABILITY TO YOU FOR \n\tANY BREACH OF THE USER TERMS IS ONE HUNDRED DOLLARS ($100) IN THE AGGREGATE.  THE FOREGOING DISCLAIMERS WILL NOT \n\tAPPLY TO THE EXTENT PROHIBITED BY APPLICABLE LAW AND DO NOT LIMIT EITHER PARTY\u2019S RIGHT TO SEEK AND OBTAIN EQUITABLE \n\tRELIEF.\n\t<\/p>\n\n\t<h4>Survival<\/h4>\n\n\t<p>\n\t\tThe sections titled \u201cThe Relationship Between You, Customer, and Us\u201d, \u201cLimitation of Liability\u201d,  and \u201cSurvival\u201d, \n\tand all of the provisions under the general heading \u201cGeneral Provisions\u201d will survive any termination or expiration \n\tof the User Terms.\n\t<\/p>\n\n\n\n\t<p>\n\t\t<h2>General Provisions<\/h2>\n\t<\/p>\n\n\t<h4>Email and Slack Messages<\/h4>\n\n\t<p>\n\t\tExcept as otherwise set forth herein, all notices under the User Terms will be by email, although we may instead \n\t\tchoose to provide notice to Authorized Users through the Services (e.g., a slackbot notification).  Notices to \n\t\tSlack should be sent to <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a>, except for  legal notices, \n\t\twhich must be sent to <a href=\"legal@slack.com\">legal@slack.com<\/a>.  A notice will be deemed to have been duly \n\t\tgiven (a) the day after it is sent, in the case of a notice sent through email; and (b) the same day, in the case \n\t\tof a notice sent through the Services.  Notices under the Contract will be delivered solely to Customer in \n\t\taccordance with the terms of that agreement.\n\t<\/p>\n\t\n\t<h4>Privacy Policy<\/h4>\n\t\n\t<p>\n\t\tPlease review our <a href=\"\/privacy-policy\">Privacy Policy<\/a> for more information on how we collect and use \n\t\tdata relating to the use and performance of our products.  \n\t<\/p>\n\t\n\t<h4>Modifications<\/h4>\n\t\n\t<p>\n\t\tAs our business evolves, we may change these User Terms or the <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>. \n\t\tIf we make a material change to the User Terms or the <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>, we \n\t\twill provide you with reasonable notice prior to the change taking effect either by emailing the email address associated with \n\t\tyour account or by messaging you through the Services. You can review the most current version of the User Terms at any time \n\t\tby visiting this page, and by visiting the following for the most current versions of the other pages that are referenced \n\t\tin these User Terms: <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a> and <a href=\"\/privacy-policy\">Privacy Policy<\/a>. \n\t\tAny material revisions to these User Terms will become effective on the date set forth in our notice, and all other changes will \n\t\tbecome effective on the date we publish the change.  If you use the Services after the effective date of any changes, that use \n\t\twill constitute your acceptance of the revised terms and conditions.\n\t<\/p>\n\t\n\t<h4>Waiver<\/h4>\n\t\n\t<p>\n\t\tNo failure or delay by either party in exercising any right under the User Terms, including the \n\t\t<a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>, will constitute a waiver of that right. No waiver under \n\t\tthe User Terms will be effective unless made in writing and signed by an authorized representative of the party \n\t\tbeing deemed to have granted the waiver.\n\t<\/p>\n\t\n\t<h4>Severability<\/h4>\n\t\n\t<p>\n\t\tThe User Terms, including the <a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>, will be enforced to \n\t\tthe fullest extent permitted under applicable law.  If any provision of the User Terms is held by a court of \n\t\tcompetent jurisdiction to be contrary to law, the provision will be modified by the court and interpreted \n\t\tso as best to accomplish the objectives of the original provision to the fullest extent permitted by law, and \n\t\tthe remaining provisions of the User Terms will remain in effect.\n\t<\/p>\n\t\n\t<h4>Assignment<\/h4>\n\t\n\t<p>\n\t\tYou may not assign any of your rights or delegate your obligations under these User Terms, including the \n\t\t<a href=\"\/acceptable-use-policy\">Acceptable Use Policy<\/a>, whether by operation of law or otherwise, \n\t\twithout the prior written consent of us (not to be unreasonably withheld).  We may assign these User Terms \n\t\tin their entirety (including all terms and conditions incorporated herein by reference), without your consent, \n\t\tto a corporate affiliate or in connection with a merger, acquisition, corporate reorganization, or sale of all\n\t\t or substantially all of our assets.  \n\t<\/p>\n\t\n\t<h4>Governing Law<\/h4>\n\t\n\t<p>\n\t\tThe Contract, and any disputes arising out of or related hereto, will be governed exclusively by the internal \n\t\tlaws of the State of California, without regard to its conflicts of laws rules or the United Nations Convention \n\t\ton the International Sale of Goods.\n\t<\/p>\n\t\n\t<h4>Venue; Waiver of Jury Trial; Fees<\/h4>\n\t\n\t<p>\n\t\tThe state and federal courts located in San Francisco County, California will have exclusive jurisdiction to \n\t\tadjudicate any dispute arising out of or relating to these User Terms, including the <a href=\"\/acceptable-use-policy\">Acceptable \n\t\tUse Policy<\/a>, or their formation as a contract between us or their enforcement. Each party hereby consents and \n\t\tsubmits to the exclusive jurisdiction of such courts. <b>Each party also hereby waives any right to jury trial \n\t\tin connection with any action or litigation in any way arising out of or related to the User Terms.<\/b> In any \n\t\taction or proceeding to enforce rights under the User Terms, the prevailing party will be entitled to recover \n\t\tits reasonable costs and attorney\u2019s fees.\n\t<\/p>\n\n\t<h4>Entire Agreement<\/h4>\n\t\n\t<p>\n\t\tThe User Terms, including any terms incorporated by reference into the User Terms, constitute the entire agreement \n\t\tbetween you and us and supersede all prior and contemporaneous agreements, proposals or representations, written \n\t\tor oral, concerning its subject matter. To the extent of any conflict or inconsistency between the provisions in \n\t\tthese User Terms and any pages referenced in these User Terms, the terms of these User Terms will first prevail; \n\t\tprovided, however, that if there is a conflict or inconsistency between the Contract and the User Terms, the \n\t\tterms of the Contract will first prevail, followed by the provisions in these User Terms, and then followed by \n\t\tthe pages referenced in these User Terms (e.g., the Privacy Policy).  Customer will be responsible for notifying \n\t\tAuthorized Users of those conflicts or inconsistencies and until such time the terms set forth herein will be binding. \n\t<\/p>\n\n\n\t<h3>Contacting Slack<\/h3>\n\n\t<p>\n\t\tPlease also feel free to contact us if you have any questions about Slack\u2019s User Terms of Service. \n\t\tYou may contact us at <a href=\"mailto:feedback@slack.com\">feedback@slack.com<\/a> or \n\t\tat our mailing address below:\n\t<\/p>\n\n\t<p>\n\t\tSlack Technologies<br \/>\n\t\t155 5th Street, 6th Floor<br \/>\n\t\tSan Francisco, CA<br \/>\n\t\t94103\n\t<\/p>\n\n\t\n";
