TS.raw_templates['channel_new_modal'] = "<div id=\"new_channel_modal\" class=\"channel_modal\">\n\t<div>\n\t\t<h1 class=\"channel_modal_header\">Create a <span class=\"private_channel_item {{#is_public}}hidden{{\/is_public}}\">private<\/span> channel<\/h1>\n\n\t\t<p class=\"input_note_special medium_bottom_margin\">Channels are where your team communicates. They\u2019re best when organized around a topic \u2014 #leads, for example.<\/p>\n\t<\/div>\n\t<div class=\"bottom_margin\">\n\t\t{{#if can_toggle_private}}\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"channel_public_private_toggle\" type=\"checkbox\" name=\"public\" value=\"public\" {{#is_public}}checked=\"checked\"{{\/is_public}} data-style=\"toggle\" data-on-text=\"Public\" data-off-text=\"Private\" data-label=\"Anyone on your team can view and join this channel.\" data-off-label=\"This channel can only be joined or viewed by invite.\" data-off-class=\"ts_toggle_orange\">\n\t\t\t<\/label>\n\t\t{{\/if}}\n\t\t{{#feature flag=\"feature_tos_oct2016\"}}\n\t\t{{else}}\n\t\t\t<p class=\"private_channel_item input_note bottom_margin {{#is_public}}hidden{{\/is_public}}\">\n\t\t\t\t{{~#if compliance_exports_enabled_for_team~}}\n\t\t\t\t\tAlthough this channel will be private, its contents may be accessible to your team owners via <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/203950296-FAQs-about-Slack-s-policy-update#complianceexport\" target=\"{{newWindowName}}\">compliance exports<\/a>.\n\t\t\t\t{{\/if~}}\n\t\t\t<\/p>\n\t\t{{\/feature}}\n\t<\/div>\n\t<div>\n\t\t<div class=\"bottom_margin\">\n\t\t\t<label for=\"channel_create_title\" class=\"block align_left\">Name<\/label>\n\t\t\t<div class=\"channel_modal_title_input_container no_margin\">\n\t\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon {{#is_public}}hidden{{\/is_public}}\" \/>\n\t\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon {{#unless is_public}}hidden{{\/unless}}\" \/>\n\t\t\t\t<input id=\"channel_create_title\" name=\"title_input\" type=\"text\" class=\"title_input large_left_padding\" value=\"{{title}}\" maxlength=\"{{ChannelNameMaxLength}}\" placeholder=\"e.g. leads\" data-validation=\"channel_name\" data-validation-for=\"channel_create_title\" data-validation-success=\"\"\/>\n\t\t\t<\/div>\n\t\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t\tNames must be lowercase, with no spaces, and unique.\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden name_taken_warning margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\tThat name is already taken by a channel, username, or user group.\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden invalid_chars_warning margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\tWe changed your name so it doesn't contain disallowed characters. If it looks good, click \"Create Channel\" again!\n\t\t\t<\/span>\n\t\t\t<span class=\"modal_input_note mustard_yellow hidden other_error margin_auto block\">\n\t\t\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t\t<span class=\"error_message\"><\/span>\n\t\t\t<\/span>\n\t\t<\/div>\n\n\t\t{{#unless is_ra}}\n\t\t<div class=\"medium_bottom_margin\">\n\t\t\t<label for=\"channel_purpose_input\" class=\"block align_left\">\n\t\t\t\tPurpose\n\t\t\t\t<span class=\"subtle_silver normal\">(optional)<\/span>\n\t\t\t<\/label>\n\t\t\t<input id=\"channel_purpose_input\" name=\"channel_purpose_input\" type=\"text\" maxlength=\"{{ChannelPurposeMaxLength}}\" placeholder=\"\"\/>\n\t\t\t<span class=\"modal_input_note margin_auto\">What\u2019s this channel about?<\/span>\n\t\t<\/div>\n\t\t{{\/unless}}\n\n\t\t<div class=\"bottom_margin\">\n\t\t\t<label for=\"group_members\" class=\"block align_left\">\n\t\t\t\tSend invites to:\n\t\t\t\t<span class=\"subtle_silver normal\">(optional)<\/span>\n\t\t\t<\/label>\n\t\t\t<div id=\"invite_members_container\"><\/div>\n\t\t<\/div>\n\t<\/div>\n\t<div class=\"new_channel_modal_footer\">\n\t\t<button id=\"save_channel\" class=\"btn btn_large new_channel_go ladda-button float_right\" type=\"submit\" data-style=\"expand-right\"><span class=\"ladda-label\">Create Channel<\/span><\/button>\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button new_channel_cancel_btn\"><span class=\"ladda-label\">Cancel<\/span><\/button>\n\t<\/div>\n<\/div>";
TS.raw_templates['channel_invite_modal'] = "<div id=\"channel_invite_modal\" class=\"channel_modal_with_list channel_modal\">\n\t<h1 class=\"large_bottom_margin channel_modal_header\">\n\t\tInvite others to\n\t\t{{#if is_private}}<i class=\"ts_icon ts_icon_lock\"><\/i>{{else}}<i class=\"ts_icon ts_icon_channel\"><\/i>{{\/if~}}\n\t\t{{~channel_name}}\n\t<\/h1>\n\n\t{{#if is_private}}\n\t\t<div id=\"private_channel_invite_step_one\" class=\"\">\n\t\t\t<p class=\"bold\">Should new members be allowed to see the channel's message history?<\/p>\n\n\t\t\t<p><span class=\"bold\">If Yes<\/span>, new members will be invited and will have access to this channel's entire message history.<\/p>\n\n\t\t\t<p>\n\t\t\t\t<span class=\"bold\">If No<\/span>,\n\t\t\t\tthis channel will be renamed and archived. A new channel will be created with all current members plus the new ones you invite.\n\t\t\t\tYou and other current members will see a link back to the original channel's archives.\n\t\t\t<\/p>\n\n\t\t\t<div>\n\t\t\t\t<button class=\"btn btn_info right_margin no_create_channel\">No, start a new channel<\/button>\n\t\t\t\t<button class=\"btn btn_primary yes_show_history\">Yes, show channel history<\/button>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{#pageNeedsEnterprise}}\n\t\t<div class=\"channel_invite_filter_container full_width{{#if is_private}} hidden{{\/if}}\">\n\t\t\t<div class=\"float_right left_margin\">\n\t\t\t\t<button class=\"btn btn_primary btn_large {{#unless preselected}}disabled{{\/unless}} invite_go ladda-button\" data-style=\"zoom-in\">\n\t\t\t\t\t<span class=\"ladda-label\">Invite<\/span>\n\t\t\t\t<\/button>\n\t\t\t\t<div class=\"subtle_silver mini align_right tiny_right_margin return_hint\">Return <i class=\"ts_icon ts_icon_enter ts_icon_inherit\"><\/i><\/div>\n\t\t\t<\/div>\n\t\t\t{{> channel_invite_tokens members=preselected}}\n\t\t\t{{> channel_kb_nav_label multiple_select=true}}\n\t\t<\/div>\n\t\t<div id=\"filter_invite_empty\" class=\"hidden align_center