TS.raw_templates['mpim_conversion_modal'] = "{{#if_gt uras.length compare=0}}\n\t<div id=\"ura_alert\" class=\"alert alert_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t{{#each uras~}}\n\t\t\t\t{{#if_equal ..\/uras.length compare=1}}\n\t\t\t\t\t<strong>{{getMemberDisplayName this}}<\/strong>\n\t\t\t\t{{else}}{{#unless @first}}{{#if_gt ..\/uras.length compare=2}},{{\/if_gt}} {{\/unless}}{{#if @last}}and {{\/if~}}\n\t\t\t\t\t<strong>{{getMemberDisplayName this}}<\/strong>{{\/if_equal}}\n\t\t\t{{~\/each}}\n\t\t\t{{#if_equal uras.length compare=1}}is a Single-Channel Guest{{else}}are Single-Channel Guests{{\/if_equal}}. {{#if_equal uras.length compare=1}}They are already a member{{else}}They are already members{{\/if_equal}} of one channel, and will not have access to this new private channel.\n\t<\/div>\n{{\/if_gt}}\n<div id=\"confirmation_step\" class=\"channel_modal\">\n\t<h1 class=\"large_bottom_margin channel_modal_header\">\n\t\tAre you sure?\n\t<\/h1>\n\t<p>By converting this conversation to a private channel, you will make the entire message history and all shared files visible to the new members that you invite to the channel.<\/p>\n\t<button class=\"btn btn_outline dialog_cancel tiny_right_margin\">Cancel<\/button>\n\t<button class=\"btn btn_primary dialog_go continue\">Yes, continue<\/button>\n<\/div>\n<div id=\"conversion_step\" class=\"hidden\">\n\t<h1 class=\"large_bottom_margin channel_modal_header\">\n\t\tEnter a name for the channel\n\t<\/h1>\n\t<input id=\"channel_create_title\" type=\"text\" class=\"title_input no_margin\" value maxlength=\"21\" placeholder=\"Enter name here\">\n\t<span class=\"modal_input_note margin_auto\">\n\t\tNames must be lowercase, no more than 21 characters, and cannot contain spaces or periods.\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden name_taken_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tThat name has been taken. Try something different.\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden invalid_chars_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tYou entered some disallowed characters in the name, which we've fixed. Make sure it looks good to you, and try again!\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden single_punctuation_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\tSorry! Names cannot be a single hyphen or underscore.\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden other_error margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t<span class=\"error_message\"><\/span>\n\t<\/span>\n\t<p class=\"large_top_margin\">You are about to convert the group DM with\n\t{{#each members~}}\n\t\t{{#unless @first}}{{#if_gt ..\/members.length compare=2}},{{\/if_gt}} {{\/unless}}{{#if @last}}and {{\/if~}}\n\t\t\t<strong>{{getMemberDisplayName this}}<\/strong>\n\t{{~\/each}}\n\tto a private channel. <strong>This cannot be undone.<\/strong><\/p>\n\t<button class=\"btn btn_outline dialog_cancel tiny_right_margin\">Cancel<\/button>\n\t<button class=\"btn btn_primary convert_mpim_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">Convert to a private channel<\/span><\/button>\n<\/div>";
