TS.raw_templates['calls_incoming_call'] = "<div id=\"incoming_call_window\">\n\t<div class=\"avatar_holder\">\n\t\t{{{makeMemberPreviewLinkImage caller.id 192 false true}}}\n\t<\/div>\n\t<div class=\"name_label_holder\"><span class=\"name\">{{#feature flag=\"feature_name_tagging_client\"}}{{getMemberFullName caller}}{{else}}{{name}}{{\/feature}}<\/span><span class=\"others\">{{#if other_count}} and {{other_count}} more{{\/if}}<\/span><\/div>\n\t<div class=\"type_label_holder\">\n\t\t<span class=\"type_label type_label_0\">&nbsp;<\/span>\n\t\t<span class=\"type_label type_label_fade\">{{#if is_video_call}}Video call{{else}}Voice call{{\/if}}<\/span>\n\t\t<span class=\"type_label type_label_fade type_label_fade_delay\">{{team}}<\/span>\n\t<\/div>\n\t<div class=\"button_holder\">\n\t\t<a class=\"ts_icon ts_icon_phone_flat reject\"><\/a>\n\t\t<a class=\"ts_icon ts_icon_phone accept accept_audio\"><\/a>\n\t\t{{#if is_video_call}}<a class=\"ts_icon ts_icon_video_camera accept accept_video\"><\/a>{{\/if}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['calls_incoming_call_window'] = "<html>\n<head>\n<script>\n_sendMessageToParentWindow = function(args) {\n\targs.origin_window_type = 'incoming_call';\n\twindow.opener.postMessage(args);\n};\n_userClickedAcceptOrReject = function(did_accept, did_choose_video) {\n\t_sendMessageToParentWindow({\n\t\tmessage_type: 'user_clicked_accept_or_reject',\n\t\tuser_id: '{{user_id}}',\n\t\troom_id: '{{room_id}}',\n\t\tdid_accept: did_accept,\n    did_choose_video: did_choose_video\n\t});\n};\ndocument.addEventListener('DOMContentLoaded', function(event) { \n  var accept_video_elements = document.getElementsByClassName('accept_video');\n  if (accept_video_elements.length > 0) {\n    accept_video_elements[0].addEventListener('click', function() {\n      _userClickedAcceptOrReject(true, true);\n    });\n  }\n\tdocument.getElementsByClassName('accept_audio')[0].addEventListener('click', function() {\n\t\t_userClickedAcceptOrReject(true);\n\t});\n\tdocument.getElementsByClassName('reject')[0].addEventListener('click', function() {\n\t\t_userClickedAcceptOrReject(false);\n\t});\n});\n<{{!}}\/script>\n{{#each css_urls}}\n<link href=\"{{this}}\" rel=\"stylesheet\">\n{{\/each}}\n<\/head>\n<body class=\"incoming_call_window_body {{#if no_border}}no_border{{\/if}}\">\n<div id=\"incoming_call\">\n{{{incoming_call_div}}}\n<\/div>\n<\/body>\n<\/html>\n";
