of_4 small_padding no_bottom_margin\">\n\t\t\t\t<p class=\"lato_bold no_bottom_margin\">{{user_group.name}} {{#if user_group.handle}}<span class=\"subtle_silver\">@{{user_group.handle}}<\/span>{{\/if}}<\/p>\n\t\t\t\t{{#if user_group.description}}\n\t\t\t\t\t<p class=\"small no_bottom_margin\">{{user_group.description}}<\/p>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#or user_group.prefs.channels.length user_group.prefs.groups.length}}\n\t\t\t\t\t<p class=\"small subtle_silver no_bottom_margin\">\n\t\t\t\t\t\t<span class=\"lato_bold\">Default channels: <\/span>\n\t\t\t\t\t\t{{#each user_group.prefs.channels}}\n\t\t\t\t\t\t\t{{getCorGNameWithPrefixById this}}\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t\t{{#each user_group.prefs.groups}}\n\t\t\t\t\t\t\t{{getCorGNameWithPrefixById this}}\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/p>\n\t\t\t\t{{\/or}}\n\t\t\t\t{{#if user_group.created_by}}\n\t\t\t\t\t<p class=\"small subtle_silver no_bottom_margin\">\n\t\t\t\t\t\tCreated by <b>\n\t\t\t\t\t\t{{~#feature flag=\"feature_name_tagging_client\"~}}\n\t\t\t\t\t\t\t{{getMemberFullName user_group.created_by}}\n\t\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t\t{{getMemberDisplayNameById user_group.created_by}}\n\t\t\t\t\t\t{{~\/feature~}}\n\t\t\t\t\t\t<\/b> on {{toCalendarDate user_group.date_create}}\n\t\t\t\t\t<\/p>\n\t\t\t\t{{\/if}}\n\t\t\t<\/div>\n\t\t\t<div class=\"float_right right_padding\">\n\t\t\t\t<p class=\"user_group_count no_bottom_margin float_right small subtle_silver\">\n\t\t\t\t\t{{#or user_group.is_external user_group.auto_type}}<i class=\"ts_icon ts_icon_sync\"><\/i>{{\/or}}\n\t\t\t\t\t<i class=\"ts_icon ts_icon_user\"><\/i>{{user_group.user_count}}\n\t\t\t\t<\/p>\n\t\t\t\t<p class=\"user_group_actions small no_bottom_margin\">\n\t\t\t\t\t{{#if show_toggle}}\n\t\t\t\t\t\t<button class=\"user_group_toggle_btn btn_icon btn_outline btn ts_icon ts_icon_disable ts_tip ts_tip_bottom\" title=\"Disable\" data-action=\"disable_user_group\"><span class=\"ts_tip_tip\">Disable group<\/span><\/button>\n\t\t\t\t\t{