TS.raw_templates['user_group_tip'] = "{{#if is_flexpane}}\n\t<div>\n\t\t<span class=\"user_groups_img\"><\/span>\n\t<\/div>\n{{\/if}}\n\n<div{{#unless is_flexpane}} class=\"col span_3_of_4\"{{\/unless}}>\n\t\n\t<div class=\"normal_padding{{#if is_flexpane}} dull_grey{{\/if}}\">\n\t\t<p class=\"user_groups_tip lato\">\n\t\t\tWhile commands like <span class=\"mention\">@everyone<\/span>, <span class=\"mention\">@channel<\/span>, and <span class=\"mention\">@here<\/span> call the attention of team members in a conversation, User Groups let you choose exactly who should get your message.\n\t\t<\/p>\n\t\t<p class=\"user_groups_tip lato\">\n\t\t\tChoose a group name, like <span class=\"mention\">@design<\/span> or <span class=\"mention\">@marketing<\/span>, then select the group members. Now, when someone on your team mentions the User Group, only its members will be notified. You can even add those team members to channels of your choice automatically!\n\t\t<\/p>\n\t<\/div>\n\t\n<\/div>\n\n{{#unless is_flexpane}}\n\t<div class=\"col span_1_of_4 no_right_padding\">\n\t\t<span class=\"user_groups_img\"><\/span>\n\t<\/div>\n{{\/unless}}\n";
TS.raw_templates['user_group_channel_list_item'] = "<div class=\"user_group_item channel_item normal_padding clearfix\">\n\t<div class=\"col span_6_of_6 no_bottom_margin\">\n\t\t<a target=\"\/messages\/{{this.id}}\" {{#if this.is_channel}}data-channel-id=\"{{this.id}}\" class=\"internal_channel_link\"{{else}}data-group-id=\"{{this.id}}\" class=\"internal_group_link\"{{\/if}}>\n\t\t\t<h4 class=\"tiny_bottom_margin lato_bold\">{{#if this.is_channel}}<span class=\"lato subtle_silver\">#<\/span>{{\/if}}{{this.name}} {{#if this.is_member}}<span class=\"mini subtle_silver lato\">JOINED<\/span>{{\/if}}<\/h4>\n\t\t\t{{#if this.creator}}\n\t\t\t\t{{#if this.created}}\n\t\t\t\t\t<p class=\"lato subtle_silver tiny_bottom_margin\"><i>Created by <b>{{#feature flag=\"feature_name_tagging_client\"}}{{getMemberFullName this.creator}}{{else}}{{getMemberDisplayNameById this.creator}}{{\/feature}}<\/b> on {{toCalendarDate this.created}}<\/i><\/p>\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t\t{{#if this.purpose}}\n\t\t\t\t<p class=\"lato subtle_silver tiny_bottom_margin\">\n\t\t\t\t\t{{this.purpose.value}}\n\t\t\t\t<\/p>\n\t\t\t{{\/if}}\n\t\t<\/a>\n\t<\/div>\n<\/div>";
TS.raw_templates['user_group_alerts'] = "{{#if_equal error compare=\"forbidden_name\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>The name \"{{group_name}}\" is reserved and cannot be used.<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"name_already_exists\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>A User Group already has the name \"{{group_name}}\".<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"handle_already_exists\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>The group name \"@{{group_handle}}\" is already in use. Group names cannot be the same as channel names or usernames.<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"missing_subteam_name\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>A User Group must have a name.<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"bad_handle\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>The handle must be lowercase and cannot contain spaces.<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"forbidden_handle\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>The group name \"@{{group_handle}}\" is reserved and cannot be used.<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if_equal error compare=\"no_users_provided\"}}\n\t<p class=\"alert alert_error\"><i class=\"ts_icon ts_icon_warning\"><\/i> <strong>User Groups must have members.<\/strong><\/p>\n{{\/if_equal}}\n\n{{#if can_create_auto_owners}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>Trying to create a group for all Team Owners? <a href=\"#auto-group\" data-auto-type=\"owners\" data-auto-action=\"create\" class=\"user_group_auto_action\">Make an automatic one<\/a> that's always up to date.<\/p>\n{{\/if}}\n\n{{#if can_enable_auto_owners}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>Trying to create a group for all Team Owners? <a href=\"#auto-group\" data-auto-type=\"owners\" data-auto-action=\"enable\" class=\"user_group_auto_action\">Re-enable the automatic one<\/a> that's always up to date.<\/p>\n{{\/if}}\n\n{{#if can_create_auto_admins}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>Trying to create a group for all Team Admins? <a href=\"#auto-group\" data-auto-type=\"admins\" data-auto-action=\"create\" class=\"user_group_auto_action\">Make an automatic one<\/a> that's always up to date.<\/p>\n{{\/if}}\n\n{{#if can_enable_auto_admins}}\n\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info\"><\/i>Trying to create a group for all Team Admins? <a href=\"#auto-group\" data-auto-type=\"admins\" data-auto-action=\"enable\" class=\"user_group_auto_action\">Re-enable the automatic one<\/a> that's always up to date.<\/p>\n{{\/if}}\n";
TS.raw_templates['user_group_modal'] = "<div id=\"user_groups_container\">\n\n\t<div id=\"all_user_groups\">\n\t\t<div id=\"user_groups_header\" class=\"clearfix bottom_border\">\n\t\t\t{{#if show_user_groups_add}}\n\t\t\t\t<a data-action=\"open_form\" class=\"btn float_right\">Create a new group<\/a>\n\t\t\t{{\/if}}\n\t\t\t<h1>User Groups<\/h1>\n\t\t\t<div class=\"user_groups_search\">\n\t\t\t\t<i class=\"icon_search ts_icon ts_icon_search\"><\/i>\n\t\t\t\t<a class=\"ts_icon ts_icon_times_circle icon_close hidden\"><\/a>\n\t\t\t\t<input id=\"user_group_modal_search\" type=\"text\" class=\"member_filter no_margin small\" name=\"team_filter\" placeholder=\"Find by name\" \/>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t{{#ifClient}}\n\t\t\t{{#if show_info_pane}}\n\t\t\t\t<div class=\"info_panel clearfix\">\n\t\t\t\t\t<p>\n\t\t\t\t\t\tWhile commands like <span class=\"mention\">@everyone<\/span>, <span class=\"mention\">@channel<\/span>, and <span class=\"mention\">@here<\/span> call the attention of team members in a conversation, User Groups let you choose exactly who should get your message.\n\t\t\t\t\t<\/p>\n\t\t\t\t\t<p class=\"col span_3_of_4 no_bottom_margin\">\n\t\t\t\t\t\tChoose a group name, like <span class=\"mention\">@design<\/span> or <span class=\"mention\">@marketing<\/span>, then select the group members. Now, when someone on your team mentions the User Group, only its members will be notified. You can even add those team members to channels of your choice automatically!<br>\n\t\t\t\t\t\t<a data-action=\"hide_info_pane\" class=\"lato_bold\">Ok, you can hide this now<\/a>\n\t\t\t\t\t<\/p>\n\t\t\t\t\t<div class=\"col span_1_of_4 top_margin no_padding\">\n\t\t\t\t\t\t<span class=\"user_groups_img\"><\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t{{\/ifClient}}\n\t\t<div id=\"user_groups_list_scroller\">\n\t\t\t<div id=\"user_groups_list_div\">{{{loadingHTML}}}<\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t<div id=\"user_groups_form_div\" class=\"hidden\"><\/div>\n\t\n\t<div id=\"user_groups_toggle_div\" class=\"hidden\"><\/div>\n\n<\/div>\n";
TS.raw_templates['user_group_settings_form'] = "<div id=\"user_groups_header\" class=\"clearfix\">\n\t<h1 class=\"channel_modal_header\">{{#if this.id}}Edit {{this.name}}{{else}}Create a user group{{\/if}}<\/h1>\n<\/div>\n\n<p class=\"input_note medium_bottom_margin\">{{#unless this.id}}User groups make it easy to get the attention of many team members at once. When you use a group\u2019s handle \u2014 like @accounts, for example \u2014 everyone in that group will be notified.{{\/unless}}<\/p>\n\n<div id=\"user_group_alerts\"><\/div>\n\n<form class=\"user_group_settings_form\">\n\t{{#if this.is_external}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> The name of this User Group is managed by an external service. Use that service if you wish to rename this User Group.<\/p>\n\t{{\/if}}\n\n\t{{#if this.auto_type}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> This User Group is automatically generated for team {{this.auto_type}}s.<\/p>\n\t{{\/if}}\n\n\t<p>\n\t\t<label for=\"user_group_name_input\">Name<\/label>\n\t\t<input id=\"user_group_name_input\" type=\"text\" class=\"no_bottom_margin {{#or this.is_external this.auto_type}}disabled{{\/or}}\" name=\"name\" value=\"{{this.name}}\" maxlength=\"100\" placeholder=\"e.g. Accounts Team\" {{#or this.is_external this.auto_type}}disabled{{\/or}}\/>\n\t<\/p>\n\n\t<p class=\"handle_input empty\">\n\t\t<label for=\"user_group_handle_input\">Handle<\/label>\n\t\t<span class=\"icon_at\">@<\/span>\n\t\t<input id=\"user_group_handle_input\" type=\"text\" class=\"no_bottom_margin\" name=\"handle\" value=\"{{this.handle}}\" maxlength=\"100\" placeholder=\"e.g. @accounts\"\/><br \/>\n\t\t<span class=\"input_note\">You\u2019ll use this handle to get the group\u2019s attention. It should be all lowercase, with no spaces.<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"description\">Purpose <span class=\"subtle_silver normal\">(optional)<\/span><\/label>\n\t\t<input type=\"text\" class=\"no_bottom_margin\" name=\"description\" value=\"{{this.description}}\" placeholder=\"\" maxlength=\"140\"\/>\n\t\t<span class=\"input_note\">What\u2019s this group about?<\/span>\n\t<\/p>\n\n\t<p>\n\t\t<label for=\"user_group_default_channels\">Default channels: <span class=\"subtle_silver normal\">(optional)<\/span><\/label>\n\t\t<select class=\"hidden\" multiple=\"true\" id=\"user_group_default_channels\" name=\"defaultchannels[]\"><\/select>\n\t\t{{#if this.user_count}}\n\t\t\t<span class=\"input_note\">New members will be automatically added to default channels. Existing members will be added immediately.<\/span>\n\t\t{{else}}\n\t\t\t<span class=\"input_note\">Group members are added to these channels automatically.<\/span>\n\t\t{{\/if}}\n\t<\/p>\n\n\t<button id=\"save_user_group\" type=\"submit\" class=\"btn btn_large ladda-button float_right\"><span class=\"ladda-label\">{{#if this.id}}Save{{else}}Create Group{{\/if}}<\/span><\/button>\n\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">Cancel<\/span><\/button>\n\n<\/form>\n";
TS.raw_templates['user_group_members_form'] = "<div id=\"user_groups_header\" class=\"clearfix\">\n\t<h1>{{#if is_new}}Invite team members to {{user_group.name}}{{else}}Edit members of {{user_group.name}}{{\/if}}<\/h1>\n<\/div>\n\n<form class=\"user_group_members_form\">\n\n\t{{#if user_group.is_external}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> The members of this User Group are managed by an external service. Use that service if you wish to edit this list.<\/p>\n\t{{\/if}}\n\n\t{{#if user_group.auto_type}}\n\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i> This User Group is automatically generated for team {{user_group.auto_type}}s.<\/p>\n\t{{\/if}}\n\n\t<p id=\"user_group_member_invite_div\">\n\t\t<label for=\"members\">Send invites to: <span class=\"subtle_silver normal\">(optional)<\/span><\/label>\n\t\t<select class=\"hidden\" multiple=\"true\" id=\"user_group_members_select\" name=\"members[]\"><\/select>\n\t\t{{#unless is_locked}}<span class=\"input_note\">You can also <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/212572638\" target=\"_blank\">import members from Active Directory using provisioning<\/a>.<\/span>{{\/unless}}\n\t<\/p>\n\n\t{{#if is_locked}}\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">Ok<\/span><\/button>\n\t{{else}}\n\t\t<button type=\"submit\" id=\"{{#if is_new}}create_group{{else}}save_group{{\/if}}\" class=\"btn btn_large float_right ladda-button\"><span class=\"ladda-label\">{{#if is_new}}Invite{{else}}Save{{\/if}}<\/span><\/button>\n\t\t<button type=\"reset\" class=\"btn btn_large btn_outline float_right small_right_margin ladda-button\"><span class=\"ladda-label\">Cancel<\/span><\/button>\n\t{{\/if}}\n<\/form>\n";
TS.raw_templates['user_group_toggle'] = "<div id=\"user_group_alerts\"><\/div>\n\n{{#if_equal action compare=\"delete_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>Delete {{user_group.name}}?<\/h1>\n\t\t<p>All the information about this User Group will be permanently deleted. This action cannot be undone.<\/p>\n\t\t<a data-action=\"cancel\" class=\"btn btn_outline\">Cancel<\/a>\n\t\t<a data-action=\"deleteUserGroup\" class=\"user_group_toggle_btn btn btn_danger\">Delete this group<\/a>\n\t<\/div>\n{{\/if_equal}}\n{{#if_equal action compare=\"disable_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>Disable {{user_group.name}}?<\/h1>\n\t\t<p>If you disable this User Group, you will not be able to {{#if user_group.handle}}use @{{user_group.handle}} or {{\/if}} view the list of its members (you can re-enable it later).<\/p>\n\t\t<a data-action=\"cancel\" class=\"btn btn_outline bottom_margin\">Cancel<\/a>\n\t\t<a data-action=\"disableUserGroup\" class=\"user_group_toggle_btn btn bottom_margin\">Disable this group<\/a>\n\t\t{{#if show_delete}}\n\t\t\t<p>You can also <a data-action=\"switch_delete_user_group\" class=\"lato_bold\">permanently delete this group.<\/a><\/p>\n\t\t{{\/if}}\n\t<\/div>\n{{\/if_equal}}\n{{#if_equal action compare=\"enable_user_group\"}}\n\t<div class=\"align_center clearfix very_large_top_margin very_large_left_margin very_large_right_margin\">\n\t\t<h1>Enable {{user_group.name}}?<\/h1>\n\t\t{{#if user_group.handle}}<p>If you enable, @{{user_group.handle}} will notify members of the group.<\/p>{{\/if}} \n\t\t<a data-action=\"cancel\" class=\"btn btn_outline\">Cancel<\/a>\n\t\t<a data-action=\"enableUserGroup\" class=\"user_group_toggle_btn btn\">Enable this group<\/a>\n\t<\/div>\n{{\/if_equal}}\n";
TS.raw_templates['user_group_invite_member_small'] = "<div class=\"user_group_invite_member_small clearfix\">\n\t<i class=\"enter_icon ts_icon ts_icon_enter sky_blue not_in_token float_right small_top_margin\"><\/i>\n\t<img src=\"{{member.profile.image_48}}\" srcset=\"{{member.profile.image_48}} 1x, {{member.profile.image_72}} 2x\" class=\"invite_member_avatar\">\n\t<div class=\"name_container overflow_ellipsis\">\n\t\t{{#feature flag=\"feature_name_tagging_client\"}}\n\t\t\t<div class=\"bold\">{{getMemberFullName member}}<\/div>\n\t\t\t<div class=\"subtle_silver not_in_token\">{{getMemberPreferredName member}}<\/div>\n\t\t{{else}}\n\t\t\t{{#if member.profile.real_name}}\n\t\t\t\t<div class=\"bold\">{{member.profile.real_name}}<\/div>\n\t\t\t\t<div class=\"subtle_silver not_in_token\">{{member.name}}<\/div>\n\t\t\t{{else}}\n\t\t\t\t<div class=\"bold\">{{member.name}}<\/div>\n\t\t\t{{\/if}}\n\t\t{{\/feature}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['user_group_preview'] = "{{#if is_user_group_deleted}}\n\t<p class=\"alert alert_error small_right_margin small_left_margin\"><i class=\"ts_icon ts_icon_warning\"><\/i> This User Group is deleted.<\/p>\n{{else}}\n\t{{#if user_group.date_delete}}\n\t\t<p class=\"alert alert_error small_right_margin small_left_margin\"><i class=\"ts_icon ts_icon_warning\"><\/i> This User Group is disabled.<\/p>\n\t{{\/if}}\n{{\/if}}\n<div id=\"user_group_title\" class=\"clearfix selectable_flex_pane_padder no_bottom_margin\">\n\n\t<h3 class=\"tiny_bottom_margin right_margin\">\n\t\t{{user_group.name}}\n\t\t{{#unless is_user_group_deleted}}\n\t\t\t{{#if show_user_groups_edit}} \n\t\t\t\t<button id=\"user_group_menu_toggle\" class=\"float_right btn_icon btn_outline btn ts_icon ts_icon_chevron_large_down\" aria-label=\"Print\"><\/button>\n\t\t\t{{\/if}}\n\t\t{{\/unless}}\n\t<\/h3>\n\t{{#if user_group.handle}}\n\t<p class=\"lato subtle_silver {{#if user_group.created_by}}tiny_bottom_margin{{\/if}}\">\n\t\tUse <b>@{{user_group.handle}}<\/b> to notify this group\n\t<\/p>\n\t{{\/if}}\n\t{{#if user_group.created_by}}\n\t\t{{#if user_group.date_create}}\n\t\t\t<p class=\"lato subtle_silver\">\n\t\t\t\tCreated by <b>\n\t\t\t\t{{~#feature flag=\"feature_name_tagging_client\"~}}\n\t\t\t\t\t{{getMemberFullName user_group.created_by}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{getMemberDisplayNameById user_group.created_by}}\n\t\t\t\t{{~\/feature~}}\n\t\t\t\t<\/b> on {{toCalendarDate user_group.date_create}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t{{\/if}}\n\t\n\t{{#if user_group.description}}\n\t\t<p class=\"lato\">{{user_group.description}}<\/p>\n\t{{\/if}}\n<\/div>\n\n<ul id=\"user_group_tabs\" class=\"flexpane_tab_bar small_top_margin lato no_bottom_margin bottom_border\">\n\t<li id=\"user_group_members_tab\" class=\"tab bold active\" href=\"#user_group_members\"><a href=\"#user_group_members\" data-name=\"user_group_members\">Members <span class=\"normal\">({{members.length}})<\/span><\/a><\/li>\