TS.raw_templates['admin_invite_row'] = "{{i18n_ns 'invite'}}\n<div id=\"invite_{{index}}\" class=\"admin_invite_row clearfix\">\n\t<div class=\"col span_1_of_2\">\n\t\t<label class=\"email full_width\">\n\t\t\t{{#t}}Email Address{{\/t}}<br \/>\n\t\t\t<div class=\"full_width\">\n\t\t\t\t<input type=\"text\" spellcheck=\"false\" autocorrect=\"off\" class=\"email_field small\" name=\"email_address\" placeholder=\"{{placeholder_email_address}}\" data-email-healing=\"true\">\n\t\t\t<\/div>\n\t\t<\/label>\n\t\t<p class=\"error_msg input_note hidden moscow_red no_bottom_margin\"><\/p>\n\t<\/div>\n\n\t{{#feature flag=\"feature_name_tagging_client\"}}\n\t\t<div class=\"col span_1_of_2\">\n\t\t\t<label class=\"full_width\">\n\t\t\t\t{{#t}}Full Name{{\/t}}<br \/>\n\t\t\t\t<input type=\"text\" name=\"full_name\" placeholder=\"{{#t}}Optional{{\/t}}\" class=\"small small_right_margin no_bottom_margin full_width\" maxlength=\"200\"\/>\n\t\t\t<\/label>\n\t\t<\/div>\n\t{{else}}\n\t<div class=\"col span_1_of_2\">\n\t\t<div class=\"col span_1_of_2 mobile_col small_right_padding\">\n\t\t\t<label class=\"full_width\">\n\t\t\t\t{{#t}}First Name{{\/t}}<br \/>\n\t\t\t\t<input type=\"text\" name=\"first_name\" placeholder=\"{{#t}}Optional{{\/t}}\" class=\"small small_right_margin no_bottom_margin full_width\" maxlength=\"200\"\/>\n\t\t\t<\/label>\n\t\t<\/div>\n\t\t<div class=\"col span_1_of_2 mobile_col float_right\">\n\t\t\t<label class=\"full_width\">\n\t\t\t\t{{#t}}Last Name{{\/t}}<br \/>\n\t\t\t\t<input type=\"text\" name=\"last_name\" placeholder=\"{{#t}}Optional{{\/t}}\" class=\"small no_bottom_margin full_width\" maxlength=\"200\"\/>\n\t\t\t<\/label>\n\t\t<\/div>\n\t<\/div>\n\t{{\/feature}}\n\t\n\t<a class=\"delete_row {{#unless show_delete_btn}}hidden{{\/unless}}\" data-action=\"admin_invites_delete_row\"><i class=\"ts_icon ts_icon_times\"><\/i><\/a>\n<\/div>";
TS.raw_templates['admin_invite_modal'] = "{{i18n_ns 'invite'}}\n<div id=\"admin_invites_container\">\n\n\t<h1 id=\"admin_invites_header\" class=\"light align_center\">\n\t\t<i class=\"ts_icon ts_icon_paper_plane clear_blue float_none small_right_margin hide_on_mobile\"><\/i>\n\t\t{{#t}}Invite <span class=\"admin_invites_header_type\">people<\/span> <span class=\"admin_invites_header_team_name\"> to <span class=\"normal\">{team_name}<\/span><\/span>{{\/t}}\n\t<\/h1>\n\n\t<div id=\"admin_invites_switcher\">\n\t\t{{> admin_invite_switcher}}\n\t<\/div>\n\n\t<div id=\"admin_invites_workflow\" class=\"hidden top_margin\">\n\n\t\t<div id=\"admin_invites_channel_picker_container\"><\/div>\n\n\t\t<form id=\"individual_invites\">\n\n\t\t\t<input type=\"hidden\" name=\"account_type\" id=\"account_type\" value=\"full\" \/>\n\n\t\t\t<p class=\"alert alert_info\" id=\"invite_notice\" style=\"display: none;\"><\/p>\n\n\t\t\t<div id=\"invite_rows\"><\/div>\n\n\t\t\t<p id=\"admin_invites_add_row\" class=\"clear_both clearfix\">\n\t\t\t\n\t\t\t\t<a data-action=\"admin_invites_add_row\" class=\"float_left bold\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=add_row,trigger=click_cta_add_row\" tabindex=\"0\"><ts-icon class=\"ts_icon_plus_circle small_right_margin align_bottom\"><\/ts-icon>{{#t}}Add another invitation{{\/t}}<\/a>\n\n\t\t\t\t<span id=\"btn_connect_contacts\" class=\"float_right subtle_silver\"><ts-icon class=\"ts_icon_google small_right_margin align_bottom\"><\/ts-icon><span class=\"btn_connect_contacts_text\">{{#t}}Connect your <a data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=connect_google_contacts,trigger=click_connect_address_book_btn\" tabindex=\"0\">Google Contacts<\/a>{{\/t}}<\/span>\n\t\t\t\t<\/span>\n\n\t\t\t<\/p>\n\n\t\t\t<div class=\"invite_modal_options_container\">\n\n\t\t\t\t<div class=\"admin_invites_custom_message_container\">\n\t\t\t\t\t<div class=\"admin_invites_show_custom_message hidden medium_bottom_margin\">\n\t\t\t\t\t\t<label for=\"admin_invite_custom_message\">{{#t note=\"label for a custom message\"}}Custom Message{{\/t}}<\/label>\n\t\t\t\t\t\t<textarea id=\"admin_invite_custom_message\" name=\"admin_invite_custom_message\" maxlength=\"560\" placeholder=\"{{#t}}Enter a custom message to attach to the invites{{\/t}}\" data-validation=\"hasnourl\"><\/textarea>\n\t\t\t\t\t\t<a class=\"hide_custom_message\" data-action=\"admin_invites_hide_custom_message\"><i class=\"ts_icon ts_icon_times\"><\/i><\/a>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\n\t\t\t\t<div class=\"invite_modal_options large_bottom_margin\">\n\t\t\t\t\t<div class=\"invite_modal_options_left\">\n\t\t\t\t\t\t{{#if show_custom_message}}\n\t\t\t\t\t\t\t<div class=\"admin_invites_hide_custom_message invite_modal_options_message small subtle_silver no_bottom_margin\">\n\t\t\t\t\t\t\t\t{{#t}}<a class=\"underline subtle_silver\" data-action=\"admin_invites_show_custom_message\" tabindex=\"0\">Add a custom message<\/a> to make your invites more personal.{{\/t}}\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t\t<div class=\"small no_bottom_margin invite_modal_options_message medium_right_margin\">{{#t}}<span class=\"subtle_silver\">Big team?<\/span><a data-action=\"admin_invites_switch_view\" data-view=\"bulk\" class='small_left_margin subtle_silver underline' data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=switch_view_to_bulk,trigger=click_cta_switch_view_to_bulk\" tabindex=\"0\">Invite many people at once<\/a>{{\/t}}<\/div>\n\t\t\t\t\t\t{{#unless is_paid_team}}\n\t\t\t\t\t\t\t<div class=\"small no_bottom_margin invite_modal_options_message\">{{#currentUserIsAdmin}}<a href=\"\/admin\/invites\" class=\"subtle_silver underline\" target=\"{{newWindowName}}\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=view_pending_and_accepted,trigger=click_cta_pending_and_accepted\">{{#t}}See pending and accepted invites{{\/t}}<\/a>{{\/currentUserIsAdmin}}<\/div>\n\t\t\t\t\t\t{{\/unless}}\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"invite_modal_options_right\">\n\t\t\t\t\t\t<button type=\"submit\" id=\"admin_invites_submit_btn\" class=\"btn btn_large ladda-button\" data-action=\"api_send_invites\" data-style=\"expand-right\">\n\t\t\t\t\t\t\t<span class=\"ladda-label\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=invite,trigger=click_cta_submit_btn\">{{#t}}Invite People{{\/t}}<\/span>\n\t\t\t\t\t\t<\/button>\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\n\t\t\t\t{{#if is_paid_team}}\n\t\t\t\t\t<div class=\"invite_modal_footer subtle_silver align_center large_top_padding large_top_margin\">\n\t\t\t\t\t\t<span id=\"admin_invites_billing_notice\">{{#t}}You'll be charged a prorated amount for each new member. See our <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/201723133-Billing-FAQ\"  class=\"subtle_silver underline\" target=\"new\">Guide to billing at Slack<\/a>.{{\/t}}<\/span>\n\n\t\t\t\t\t\t<span id=\"ura_warning\">{{#t}}Note that guest accounts can access your directory via the <a href=\"https:\/\/api.slack.com\/methods\/users.list\" target=\"new\" class=\"subtle_silver underline\">Slack API<\/a>.{{\/t}}<\/span>\n\t\t\t\t\t\t{{#currentUserIsAdmin}}<a href=\"\/admin\/invites\" class=\"subtle_silver underline pending_updates\" target=\"{{newWindowName}}\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=view_pending_and_accepted,trigger=click_cta_pending_and_accepted\">{{#t}}See pending and accepted invites{{\/t}}<\/a>{{\/currentUserIsAdmin}}\n\t\t\t\t\t<\/div>\n\t\t\t\t{{\/if}}\n\n\t\t\t<\/div>\n\n\t\t<\/form>\n\n\t\t<form id=\"bulk_invites\" class=\"hidden stacked top_margin\">\n\n\t\t\t<p class=\"alert alert_warning hidden\" id=\"bulk_notice\"><\/p>\n\n\t\t\t<label class=\"full_width\">\n\t\t\t\t{{#t}}Enter multiple email addresses{{\/t}}\n\t\t\t\t<textarea wrap=\"virtual\" name=\"emails\" id=\"bulk_emails\" class=\"no_bottom_margin full_width\"><\/textarea>\n\t\t\t<\/label>\n\t\t\t{{#if invites_limit}}\n\t\t\t<p class=\"input_note\">{{#t}}Please separate multiple addresses with commas. <strong>Keep in mind that Slack may limit the number of invitations you can send if your team currently has a low acceptance rate.<\/strong> Our Help Center has <a href='https:\/\/get.slack.help\/hc\/en-us\/articles\/201330256#invitation_limits'> more details on invitation limits<\/a>.{{\/t}}<\/p>\n\t\t\t{{else}}\n\t\t\t<p class=\"input_note\">{{#t}}<strong>Tip:<\/strong> Copy and paste a list of contacts from your email. Please separate multiple addresses with\u00a0commas!{{\/t}}<\/p>\n\t\t\t{{\/if}}\n\n\t\t\t<button type=\"submit\" class=\"btn small_right_margin ladda-button\" data-action=\"api_parse_emails\" data-style=\"expand-right\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=invite_bulk,trigger=click_cta_submit_bulk_btn\">{{#t}}Add Invitees{{\/t}}<\/button>\n\t\t\t<a class=\"btn btn_outline\" data-action=\"admin_invites_switch_view\" data-view=\"individual\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=switch_view_to_individual,trigger=click_cta_switch_view_to_individual\">{{#t}}Cancel{{\/t}}<\/a>\n\t\t<\/form>\n\n\t<\/div>\n\n\t<div id=\"admin_invites_success\" class=\"hidden\">\n\t\t{{> admin_invite_summary}}\n\t<\/div>\n\n<\/div>\n";
TS.raw_templates['admin_invite_channel_picker'] = "{{i18n_ns 'invite'}}\n{{#if_equal invite_type compare='full'}}\n\t<p id=\"default_channels_note\" class=\"small align_center no_bottom_margin {{#if initial_channel_id}}hidden{{\/if}}\">\n\t\t{{#t teams=(listify default_channels map=\"name\" strong=true)}}New <strong>full members<\/strong> will automatically join {teams}{{\/t}}\n\t\t{{#if is_admin}}\n\t\t\t<a onclick=\"$('#default_channels_note').hide(); $('#default_channels').show();\" class=\"small_left_margin subtle_silver underline inline_block\" data-clog-click=\"true\" data-clog-event=\"INVITEMODAL_ACTION\" data-clog-params=\"action=edit_channels,trigger=click_cta_edit_channels\">{{#t note=\"link that allows admin to edit or add default channels\"}}Edit \/ add{{\/t}}<\/a>\n\t\t{{\/if}}\n\t<\/p>\n\t<p id=\"default_channels\" {{#if initial_channel_id}}{{else}}style=\"display: none; overflow: visible !important;\"{{\/if}}>\n\t\t<select multiple=\"multiple\" id=\"defaultchannelsmulti\" name=\"defaultchannels[]\" class=\"hidden\">\n\t\t\t{{#each channels}}\n\t\t\t\t{{#unless this.is_general}}\n\t\t\t\t\t<option value=\"{{this.id}}\" {{#if this.is_default}}selected{{\/if}} {{#if_equal this.id compare=..\/initial_channel_id}}selected{{\/if_equal}}>#{{this.name}}<\/option>\n\t\t\t\t{{\/unless}}\n\t\t\t{{\/each}}\n\t\t\t{{#each groups}}\n\t\t\t\t<option value=\"{{this.id}}\">{{this.name}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/select>\n\t\t<span class=\"small align_center\">\n\t\t\t{{#t}}New <strong>full members<\/strong> will automatically join these channels and <strong>#{general_name}<\/strong>{{\/t}} <a href=\"\/admin\/settings#default_channels\" target=\"admin_settings\" class=\"small_left_margin subtle_silver underline\">{{#t note=\"link to change default channels\"}}change defaults{{\/t}}<\/a>\n\t\t<\/span>\n\t<\/p>\n{{\/if_equal}}\n\n{{#if_equal invite_type compare='restricted'}}\n\t<p class=\"small align_center small_bottom_margin\">{{#t}}New <strong>multi-channel guests<\/strong> will only have access to these channels:{{\/t}}<\/p>\n\t<p id=\"restricted_channel_picker_container\">\n\t\t<select multiple=\"multiple\" id=\"defaultchannelsmulti\" name=\"defaultchannels[]\" data-placeholder=\"{{#t}}Choose one or more channels ...{{\/t}}\">\n\t\t\t{{#each channels}}\n\t\t\t\t<option value=\"{{this.id}}\" {{#if_equal this.id compare=..\/initial_channel_id}}selected{{\/if_equal}}>#{{this.name}}<\/option>\n\t\t\t{{\/each}}\n\t\t\t{{#each groups}}\n\t\t\t\t<option value=\"{{this.id}}\" {{#if_equal this.id compare=..\/initial_channel_id}}selected{{\/if_equal}}>{{this.name}}<\/option>\n\t\t\t{{\/each}}\n\t\t<\/select>\n\t<\/p>\n{{\/if_equal}}\n\n{{#if_equal invite_type compare='ultra_restricted'}}\n\t<p class=\"small align_center small_bottom_margin\">{{#t}}New <strong>single-channel guests<\/strong> will only have access to this channel:{{\/t}}<\/p>\n\t<p id=\"ultra_restricted_channel_picker_container\">\n\t\t<select id=\"ultra_restricted_channel_picker\" name=\"ultra_restricted_channel_picker\" class=\"full_width\">\n\t\t\t<option value=\"\" selected=\"selected\">{{#t}}Choose a channel ...{{\/t}}<\/option>\n\t\t\t{{#if channels}}\n\t\t\t\t<optgroup label=\"Channels\">\n\t\t\t\t\t{{#each channels}}\n\t\t\t\t\t\t<option value=\"{{this.id}}\" {{#if_equal this.id compare=..\/initial_channel_id}}selected{{\/if_equal}}>#{{this.name}}<\/option>\n\t\t\t\t\t{{\/each}}\n\t\t\t\t<\/optgroup>\n\t\t\t{{\/if}}\n\t\t\t{{#if groups}}\n\t\t\t\t<optgroup label=\"Private Channels\">\n\t\t\t\t\t{{#each groups}}\n\t\t\t\t\t\t<option value=\"{{this.id}}\" {{#if_equal this.id compare=..\/initial_channel_id}}selected{{\/if_equal}}>{{this.name}}<\/option>\n\t\t\t\t\t{{\/each}}\n\t\t\t\t<\/optgroup>\n\t\t\t{{\/if}}\n\t\t<\/select>\n\t<\/p>\n{{\/if_equal}}\n\n<p class=\"small align_center no_bottom_margin\">\n\t<span id=\"sso_signup_notice\" class=\"block small_top_margin hidden\"><\/span>\n\t<span id=\"google_auth_email_domain_notice\" class=\"hidden\">\n\t\t\t{{#t email_domains=(listify email_domains)}}You can invite people with email addresses ending in {email_domains}{{\/t}}\n\t\t<a href=\"\/admin\/auth\/google\" target=\"{{newWindowName}}\" class=\"subtle_silver small_left_margin underline\">{{#t}}change SSO settings{{\/t}}<\/a>\n\t<\/span>\n<\/p>";
TS.raw_templates['admin_invite_summary'] = "<h1 class=\"light align_center\">\n\t{{#if error_invites}}\n\t\t{{#if success_invites}}\n\t\t\tThat was only a partial success.\n\t\t{{else}}\n\t\t\tThat didn't work!\n\t\t{{\/if}}\n\t{{else}}\n\t\tYour invitation{{#if_gt success_invites.length compare=1}}s have{{else}} has{{\/if_gt}} been sent!\n\t{{\/if}}\n<\/h1>\n\n<p class=\"align_center large_bottom_margin\">\n\t{{#if error_invites}}\n\t\t{{#if success_invites}}\n\t\t\tYou've invited {{dangerouslyRenderHTML success_invites_html}}, but\n\t\t{{\/if}}\n\t\t<span class=\"bold\">{{error_invites.length}} {{pluralize error_invites.length 'invitation' 'invitations'}} didn't send<\/span>. Review the errors below.\n\t{{else}}\n\t\tYou've invited {{dangerouslyRenderHTML success_invites_html}} to {{team_name}}.\n\t{{\/if}}\n<\/p>\n\n{{#if success_invites}}\n\t{{#feature flag=\"feature_name_tagging_client\"}}\n\t\t<table class=\"addresses large_bottom_margin align_left full_width\">\n\t\t\t<tr>\n\t\t\t\t<th class=\"span_1_of_2\">Email Address<\/th>\n\t\t\t\t<th class=\"span_1_of_2\">Full Name<\/th>\n\t\t\t<\/tr>\n\t\t\t{{#each success_invites}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"align_top\">{{this.email}}<\/td>\n\t\t\t\t\t<td>{{this.full_name}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/each}}\n\t\t<\/table>\n\t{{else}}\n\t\t<table class=\"addresses large_bottom_margin align_left full_width\">\n\t\t\t<tr>\n\t\t\t\t<th class=\"span_1_of_2\">Email Address<\/th>\n\t\t\t\t<th class=\"span_1_of_2\">Name<\/th>\n\t\t\t<\/tr>\n\t\t\t{{#each success_invites}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"align_top\">{{this.email}}<\/td>\n\t\t\t\t\t<td>{{this.first_name}} {{this.last_name}}<\/td>\n\t\t\t\t<\/tr>\n\t\t\t{{\/each}}\n\t\t<\/table>\n\t{{\/feature}}\n{{\/if}}\n\n{{#if error_invites}}\n\t<table class=\"addresses error large_bottom_margin align_left full_width\">\n\t\t<tr>\n\t\t\t<th class=\"span_1_of_2\">Email Address<\/th>\n\t\t\t<th class=\"span_1_of_2\">What went wrong<\/th>\n\t\t<\/tr>\n\t\t{{#each error_invites}}\n\t\t\t<tr>\n\t\t\t\t<td class=\"align_top\">{{this.email}}<\/td>\n\t\t\t\t<td>{{dangerouslyRenderHTML this.error_msg}}<\/td>\n\t\t\t<\/tr>\n\t\t{{\/each}}\n\t<\/table>\n{{\/if}}\n\n{{#if custom_message}}\n\t<table class=\"large_bottom_margin align_left full_width\">\n\t\t<tr>\n\t\t\t<th class=\"span_1_of_1\">Custom Message<\/th>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td class=\"align_top break_word\">{{custom_message}}<\/td>\n\t\t<\/tr>\n\t<\/table>\n{{\/if}}\n\n{{#if domains}}\n\t<div class=\"alert alert_success no_bottom_margin clearfix\">\n\t\t<i class=\"ts_icon ts_icon_check_circle_o\"><\/i>\n\t\t<p class=\"value_proposition\">You can set <strong>{{team_name}}<\/strong> to allow automatic sign up from anyone with a confirmed email address.<\/p>\n\t\t{{#if paid_team}}<p class=\"value_proposition\">Slack will automatically charge or credit your account when active members are added to or removed from your team.<\/p>{{\/if}}\n\t\t<p class=\"top_margin\">\n\t\t\t<span class=\"col span_3_of_4 no_right_padding small_bottom_margin\">\n\t\t\t\t<input type=\"text\" id=\"invite_signup_domains\" class=\"no_bottom_margin small\" value=\"{{domains}}\" \/>\n\t\t\t<\/span>\n\t\t\t<button class=\"btn ladda-button col span_1_of_4\" data-style=\"expand-right\" data-action=\"add_signup_domains\">Set Up<\/button>\n\t\t\t<span class=\"input_note col span_1_of_1 no_margin\">To allow email addresses from multiple domains, separate them with commas.<\/span>\n\t\t<\/p>\n\t<\/div>\n{{\/if}}\n\n<p class=\"large_top_padding\">\n\t{{#if is_admin}}\n\t\t<a class=\"btn btn_outline col span_1_of_3\" href=\"\/admin\/invites\" {{#isClient}}target=\"admin_invites\"{{\/isClient}}>View Pending Invites<\/a>\n\t{{\/if}}\n\t{{#if error_invites}}\n\t\t<button class=\"btn btn_outline col {{#if is_admin}}span_1_of_3{{else}}span_1_of_2{{\/if}}\" data-action=\"admin_invites_try_again\">Try Again<\/button>\n\t{{else}}\n\t\t<button class=\"btn btn_outline col {{#if is_admin}}span_1_of_3{{else}}span_1_of_2{{\/if}}\" data-action=\"admin_invites_reset\">Invite More People<\/button>\n\t{{\/if}}\n\t<button class=\"btn btn_outline col {{#if is_admin}}span_1_of_3{{else}}span_1_of_2{{\/if}} dialog_cancel\">Done<\/button>\n<\/p>";
TS.raw_templates['admin_invite_switcher'] = "{{i18n_ns 'invite'}}\n<hr id=\"admin_invites_header_divider\" class=\"hide_on_mobile\" \/>\n<div class=\"admin_invites_account_type_option {{#if hide_full_member_option}}disabled{{\/if}} {{#if team_in_org}}no_hover{{\/if}}\" data-action=\"switch_type\" data-account-type=\"full\">\n\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"normal small_bottom_margin\">{{#t note=\"type of invitee who can access any public channel\"}}Full Members{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\t<p>\n\t\t{{#t}}Full Members can access messages and files in any public channel and access the full directory.{{\/t}}\n\t<\/p>\n\t{{#unless hide_full_member_option}}\n\t\t<i class=\"option_arrow ts_icon ts_icon_arrow_right ts_icon_inherit\"><\/i>\n\t{{else}}\n\t\t{{#unless team_in_org}}\n\t\t<div class=\"account_type_disabled_hover\">\n\t\t\t<p class=\"bottom_margin\">{{#t}}Full members can sign up at <strong>{team_signup_url}<\/strong>{{\/t}}<\/p>\n\t\t\t<a href=\"\/admin\/auth\/saml\" {{#isClient}}target=\"auth\"{{\/isClient}} class=\"btn btn_outline\">{{#t}}Change SSO Settings{{\/t}}<\/a>\n\t\t<\/div>\n\t\t{{\/unless}}\n\t{{\/unless}}\n<\/div>\n<div class=\"admin_invites_account_type_option\" data-action=\"switch_type\" data-account-type=\"restricted\">\n\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"normal small_bottom_margin\">{{#t}}Multi-Channel Guests{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\t<p>{{#t}}Multi-Channel Guests see a partial directory and can only access messages and files from selected channels.{{\/t}}<\/p>\n\t<i class=\"option_arrow ts_icon ts_icon_arrow_right ts_icon_inherit\"><\/i>\n<\/div>\n<div class=\"admin_invites_account_type_option {{#unless can_add_ura}}disabled{{\/unless}}\" data-action=\"switch_type\" data-account-type=\"ultra_restricted\">\n\t<{{#isClient}}h2{{else}}h3{{\/isClient}} class=\"normal small_bottom_margin\">{{#t note=\"guests who will only be able to access one channel\"}}Single-Channel Guests{{\/t}}<\/{{#isClient}}h2{{else}}h3{{\/isClient}}>\n\t<p>{{#t}}Single-Channel Guests can only access messages and files in a single channel. This account type is free.{{\/t}} <a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ\" target=\"zendesk\" class=\"subtle_silver underline\">{{#t}}Learn more{{\/t}}<\/a><\/p>\n\t{{#unless can_add_ura}}\n\t\t<div class=\"account_type_disabled_hover\">\n\t\t\t<p class=\"bottom_margin\">{{#t}}You've reached your team limit for <strong>Single-Channel Guests<\/strong>.{{\/t}}<\/p>\n\t\t\t<a href=\"https:\/\/slack.zendesk.com\/hc\/en-us\/articles\/202518103-Restricted-account-and-single-channel-guest-FAQ\" target=\"zendesk\" class=\"btn btn_outline\">{{#t}}Learn More{{\/t}}<\/a>\n\t\t<\/div>\n\t{{\/unless}}\n\t<i class=\"option_arrow ts_icon ts_icon_arrow_right ts_icon_inherit\"><\/i>\n<\/div>\n{{#currentUserIsAdmin}}\n\t<p class=\"align_center large_top_margin\">\n\t\t<a href=\"\/admin\/invites\" target=\"{{newWindowName}}\">{{#t}}See pending and accepted invites for your team{{\/t}}<\/a>\n\t<\/p>\n{{\/currentUserIsAdmin}}";
