TS.raw_templates['developer_apps_event_table'] = "<div class=\"{{type}}_events_table_container\">\n\t<table id=\"{{type}}_events_table\" class=\"events_table full_width no_bottom_border no_bottom_margin {{#unless events}} hidden{{\/unless}}\">\n\t\t<thead>\n\t\t\t<tr>\n\t\t\t\t<th class=\"no_bottom_margin no_border\">\n\t\t\t\t\tEvent Name\n\t\t\t\t<\/th>\n\t\t\t\t<th class=\"no_bottom_margin no_border\">\n\t\t\t\t\tDescription\n\t\t\t\t<\/th>\n\t\t\t\t{{#unless is_bot}}\n\t\t\t\t\t<th class=\"no_bottom_margin no_border\">\n\t\t\t\t\t\tRequired Scope\n\t\t\t\t\t<\/th>\n\t\t\t\t{{\/unless}}\n\t\t\t<\/tr>\n\t\t<\/thead>\n\t\t\t{{#each events as |event|}}\n\t\t\t<tbody>\n\t\t\t\t\t<tr class=\"no_padding\" \n\t\t\t\t\t\t{{#unless event.current}}data-pending{{\/unless}} \n\t\t\t\t\t\tdata-event-type=\"{{@key}}\" data-event-scope=\"{{event.scope}}\" \n\t\t\t\t\t\tdata-event-description=\"{{event.description}}\" data-table=\"{{..\/type}}\"\n\t\t\t\t\t>\n\t\t\t\t\t\t<td class=\"no_bottom_padding\">\n\t\t\t\t\t\t\t<a class=\"overflow_ellipsis small {{#if event.pending_removal}}pending_removal{{\/if}} {{#if event.current}}current_{{else}}pending_{{\/if}}event_subscription_name\"\n\t\t\t\t\t\t\t\thref=\"\/events\/{{@key}}\" target=\"_blank\" data-is-pending-removal=\"{{#if pending_removal}}true{{else}}false{{\/if}}\">\n\t\t\t\t\t\t\t\t{{@key}}\n\t\t\t\t\t\t\t<\/a>\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t\t<td class=\"no_bottom_padding medium_right_padding {{#if event.pending_removal}}pending_removal{{\/if}}\">\n\t\t\t\t\t\t\t<p class=\"event_description small\">{{event.description}}<\/p>\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t\t{{#unless ..\/is_bot}}\n\t\t\t\t\t\t\t<td class=\"no_bottom_padding {{#if event.pending_removal}}pending_removal{{\/if}}\">\n\t\t\t\t\t\t\t\t<p class=\"event_scope small\">{{event.scope}}<\/p>\n\t\t\t\t\t\t\t<\/td>\n\t\t\t\t\t\t{{\/unless}}\n\t\t\t\t\t\t<td class=\"no_bottom_padding\">\n\t\t\t\t\t\t\t{{!-- We set the flex direction to row_reverse so that if no description exists, the icons still appear on the right hand side  --}}\n\t\t\t\t\t\t\t<div class=\"display_flex flex_direction_row_reverse no_wrap\">\n\t\t\t\t\t\t\t\t\t<ts_icon class=\"{{#if event.current}}delete_event{{else}}remove_event{{\/if}} {{#if event.pending_removal}}ts_icon_undo{{else}}ts_icon_trash{{\/if}} btn_icon ts_icon cursor_pointer\" \n\t\t\t\t\t\t\t\t\t\taria-label=\"Delete\">\n\t\t\t\t\t\t\t\t\t<\/ts_icon>\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t<\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t<\/tbody>\n\t\t\t{{else}}\n\t\t\t\t<tbody class=\"no_border\">\n\t\t\t\t\t<tr class=\"no_bottom_border\">\n\t\t\t\t\t\t<td class=\"subtle_silver small\"><i>No events added yet.<\/i><\/td>\n\t\t\t\t\t<\/tr>\n\t\t\t\t<\/tbody>\n\t\t\t{{\/each}}\n\t<\/table>\n<\/div>\n";
TS.raw_templates['developer_apps_new_modal'] = "{{!-- Possible Error --}}\n<p class=\"alert alert_error hidden\" id=\"developer_apps_new_error\">\n\t<ts-icon class=\"ts_icon ts_icon_warning\"><\/ts-icon>\n\t<span class=\"error_message\">Oops, something went wrong! Try again?<\/span>\n<\/p>\n\n<form action=\"\/apps\/create_new\" enctype=\"multipart\/form-data\" method=\"post\" id=\"developer_apps_new_form\" class=\"application_config\">\n\t<input type=\"hidden\" name=\"done\" value=\"1\">\n\t<input type=\"hidden\" name=\"crumb\" value=\"{{crumb}}\">\n\n\t{{!-- App Name --}}\n\t<label for=\"name\">App Name<\/label>\n\t<input type=\"text\" name=\"name\" placeholder=\"e.g. Super Service\" class=\"no_bottom_margin overflow_ellipsis\" value=\"\" autocomplete=\"off\"\n\t\tdata-validation=\"required keywords maxlength=35\">\n\t<aside>Don't worry; you'll be able to change this later.<\/aside>\n\n\t{{!-- Team Selector --}}\n\t<label class=\"top_margin\">Development Slack Team<\/label>\n\t<span class=\"team_picker menu_launcher_large overflow_ellipsis full_width block\">\n\t\t<img class=\"small_border_radius\" src=\"{{teams.[0].icon_src}}\">\n\t\t<span class=\"selected_team_name\">{{teams.[0].name}}<\/span>\n\t<\/span>\n\t<aside>\n\t\t{{#feature flag=\"feature_multiple_app_ownership\"}}\n\t\t\tYour app belongs to this team\u2014leaving this team will remove your ability to manage this app. Unfortunately, this can\u2019t be changed later.\n\t\t{{else}}\n\t\t\tThis team owns your Slack app (and if you lose access to the team, you won't be able to administer the app).\n\t\t\tYou can't change this later.\n\t\t{{\/feature}}\n\t<\/aside>\n\t<ul id=\"teams_list\" class=\"hidden\">\n\t\t{{#each teams}}\n\t\t\t<li role=\"menuitem\" data-team-id=\"{{this.encoded_id}}\" data-team-name=\"{{this.name}}\"><a>\n\t\t\t\t<img src=\"{{this.icon_src}}\">\n\t\t\t\t{{this.name}}\n\t\t\t<\/a><\/li>\n\t\t{{\/each}}\n\t\t<li role=\"menuitem\" class=\"avatar_menu_signin_item\">\n\t\t\t<a href=\"https:\/\/slack.com\/signin\">\n\t\t\t\t<ts-icon class=\"ts_icon_plus\"><\/ts-icon>\n\t\t\t\tSign in to another team\n\t\t\t<\/a>\n\t\t<\/li>\n\t<\/ul>\n\n\t{{!-- Hidden input for id of team selected, since the team selector is actually a menu --}}\n\t<input name=\"team_id\" class=\"hidden\" value=\"{{teams.[0].encoded_id}}\" \/>\n\n\t{{!-- Enable Submission Checkbox --}}\n\t<label class=\"checkbox top_margin no_bottom_margin\">\n\t\t<input type=\"checkbox\" name=\"create_submission\"> I plan to submit this app to the Slack App Directory.\n\t<\/label>\n\t<aside>\n\t\tWe'll help you get your app ready for submission. If you're not sure, you can decide\n\t\tto submit later.\n\t<\/aside>\n\n\t{{!-- ToS Agreement --}}\n\t<div class=\"small top_margin\">By creating a Web API Application, you agree to the <a target=\"_blank\" href=\"\/terms-of-service\/api\">Slack API Terms of Service<\/a>.<\/div>\n<\/form>\n";
