TS.raw_templates['fs_modal_file_viewer_header'] = "{{i18n_ns \"file_viewer\"}}\n<header class=\"fs_modal_file_viewer_header{{#if link_url}} external{{\/if}}\">\n\t{{#if member}}\n\t\t<div class=\"star_btn btn_icon btn star_file\">\n\t\t\t{{starWithTip star_type star_ob star_parent_ob}}\n\t\t<\/div>\n\t{{\/if}}\n\n\t{{> file_header_detailed}}\n\n\t<div class=\"controls\">\n\n\t\t{{#if actions.download}}\n\t\t\t<a href=\"{{file.url_private_download}}\" target=\"{{newWindowName}}\" data-file-id=\"{{file.id}}\" class=\"download_btn control_btn btn_icon btn ts_icon ts_icon_cloud_download ts_tip ts_tip_bottom file_ssb_download_link\">\n\t\t\t\t<div class=\"ts_tip_tip\">{{#t}}Download{{\/t}}\n\t\t\t\t\t<div class=\"muted_tooltip_info\">{{makeFileSize file}}<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"flex_menu_download_circle\"><\/div>\n\t\t\t<\/a>\n\t\t{{\/if}}\n\n\t\t{{#if link_url}}\n\t\t\t<a {{makeRefererSafeLink url=link_url}} target=\"_blank\" class=\"open_btn control_btn btn_icon btn ts_icon ts_icon_external_link ts_tip ts_tip_bottom\">\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}Open original{{\/t}}<\/span>\n\t\t\t<\/a>\n\t\t{{\/if}}\n\n\t\t{{#if actions.more}}\n\t\t\t<button data-file-id=\"{{file.id}}\"\n\t\t\t\tclass=\"more_btn control_btn btn_icon btn ts_icon ts_icon_ellipsis_o ts_tip ts_tip_bottom file_actions\"\n\t\t\t\tdata-include-view-public-link=\"true\"\n\t\t\t\tdata-exclude-rxn=\"true\"{{! no way to update reactions in this fs modal :( }}\n\t\t\t\tdata-exclude-edit-title=\"true\"{{! don\u2019t show rename changing in flexpane, it\u2019s behind the fs modal }}\n\t\t\t\tdata-exclude-download=\"true\"{{! download is outside menu above \u2191 }}\n\t\t\t\tdata-exclude-comment=\"true\"{{! comments are below \u2193 }}\n\t\t\t>\n\t\t\t\t<span class=\"ts_tip_tip\">{{#t}}More actions{{\/t}}<\/span>\n\t\t\t<\/button>\n\t\t{{\/if}}\n\n\t\t{{#if actions.comment}}\n\t\t\t<button class=\"comment_btn control_btn btn ts_tip ts_tip_bottom {{#if is_comment_panel_active}}active{{\/if}}\">\n\t\t\t\t<ts-icon class=\"ts_icon ts_icon_comment_o\"><\/ts-icon>\n\t\t\t\t<span class=\"comment_count\">{{comments_count}}<\/span>\n\t\t\t\t<span class=\"ts_tip_tip\" data-tip-toggle-auto=\"{{#t}}Hide comments{{\/t}}\">{{#t}}View comments{{\/t}}<\/span>\n\t\t\t<\/button>\n\t\t{{\/if}}\n\n\t\t<button id=\"fs_modal_close_btn\" class=\"close_btn control_btn btn_icon btn ts_icon ts_icon_times ts_tip ts_tip_bottom ts_tip_right\">\n\t\t\t<div class=\"ts_tip_tip\">{{#t}}Close{{\/t}}\n\t\t\t\t<div class=\"muted_tooltip_info\">{{#t}}(esc){{\/t}}<\/div>\n\t\t\t<\/div>\n\t\t<\/button>\n\n\t<\/div>\n<\/header>\n";
TS.raw_templates['fs_modal_file_viewer_aside'] = "<aside class=\"aside_panel\">\n\t{{#feature flag=\"feature_share_mention_comment_cleanup\"}}\n\t\t<div class=\"details_container\">\n\t\t\t{{> fs_modal_file_viewer_details}}\n\t\t<\/div>\n\t{{\/feature}}\n\n\t<div class=\"comments_container\">\n\t\t{{> fs_modal_file_viewer_comments}}\n\t<\/div>\n\n\t<div class=\"file_comment_form_container{{#unless actions.comment}} hidden{{\/unless}}\"><\/div>\n<\/aside>\n";
TS.raw_templates['fs_modal_file_viewer_details'] = "{{i18n_ns \"file_viewer\"}}\n<header class=\"details_header\">\n\t<button class=\"aside_close_btn\">{{#t}}Close{{\/t}}<\/button>\n\t<h4 class=\"details_label\">{{#t}}Conversations{{\/t}}<\/h4>\n<\/header>\n\n<div class=\"shared_to_conversations\"><\/div>\n";
TS.raw_templates['fs_modal_file_viewer_comments'] = "{{i18n_ns \"file_viewer\"}}\n{{#if actions.comment}}\n\n\t<header class=\"comment_header\">\n\t\t{{#feature flag=\"feature_share_mention_comment_cleanup\"}}\n\t\t\t<button class=\"aside_back_btn\">{{#t}}See all{{\/t}}<\/button>\n\t\t{{\/feature}}\n\t\t<button class=\"aside_close_btn\">{{#t}}Close{{\/t}}<\/button>\n\t\t<h4 class=\"comment_label\">\n\t\t\t{{#feature flag=\"feature_share_mention_comment_cleanup\"}}\n\t\t\t\t{{#if name}}\n\t\t\t\t\t{{name}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Comments{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Comments{{\/t}}\n\t\t\t{{\/feature}}\n\t\t<\/h4>\n\t<\/header>\n\n\t<div class=\"file_comments_{{file.id}} comments\">{{comments file}}<\/div>\n\n\t<div class=\"no_comment\">{{#t}}Be the first to leave a comment{{\/t}}<\/div>\n\n{{\/if}}\n";
TS.raw_templates['fs_modal_file_viewer_content_image'] = "<div class=\"images\">\n\n\t<figure class=\"scaled\">\n\t\t<img src=\"{{scaled_src}}\" alt=\"\"\n\t\t\tclass=\"scaled_image{{#if scaled_rotation}} orientation_{{file.image_exif_rotation}}{{\/if}}\"\n\t\t\t{{#if scaled_rotation}}data-exif-orientation=\"{{file.image_exif_rotation}}\"{{\/if}}\n\t\t>\n\t<\/figure>\n\n\t{{#if actual_pixel_src}}\n\t\t<figure class=\"actual_pixel\">\n\t\t\t<div class=\"actual_pixel_center\">\n\t\t\t\t<img src=\"{{actual_pixel_src}}\" alt=\"\"\n\t\t\t\t\tclass=\"actual_pixel_image{{#if actual_pixel_rotation}} orientation_{{file.image_exif_rotation}}{{\/if}}\"\n\t\t\t\t\t{{#if actual_pixel_rotation}}data-exif-orientation=\"{{file.image_exif_rotation}}\"{{\/if}}\n\t\t\t\t>\n\t\t\t<\/div>\n\t\t<\/figure>\n\t{{\/if}}\n\n<\/div>{{!--\/images--}}\n";
