TS.raw_templates['help_modal_footer_status'] = "{{i18n_ns \"help\"}}\n\n{{#if settings.is_old_tickets}}\n<p id=\"no_open_issues\">\n\t{{#t}}No pending requests.{{\/t}} <a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_request_history,trigger=click_view_request_history\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\">{{#t}}View your help request history{{\/t}}<\/a>.\n<\/p>\n{{\/if}}\n\n{{#if settings.is_unread}}\n<p id=\"unread_issues\">\n\t{{#if settings.is_unread_many}}\n\t<span id=\"unread_issues_many\">\n\t\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_new_replies,trigger=click_view_new_replies\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge candy_red_bg\" id=\"unread_issues_count_txt\">{{settings.unread_count}}<\/span>{{#t}}You have new replies to your help requests.{{\/t}}<\/a>\n\t<\/span>\n\t{{else}}\n\t<span id=\"unread_issues_singular\">\n        <a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_new_replies,trigger=click_view_new_replies\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge candy_red_bg\">1<\/span>{{#t}}You have a new reply to your help request.{{\/t}}<\/a>\n\t<\/span>\n\t{{\/if}}\n<\/p>\n{{\/if}}\n\n{{#if settings.is_open}}\n<p id=\"open_issues\" class=\"bottom_margin\">\n\t{{#if settings.is_open_many}}\n\t<span id=\"open_issues_many\">\n\t\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_open_requests,trigger=click_view_open_requests\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge seafoam_green_bg\" id=\"open_issues_count_txt\">{{settings.open_count}}<\/span>{{#t}}You have open help requests.{{\/t}}<\/a>\n\t<\/span>\n\t{{else}}\n\t<span id=\"open_issues_singular\">\n\t\t<a data-clog-click=\"true\" data-clog-event=\"HELP_MODAL_ACTION\" data-clog-params=\"action=view_open_requests,trigger=click_view_open_requests\" href=\"\/help\" target=\"{{newWindowName}}\" class=\"bold\"><span class=\"badge seafoam_green_bg\">1<\/span>{{#t}}You have an open help request.{{\/t}}<\/a>\n\t<\/span>\n\t{{\/if}}\n<\/p>\n{{\/if}}\n";
TS.raw_templates['prefs_sidebar'] = "<li><a class=\"sidebar_menu_list_item\" data-section=\"notifications\">Notifications<\/a><\/li>\n{{#if show_win_ssb_prefs}}<li><a class=\"sidebar_menu_list_item\" data-section=\"win_ssb\">Windows App<\/a><\/li>{{\/if}}\n{{#if show_lin_ssb_prefs}}<li><a class=\"sidebar_menu_list_item\" data-section=\"lin_ssb\">Linux App<\/a><\/li>{{\/if}}\n<li><a class=\"sidebar_menu_list_item\" data-section=\"messages_media\">Messages & Media<\/a><\/li>\n<li><a class=\"sidebar_menu_list_item\" data-section=\"themes\">Sidebar Theme<\/a><\/li>\n<li><a class=\"sidebar_menu_list_item\" data-section=\"search\">Search<\/a><\/li>\n<li><a class=\"sidebar_menu_list_item\" data-section=\"read_state_tracking\">Mark as Read<\/a><\/li>\n{{#if show_a11y_prefs}}<li><a class=\"sidebar_menu_list_item\" data-section=\"a11y\">Accessibility<\/a><\/li>{{\/if}}\n{{#feature flag=\"feature_unread_view\"}}\n\t<li><a class=\"sidebar_menu_list_item\" data-section=\"advanced\">Advanced<\/a><\/li>\n{{else}}\n\t<li><a class=\"sidebar_menu_list_item\" data-section=\"advanced\">Advanced Options<\/a><\/li>\n{{\/feature}}\n{{#if show_labs_prefs}}<li><a class=\"sidebar_menu_list_item\" data-section=\"labs\">Labs (TS Only)<\/a><\/li>{{\/if}}\n";
TS.raw_templates['prefs_notifications'] = "<div id=\"prefs_notifications\" class=\"section_rollup\">\n\n\t<h2 class=\"section_rollup_header\"><ts-icon class=\"ts_icon_bell_o candy_red small_right_margin\"><\/ts-icon>Notification Settings<\/h2>\n\t<p class=\"section_rollup_summary\"><\/p>\n\t<div class=\"section_rollup_details\">\n\n\t\t<div class=\"growls_stuff\" id=\"growls_permission_div\">\n\t\t\t<h4 class=\"desktop_notifications_title\">Desktop Notifications are currently disabled<\/h4>\n\t\t\t<p>We strongly recommend enabling notifications so that you'll know when important activity happens on your Slack team.<\/p>\n\t\t\t<p><a class=\"btn btn_success\" id=\"growls_permission_link\"><ts-icon class=\"ts_icon_bell ts_icon_inherit small_right_margin\"><\/ts-icon>Enable desktop notifications<\/a><\/p>\n\t\t<\/div>\n\t\t<div class=\"growls_stuff\" id=\"growls_instructions_div\">\n\t\t\t<h4 class=\"desktop_notifications_title\">Desktop Notifications<\/h4>\n\t\t\t<p class=\"alert alert_info\"><i class=\"ts_icon ts_icon_info_circle\"><\/i>Click <strong>Allow<\/strong> in your browser's pop-up to enable notifications.<\/p>\n\t\t<\/div>\n\t\t<div class=\"growls_stuff\" id=\"growls_disallowed_div\">\n\t\t\t<h4 class=\"desktop_notifications_title\">Desktop Notifications are currently disabled<\/h4>\n\t\t\t<p class=\"alert alert_warning\"><i class=\"ts_icon ts_icon_warning\"><\/i>You've disallowed notifications in your browser. You'll need to open your browser preferences to change that.<\/p>\n\t\t<\/div>\n\t\t<div class=\"growls_stuff\" id=\"growls_impossible_div\">\n\t\t\t<h4 class=\"desktop_notifications_title\">Desktop Notifications are currently disabled<\/h4>\n\t\t\t<p><ts-icon class=\"ts_icon_exclamation_triangle\"><\/ts-icon>Your browser does not support desktop notifications. <a href=\"\/downloads\" target=\"_blank\">Try one of our apps<\/a><\/p>\n\t\t<\/div>\n\n\t\t<div class=\"growls_stuff\" id=\"growls_allowed_div\">\n\t\t\t<h4 class=\"desktop_notifications_title inline_block\" id=\"prefs_send_notifications_for\">Send notifications for:<\/h4>\n\t\t\t<p>\n\t\t\t\t<label class=\"radio\">\n\t\t\t\t\t<input name=\"notifications_rd\" type=\"radio\" value=\"all\" data-inline-saver=\"#prefs_send_notifications_for\">\n\t\t\t\t\tAll activity\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"radio\">\n\t\t\t\t\t<input name=\"notifications_rd\" type=\"radio\" value=\"mentions\" data-inline-saver=\"#prefs_send_notifications_for\">\n\t\t\t\t\tOnly direct messages and highlight words <span class=\"normal subtle_silver left_margin\">Recommended<\/span>\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"radio\">\n\t\t\t\t\t<input name=\"notifications_rd\" type=\"radio\" value=\"never\" data-inline-saver=\"#prefs_send_notifications_for\">\n\t\t\t\t\tNothing <span class=\"normal subtle_silver left_margin\">Desktop notifications off<\/span>\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t\t<p id=\"no_non_default\" class=\"subtle_silver\">You can override your desktop notification preference on a channel-by-channel basis by selecting <em>Channel notification preferences<\/em> in the channel menu. Or, <a href=\"\/account\/notifications\" target=\"{{newWindowName}}\">set preferences for email and mobile notifications<\/a>.<\/p>\n\t\t\t<p class=\"non_default subtle_silver\">Some of your channels have <strong id=\"non_default_tip_link\" class=\"cursor_pointer\">different notification settings<\/strong>. You can also <a href=\"\/account\/notifications\" target=\"{{newWindowName}}\">set preferences for email and mobile notifications<\/a>.<\/p>\n\t\t<\/div>\n\n\t\t<h4 class=\"large_top_margin inline_block\" id=\"prefs_sounds\">Sounds<\/h4>\n\t\t<p class=\"clearfix\">\n\t\t\t{{#foreach notification_sounds}}\n\t\t\t\t<label class=\"radio sound_option\">\n\t\t\t\t\t<input name=\"sound_option_rd\" type=\"radio\" value=\"{{value.value}}\" data-inline-saver=\"#prefs_sounds\">\n\t\t\t\t\t{{value.label}}\n\t\t\t\t\t{{#if_not_equal value.value compare=\"none\"}}<ts-icon class=\"ts_icon_volume_up ts_icon_inherit\"><\/ts-icon>{{\/if_not_equal}}\n\t\t\t\t<\/label>\n\t\t\t{{\/foreach}}\n\t\t<\/p>\n\t\t<p>\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"mute_sounds_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_mute_all_sounds_label\">\n\t\t\t\t<span id=\"prefs_mute_all_sounds_label\">Mute all sounds<\/span><br>\n\t\t\t\t<span class=\"normal subtle_silver\">Includes system alerts and notifications for messages<\/span>\n\t\t\t<\/label>\n\t\t<\/p>\n\n\t\t<h4 class=\"large_top_margin\">Notification Display<\/h4>\n\t\t<p>\n\t\t\t<label class=\"checkbox\">\n\t\t\t\t<input id=\"no_text_in_notifications_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_show_message_text_label\">\n\t\t\t\t<span id=\"prefs_show_message_text_label\">Show message text in notifications<\/span><br>\n\t\t\t\t<span class=\"normal subtle_silver\">Uncheck for additional privacy<\/span>\n\t\t\t<\/label>\n\t\t<\/p>\n\n\t\t{{#if show_mac_ssb_prefs}}\n\t\t\t<h4 id=\"prefs_dock_icon\" class=\"large_top_margin inline_block\">Dock App Icon<\/h4>\n\t\t\t<p>\n\t\t\t\t<label class=\"checkbox\">\n\t\t\t\t\t<input id=\"mac_ssb_bullet_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_dock_icon\">\n\t\t\t\t\tShow <img src=\"{{versioned_mac_dock_badge}}\" class=\"prefs_mac_dock_badge\"> symbol on icon to indicate unread activity\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"checkbox\">\n\t\t\t\t\t<input id=\"mac_ssb_bounce_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_dock_icon\">\n\t\t\t\t\tBounce dock icon when showing a notification\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"checkbox large_left_margin\">\n\t\t\t\t\t<input id=\"mac_ssb_bounce_short_cb\" checked=\"checked\" type=\"checkbox\" data-inline-saver=\"#prefs_dock_icon\">\n\t\t\t\t\tBounce it just once\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t{{\/if}}\n\n\t\t{{#if show_win_ssb_prefs}}\n\t\t\t<h4 id=\"winssb_notify_prefs_heading\" class=\"large_top_margin small_bottom_margin inline_block\">App Notification Settings<\/h4>\n\t\t\t<p id=\"winssb_flash_window_heading\" class=\"small_bottom_margin\">Flash window when a notification is received<\/p>\n\t\t\t<p id=\"winssb_flash_window_choices\">\n\t\t\t\t<label class=\"radio\">\n\t\t\t\t\t<input name=\"winssb_flash_window_rd\" type=\"radio\" value=\"never\" data-inline-saver=\"#winssb_notify_prefs_heading\">\n\t\t\t\t\tNever\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"radio\">\n\t\t\t\t\t<input name=\"winssb_flash_window_rd\" type=\"radio\" value=\"idle\" data-inline-saver=\"#winssb_notify_prefs_heading\">\n\t\t\t\t\tWhen left idle <span class='normal'>(inactive for at least 10 seconds)<\/span>\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"radio\">\n\t\t\t\t\t<input name=\"winssb_flash_window_rd\" type=\"radio\" value=\"always\" data-inline-saver=\"#winssb_notify_prefs_heading\">\n\t\t\t\t\tAlways\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\n\t\t\t<p id=\"winssb_notify_position\">\n\t\t\t\t<label class=\"select small col span_1_of_2 no_right_padding\">\n\t\t\t\t\tDisplay notifications on the \n\t\t\t\t\t<select id=\"winssb_notify_corner\" class=\"small\" data-inline-saver=\"#winssb_notify_prefs_heading\">\n\t\t\t\t\t\t<option value=\"bottom_right\">bottom-right<\/option>\n\t\t\t\t\t\t<option value=\"top_right\">top-right<\/option>\n\t\t\t\t\t\t<option value=\"top_left\">top-left<\/option>\n\t\t\t\t\t\t<option value=\"bottom_left\">bottom-left<\/option>\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t\t<label class=\"select small col span_1_of_2 no_right_padding\" data-inline-saver=\"#winssb_notify_prefs_heading\">\n\t\t\t\t\tcorner of the\n\t\t\t\t\t<select id=\"winssb_notify_display\" class=\"small\">\n\t\t\t\t\t\t<option value=\"same_as_app\">same display as app<\/option>\n\t\t\t\t\t\t<option value=\"primary\">primary display<\/option>\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t{{\/if}}\n\n\t\t<p><button id=\"growls_test\" class=\"btn btn_outline\"><i class=\"ts_icon