TS.raw_templates['unread_error'] = "{{i18n_ns \"all_unreads\"}}\n<div class=\"unread_empty_state_wrapper\">\n\t<div class=\"unread_empty_state unread_error_state\">\n\t\t{{emoji}}\n\t\t<div class=\"unread_error_state_message align_center\">{{#t}}Something\u2019s fishy! Slack can\u2019t seem to load your unread messages. We\u2019ll keep trying, or you can try again now.{{\/t}}<\/div>\n\t\t<button type=\"button\" class=\"btn unread_error_state_refresh_button\">{{#t}}Try Now{{\/t}}<\/button>\n\t<\/div>\n<\/div>";
