TS.raw_templates['unread_sort_order_menu'] = "{{i18n_ns \"all_unreads\"}}\n\n<div class=\"section_header\"><hr><span class=\"header_label menu_mini\">\n\t{{#t note=\"This this the heading for a sort group of options and will be followed by things like alphabettically and scientifically\"}}Sort&hellip;{{\/t}}\n<span><\/div>\n\n<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='alphabetical'}}selected{{\/if_equal}}\"><a data-sort-order=\"alphabetical\">\n\t<ts-icon class=\"ts_icon_check_small\"><\/ts-icon> {{#t note=\"A sorting option for unread channels\"}}Alphabetically{{\/t}}\n<\/a><\/li>\n{{#if is_paid_team}}\n\t<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='priority'}}selected{{\/if_equal}}\"><a data-sort-order=\"priority\">\n\t\t<ts-icon class=\"ts_icon_check_small\"><\/ts-icon> {{#t note=\"A sorting option for unread channels\"}}Scientifically{{\/t}}\n\t\t<ts-icon class=\"ts_icon_question_circle ts_tip ts_tip_top\">\n\t\t\t<span class=\"ts_tip_tip\">{{#t}}This sorts your unreads<br> based on how you use Slack.{{\/t}}<\/span>\n\t\t<\/ts-icon>\n\t<\/a><\/li>\n{{\/if}}\n<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='newest'}}selected{{\/if_equal}}\"><a data-sort-order=\"newest\">\n\t<ts-icon class=\"ts_icon_check_small\"><\/ts-icon> {{#t note=\"A sorting option for unread channels\"}}Newest{{\/t}}\n<\/a><\/li>\n<li role=\"menuitem\" class=\"{{#if_equal sort_order compare='oldest'}}selected{{\/if_equal}}\"><a data-sort-order=\"oldest\">\n\t<ts-icon class=\"ts_icon_check_small\"><\/ts-icon> {{#t note=\"A sorting option for unread channels\"}}Oldest{{\/t}}\n<\/a><\/li>";
TS.raw_templates['apps_restrict_app_modal_body'] = "{{#if is_api_tester}}\n\t<p class=\"no_margin\">\n\t\tWe'll send {{#if user_name}}<b>{{user_name}}<\/b>{{else}}this user{{\/if}}\n\t\ta message that you've denied their request.\n\t<\/p>\n{{else if is_custom_integration}}\n\t<p class=\"no_margin\">\n\t\t{{#if user_name}}<b>{{user_name}}<\/b>{{else}}This user{{\/if}}\n\t\twill not be able to add a configuration for\n\t\t{{#if app_name}}{{app_name}}{{else}}this app{{\/if}}.\n\t<\/p>\n{{else}}\n\t<p>\n\t\tTeam members will\n\t\t{{#if request_id}}not{{else}}no longer{{\/if}}\n\t\tbe able to add or edit {{app_name}} configurations.\n\t<\/p>\n\t<p class=\"no_margin\">\n\t\t{{#if config_count}}\n\t\t\t<b>{{config_count}} existing {{pluralize config_count 'configuration'}}<\/b> will remain in use until removed from Team Apps.\n\t\t{{else}}\n\t\t\tThere are no existing configurations.\n\t\t{{\/if}}\n\t<\/p>\n{{\/if}}\n";
